726	Submodelo_Avaluos_V1_0.AV_TipificacionConstruccionTipo	\N	0	Residencial_1_Bajo_Bajo	\N	f	Residencial 1 – (Bajo-Bajo)	Las viviendas que pertenecen a este grupo están construidas sin planeación alguna y generalmente con materiales de desecho tanto en las paredes como en los techos, construido o acondicionado para alojamiento, aunque no reúna las condiciones sanitarias indispensables. Generalmente carecen de algún servicio público básico y/o están ubicadas en zonas marginales no urbanizadas ni urbanizables, siendo de invasión y con escasez de vías de comunicación y transporte urbano.
727	Submodelo_Avaluos_V1_0.AV_TipificacionConstruccionTipo	\N	1	Residencial_2_Bajo	\N	f	Residencial 2 – (Bajo)	Las viviendas que pertenecen a este grupo están construidas con o sin planeación y generalmente con materiales como madera, prefabricado, ladrillo o bloque, cubiertas en zinc o teja de barro y con acabados sencillos, pueden disponer de algunos servicios públicos básicos, están situados por lo general en la periferia y disponen de algunas vías públicas sin pavimentar y escasos medios de transporte.
728	Submodelo_Avaluos_V1_0.AV_TipificacionConstruccionTipo	\N	2	Residencial_3_Medio_Bajo	\N	f	Residencial 3 – (Medio-Bajo)	Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones técnicamente planeadas, con fachadas calificadas como regular, con muros de ladrillo o bloque, cubiertas de placa de concreto o teja en asbesto cemento. Generalmente cuentan con servicios públicos básicos, poseen vías de comunicación pavimentadas y medio de transporte urbano.
729	Submodelo_Avaluos_V1_0.AV_TipificacionConstruccionTipo	\N	3	Residencial_4_Medio	\N	f	Residencial 4 – (Medio)	Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones técnicamente planeadas con fachada calificada de regular a buena, estructura en concreto, muros de ladrillo o bloque revocados, estucados y pintados, cubiertas de placa de concreto o teja en asbesto cemento; baños y cocinas calificados como medianos enchapados.
730	Submodelo_Avaluos_V1_0.AV_TipificacionConstruccionTipo	\N	4	Residencial_5_Medio_Alto	\N	f	Residencial 5 – (Medio-Alto)	Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones totalmente terminadas y técnicamente planeadas con fachada calificada como buena así como sus acabados, estructura en concreto. Generalmente cuentan con muros de ladrillo o bloque, cubiertas de placa de concreto o con materiales de buena calidad; baños y cocinas calificados como buenos y tamaño entre mediano y grande.\nCuentan con todos los servicios públicos básicos y complementarios, con grandes zonas verdes, sociales y de recreación, parqueaderos y buenas vías de acceso.
731	Submodelo_Avaluos_V1_0.AV_TipificacionConstruccionTipo	\N	5	Residencial_6_Alto	\N	f	Residencial 6 – (Alto)	Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones con grandes áreas, amplios jardines o apartamentos lujosos, paredes de bloque o ladrillo, cubiertas de placa de concreto o con materiales de excelente calidad y cuentan con los servicios públicos básicos y complementarios.\nEstas viviendas están ubicadas en sectores exclusivos y disfrutan de amplias zonas verdes, sociales y de recreación, parqueaderos y excelentes vías de acceso.
