700	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_DestinacionEconomicaTipo	\N	9	Industrial	\N	f	Industrial	Se califica con destino industrial, aquellos predios donde se desarrollan actividades de producción, fabricación, preparación, recuperación, reproducción, ensamblaje, construcción, transformación, tratamiento y manipulación de materias primas para producir bienes o productos materiales y que no estén clasificados dentro de los predios mineros.
