LADM_COL_V3_0.ili	2.3	LADM_COL_V3_0{ ISO19107_PLANAS_V3_0}	INTERLIS 2.3;\n\n/** ISO 19152 LADM country profile COL Core Model.\n * \n * -----------------------------------------------------------\n * \n * LADM es un modelo conceptual de la realidad que concreta una ontología y establece una semántica para la administración del territorio.\n * \n * -----------------------------------------------------------\n *  revision history\n * -----------------------------------------------------------\n * \n *  30.01.2018/fm : Cambio del tipo de dato del atributo Ext_Direccion de la clase Unidad Espacial a ExtDireccion; atributo ext_PID de la calse LA_Interesado cambia de OID a ExtInteresado; Cambio de cardinalidad en relacion miembros entre LA_Interesado y LA_Agrupacion_Interesados de 0..1 a 0..*\n *  07.02.2018/fm-gc: Ajuste al tipo de dato de la unidad Peso, pasa a tener precision 1 para evitar ser tratado cmo atributo entero y aumentar su tamaño\n *  19.02.2018/fm-gc: ampliación del dominio al tipo de dato Peso\n *  26.02.2018/fm-lj: cambio del nombre del dominio ISO19125_Type a ISO19125_Tipo\n *  19.04.2018/vb fm: Ajuste al constraint Fraccion, denominador mayor a 0\n *  19.04.2018/vb fm: Cambio en la cardinalidad del atributo u_Local_Id de la clase LA_BAUnit de 0..1 a 1\n * 17.07.2018/fm : se incluye escritura en dominio COL_FuenteAdministrativaTipo\n * 10.08.2018/fm : Se eliminan los atributos ai_local_id y ai_espacio_de_nombres de la clase LA_Agrupacion_Interesados\n * 27.08.2018/fm : Ajuste a la cardinalidad de asociacion puntoFuente de 1..* a 0..*\n * 25.09.2018/at: Se ajusta la longitud del atributo Codigo_Registral_Transaccion en la clase COL_FuenteAdministrativa a 5 caracteres de acuerdo a la Resolución 3973 de 2018\n * -----------------------------------------------------------\n * \n *  (c) IGAC y SNR con apoyo de la Cooperacion Suiza\n * \n * -----------------------------------------------------------\n */\nMODEL LADM_COL_V3_0 (es)\nAT "http://www.proadmintierra.info/"\nVERSION "V1.2.0"  // 2019-08-13 // =\n  IMPORTS ISO19107_PLANAS_V3_0;\n\n  UNIT\n\n    PesoColombiano [COP] EXTENDS INTERLIS.MONEY;\n\n    Area (ABSTRACT) = (INTERLIS.LENGTH * INTERLIS.LENGTH);\n\n    MetroCuadrado [m2] EXTENDS Area = (INTERLIS.m * INTERLIS.m);\n\n    Centrimetro [cm] = 1 / 100 [INTERLIS.m];\n\n  TOPIC LADM_Nucleo(ABSTRACT) =\n\n    DOMAIN\n\n      CharacterString = TEXT*255;\n\n      /** Traducción del dominio CI_PresentationFormCode de la norma ISO 19115:2003. Indica el modo en el que se representan los datos.\n       */\n      CI_Forma_Presentacion_Codigo = (\n        /** Definición en la ISO 19115:2003.\n         */\n        !!@ ili2db.dispName = "Imagen"\n        Imagen,\n        !!@ ili2db.dispName = "Documento"\n        Documento,\n        /** Definición en la ISO 19115:2003.\n         */\n        !!@ ili2db.dispName = "Mapa"\n        Mapa,\n        /** Definición en la ISO 19115:2003.\n         */\n        !!@ ili2db.dispName = "Video"\n        Video,\n        /** Definición en la ISO 19115:2003.\n         */\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_AreaTipo = (\n        /** Corresponde al área gráfica inscrita en la base de datos catastral sobre un predio antes de efectuar la transformación al nuevo sistema de proyección para catastro.\n         */\n        !!@ ili2db.dispName = "Area catastral gráfica del predio"\n        Area_Catastral_Grafica,\n        /** Corresponde al área alfanumérica inscrita en la base de datos catastral sobre un predio antes de efectuar la transformación al nuevo sistema de proyección para catastro. En la mayoría de los casos el área alfanumérica corresponde al valor de área inscrita en los datos de Registro.\n         */\n        !!@ ili2db.dispName = "Area catastral alfanumérica"\n        Area_Catastral_Alfanumerica\n      );\n\n      COL_ContenidoNivelTipo = (\n        !!@ ili2db.dispName = "Construcción convencional"\n        Construccion_Convencional,\n        !!@ ili2db.dispName = "Construcción no convencional"\n        Construccion_No_Convencional,\n        !!@ ili2db.dispName = "Consuetudinario"\n        Consuetudinario,\n        !!@ ili2db.dispName = "Formal"\n        Formal,\n        !!@ ili2db.dispName = "Informal"\n        Informal,\n        !!@ ili2db.dispName = "Responsabilidad"\n        Responsabilidad,\n        !!@ ili2db.dispName = "Restricción derecho público"\n        Restriccion_Derecho_Publico,\n        !!@ ili2db.dispName = "Restricción derecho privado"\n        Restriccion_Derecho_Privado\n      );\n\n      COL_DimensionTipo = (\n        !!@ ili2db.dispName = "Dimensión 2D"\n        Dim2D,\n        !!@ ili2db.dispName = "Dimensión 3D"\n        Dim3D,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_EstadoRedServiciosTipo = (\n        !!@ ili2db.dispName = "Planeado"\n        Planeado,\n        !!@ ili2db.dispName = "En uso"\n        En_Uso,\n        !!@ ili2db.dispName = "Fuera de servicio"\n        Fuera_De_Servicio,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_EstructuraTipo = (\n        !!@ ili2db.dispName = "Croquis"\n        Croquis,\n        !!@ ili2db.dispName = "Línea no estructurada"\n        Linea_no_Estructurada,\n        !!@ ili2db.dispName = "Texto"\n        Texto,\n        !!@ ili2db.dispName = "Topológico"\n        Topologico\n      );\n\n      COL_FuenteEspacialTipo = (\n        /** Ilustración análoga del levantamiento catastral de un predio.\n         */\n        !!@ ili2db.dispName = "Croquis de campo"\n        Croquis_Campo,\n        /** Datos tomados por un equipo GNSS sin ningún tipo de postprocesamiento.\n         */\n        !!@ ili2db.dispName = "Datos crudos (GPS, Estación total, LiDAR, etc.)"\n        Datos_Crudos,\n        /** Imagen producto de la toma de fotografías aéreas o satélites, en la cual han sido corregidos los desplazamientos causados por la inclinación de la cámara o sensor y la curvatura de la superficie del terreno. Está referida a un sistema de proyección cartográfica, por lo que posee las características geométricas de un mapa con el factor adicional de que los objetos se encuentran representados de forma real en la imagen de la fotográfica.\n         */\n        !!@ ili2db.dispName = "Ortofoto"\n        Ortofoto,\n        /** Informe técnico de levantamiento catastral de un predio.\n         */\n        !!@ ili2db.dispName = "Informe técnico"\n        Informe_Tecnico,\n        /** Registro fotográfico del levantamiento catastral de un predio.\n         */\n        !!@ ili2db.dispName = "Registro fotográfico"\n        Registro_Fotografico\n      );\n\n      COL_GrupoInteresadoTipo = (\n        /** Agrupación de personas naturales.\n         */\n        !!@ ili2db.dispName = "Grupo civil"\n        Grupo_Civil,\n        /** Agrupación de personas jurídicas.\n         */\n        !!@ ili2db.dispName = "Grupo empresarial"\n        Grupo_Empresarial,\n        /** Agrupación de personas pertenecientes a un grupo étnico.\n         */\n        !!@ ili2db.dispName = "Grupo étnico"\n        Grupo_Etnico,\n        /** Agrupación de personas naturales y jurídicas.\n         */\n        !!@ ili2db.dispName = "Grupo mixto"\n        Grupo_Mixto\n      );\n\n      /** Si ha sido situado por interpolación, de qué manera se ha hecho.\n       */\n      COL_InterpolacionTipo = (\n        !!@ ili2db.dispName = "Aislado"\n        Aislado,\n        !!@ ili2db.dispName = "Intermedio arco"\n        Intermedio_Arco,\n        !!@ ili2db.dispName = "Intermedio línea"\n        Intermedio_Linea\n      );\n\n      COL_MetodoProduccionTipo = (\n        /** Aquellos que requieren una visita campo con el fin de\n         * recolectar la realidad de los bienes inmuebles.\n         */\n        !!@ ili2db.dispName = "Método directo"\n        Metodo_Directo,\n        /** aquellos métodos identificación física, jurídica y\n         * económica de los inmuebles a través del uso de de sensores\n         * remotos, integración registros administrativos, modelos ísticos y\n         * econométricos, análisis de Big Data y fuentes secundarias como\n         * observatorios inmobiliarios, su posterior incorporación en la base catastral.\n         */\n        !!@ ili2db.dispName = "Método indirecto"\n        Metodo_Indirecto,\n        /** Son los derivados participación de la comunidad en el suministro de información que sirva como insumo para el desarrollo de los procesos catastrales. Los gestores catastrales propenderán por la adopción nuevas tecnologías y procesos comunitarios que faciliten la participación los ciudadanos.\n         */\n        !!@ ili2db.dispName = "Metodo declarativo y colaborativo"\n        Metodo_Declarativo_y_Colaborativo\n      );\n\n      COL_PuntoTipo = (\n        !!@ ili2db.dispName = "Control"\n        Control,\n        !!@ ili2db.dispName = "Catastro"\n        Catastro,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_RegistroTipo = (\n        !!@ ili2db.dispName = "Rural"\n        Rural,\n        !!@ ili2db.dispName = "Urbano"\n        Urbano,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_UnidadAdministrativaBasicaTipo = (\n        /** Unidad administrativa básica de la temática predial.\n         */\n        !!@ ili2db.dispName = "Predio"\n        Predio,\n        /** Unidad administrativa básica de la temática de ordenamiento territorial.\n         */\n        !!@ ili2db.dispName = "Ordenamiento territorial"\n        Ordenamiento_Territorial,\n        /** Unidad administrativa básica de la temática de servicios públicos.\n         */\n        !!@ ili2db.dispName = "Servicios públicos"\n        Servicios_Publicos,\n        /** Unidad administrativa básica de la temática de reservas naturales.\n         */\n        !!@ ili2db.dispName = "Reservas naturales"\n        Reservas_Naturales,\n        /** Unidad administrativa básica de la temática de parques naturales.\n         */\n        !!@ ili2db.dispName = "Parques naturales"\n        Parques_Naturales,\n        /** Unidad administrativa básica de la temática de amenazas de riesgo.\n         */\n        !!@ ili2db.dispName = "Amenazas de riesgos"\n        Amenazas_Riesgos,\n        /** Unidad administrativa básica de la temática de servidumbres.\n         */\n        !!@ ili2db.dispName = "Servidumbre"\n        Servidumbre,\n        /** Unidad administrativa básica de la temática de superficies de agua.\n         */\n        !!@ ili2db.dispName = "Superficies de agua"\n        Superficies_Agua,\n        /** Unidad administrativa básica de la temática de transporte.\n         */\n        !!@ ili2db.dispName = "Transporte"\n        Transporte\n      );\n\n      COL_VolumenTipo = (\n        !!@ ili2db.dispName = "Oficial"\n        Oficial,\n        !!@ ili2db.dispName = "Calculado"\n        Calculado,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      Integer = 0 .. 999999999;\n\n      COL_EstadoDisponibilidadTipo = (\n        /** La fuente fue convertida o recibió algún tratamiento.\n         */\n        !!@ ili2db.dispName = "Convertido"\n        Convertido,\n        /** Se desconoce la disponibilidad de la fuente.\n         */\n        !!@ ili2db.dispName = "Desconocido"\n        Desconocido,\n        /** La fuente está disponible.\n         */\n        !!@ ili2db.dispName = "Disponible"\n        Disponible\n      );\n\n      COL_ISO19125_Tipo = (\n        !!@ ili2db.dispName = "Disjunto"\n        Disjunto,\n        !!@ ili2db.dispName = "Toca"\n        Toca,\n        !!@ ili2db.dispName = "Superpone"\n        Superpone,\n        !!@ ili2db.dispName = "Desconocido"\n        Desconocido\n      );\n\n      COL_RelacionSuperficieTipo = (\n        !!@ ili2db.dispName = "En rasante"\n        En_Rasante,\n        !!@ ili2db.dispName = "En vuelo"\n        En_Vuelo,\n        !!@ ili2db.dispName = "En subsuelo"\n        En_Subsuelo,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_UnidadEdificacionTipo = (\n        !!@ ili2db.dispName = "Compartido"\n        Compartido,\n        !!@ ili2db.dispName = "Individual"\n        Individual\n      );\n\n      Currency = -2000000000.00 .. 2000000000.00;\n\n      Real = 0.000 .. 999999999.999;\n\n    /** Estructura que proviene de la traducción de la clase CC_OperationMethod de la ISO 19111. Indica el método utilizado, mediante un algoritmo o un procedimiento, para realizar operaciones con coordenadas.\n     */\n    STRUCTURE CC_MetodoOperacion =\n      /** Fórmulas o procedimientos utilizadoa por este método de operación de coordenadas. Esto puede ser una referencia a una publicación. Tenga en cuenta que el método de operación puede no ser analítico, en cuyo caso este atributo hace referencia o contiene el procedimiento, no una fórmula analítica.\n       */\n      !!@ ili2db.dispName = "Fórmula"\n      Formula : MANDATORY CharacterString;\n      /** Número de dimensiones en la fuente CRS de este método de operación de coordenadas.\n       */\n      !!@ ili2db.dispName = "Dimensiones origen"\n      Dimensiones_Origen : Integer;\n      /** Número de dimensiones en el CRS de destino de este método de operación de coordenadas.\n       */\n      !!@ ili2db.dispName = "Ddimensiones objetivo"\n      Ddimensiones_Objetivo : Integer;\n    END CC_MetodoOperacion;\n\n    !!@ ili2db.dispName = "Valores de área"\n    STRUCTURE COL_AreaValor =\n      /** Indica si el valor a registrar corresponde al área gráfica o alfanumérica de la base de datos catastral.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_AreaTipo;\n      /** Corresponde al valor del área registrada en la base de datos catastral.\n       */\n      !!@ ili2db.dispName = "Área"\n      Area : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\n      /** Parametros de la proyección utilizada para el cálculo del área de la forma proj, ejemplo: 'EPSG:3116', '+proj=tmerc +lat_0=4.59620041666667 +lon_0=-74.0775079166667 +k=1 +x_0=1000000 +y_0=1000000 +ellps=GRS80 +towgs84=0,0,0,0,0,0,0 +units=m +no_defs'\n       */\n      !!@ ili2db.dispName = "Datos de la proyección"\n      Datos_Proyeccion : TEXT;\n    END COL_AreaValor;\n\n    /** Referencia a una clase externa para gestionar direcciones.\n     */\n    !!@ ili2db.dispName = "Dirección"\n    STRUCTURE ExtDireccion =\n      !!@ ili2db.dispName = "Tipo de dirección"\n      Tipo_Direccion : MANDATORY (\n        !!@ ili2db.dispName = "Estructurada"\n        Estructurada,\n        !!@ ili2db.dispName = "No estructurada"\n        No_Estructurada\n      );\n      !!@ ili2db.dispName = "Es dirección principal"\n      Es_Direccion_Principal : BOOLEAN;\n      /** Par de valores georreferenciados (x,y) en la que se encuentra la dirección.\n       */\n      !!@ ili2db.dispName = "Localización"\n      Localizacion : ISO19107_PLANAS_V3_0.GM_Point3D;\n      !!@ ili2db.dispName = "Código postal"\n      Codigo_Postal : CharacterString;\n      !!@ ili2db.dispName = "Clase de vía principal"\n      Clase_Via_Principal : (\n        !!@ ili2db.dispName = "Avenida calle"\n        Avenida_Calle,\n        !!@ ili2db.dispName = "Avenida carrera"\n        Avenida_Carrera,\n        !!@ ili2db.dispName = "Avenida"\n        Avenida,\n        !!@ ili2db.dispName = "Autopista"\n        Autopista,\n        !!@ ili2db.dispName = "Circunvalar"\n        Circunvalar,\n        !!@ ili2db.dispName = "Calle"\n        Calle,\n        !!@ ili2db.dispName = "Carrera"\n        Carrera,\n        !!@ ili2db.dispName = "Diagonal"\n        Diagonal,\n        !!@ ili2db.dispName = "Transversal"\n        Transversal,\n        !!@ ili2db.dispName = "Circular"\n        Circular\n      );\n      !!@ ili2db.dispName = "Valor vía principal"\n      Valor_Via_Principal : TEXT*100;\n      !!@ ili2db.dispName = "Letra vía principal"\n      Letra_Via_Principal : TEXT*20;\n      !!@ ili2db.dispName = "Sector de la ciudad"\n      Sector_Ciudad : (\n        Norte,\n        Sur,\n        Este,\n        Oeste\n      );\n      !!@ ili2db.dispName = "Valor de vía generadora"\n      Valor_Via_Generadora : TEXT*100;\n      !!@ ili2db.dispName = "Letra de vía generadora"\n      Letra_Via_Generadora : TEXT*20;\n      !!@ ili2db.dispName = "Número del predio"\n      Numero_Predio : TEXT*20;\n      !!@ ili2db.dispName = "Sector del predio"\n      Sector_Predio : (\n        Norte,\n        Sur,\n        Este,\n        Oeste\n      );\n      !!@ ili2db.dispName = "Complemento"\n      Complemento : TEXT*255;\n      !!@ ili2db.dispName = "Nombre del predio"\n      Nombre_Predio : TEXT*255;\n    END ExtDireccion;\n\n    /** Estructura para la definición de un tipo de dato personalizado que permite indicar una fracción o quebrado cona serie específica de condiciones.\n     */\n    STRUCTURE Fraccion =\n      /** Parte inferior de la fracción. Debe ser mayor que 0. Debe ser mayor que el numerador.\n       */\n      !!@ ili2db.dispName = "Denominador"\n      Denominador : MANDATORY Integer;\n      /** Parte superior de la fracción. Debe ser mayor que 0. Debe sder menor que el denominador.\n       */\n      !!@ ili2db.dispName = "Numerador"\n      Numerador : MANDATORY Integer;\n      MANDATORY CONSTRAINT\n        Denominador > 0;\n      MANDATORY CONSTRAINT\n        Numerador > 0;\n      MANDATORY CONSTRAINT\n        Denominador >= Numerador;\n    END Fraccion;\n\n    CLASS Oid (ABSTRACT) =\n      /** Identificador único global. Corresponde al atributo de la clase en LADM.\n       */\n      !!@ ili2db.dispName = "Espacio de nombres"\n      Espacio_De_Nombres : MANDATORY CharacterString;\n      /** Identificador único local.\n       */\n      !!@ ili2db.dispName = "Local ID"\n      Local_Id : MANDATORY CharacterString;\n    END Oid;\n\n    DOMAIN\n\n      COL_FuenteAdministrativaTipo = (\n        /** Documento público es el otorgado por el funcionario público en ejercicio de sus funciones o con su intervención. Así mismo, es público el documento otorgado por un particular en ejercicio de funciones públicas o con su intervención. Cuando consiste en un escrito autorizado o suscrito por el respectivo funcionario, es instrumento público; cuando es autorizado por un notario o quien haga sus veces y ha sido incorporado en el respectivo protocolo, se denomina escritura pública.\n         */\n        !!@ ili2db.dispName = "Documento público"\n        Documento_Publico,\n        /** El documento privado es aquel documento que no cumple los requisitos del documento público, es decir, es un documento que no ha sido elaborado por un funcionario público, ni ha habido intervención de éste para su elaboración.\n         */\n        !!@ ili2db.dispName = "Documento privado"\n        Documento_Privado\n      );\n\n      COL_RedServiciosTipo = (\n        !!@ ili2db.dispName = "Petróleo"\n        Petroleo,\n        !!@ ili2db.dispName = "Químicos"\n        Quimicos,\n        !!@ ili2db.dispName = "Red térmica"\n        Red_Termica,\n        !!@ ili2db.dispName = "Telecomunicación"\n        Telecomunicacion\n      );\n\n      Peso = 0.0 .. 999999999999999.0 [LADM_COL_V3_0.COP];\n\n    /** Registro de la fórmula o procedimiento utilizado en la transformación y de su resultado.\n     */\n    STRUCTURE COL_Transformacion =\n      /** Fórmula o procedimiento utilizado en la transformación.\n       */\n      !!@ ili2db.dispName = "Transformación"\n      Transformacion : MANDATORY LADM_COL_V3_0.LADM_Nucleo.CC_MetodoOperacion;\n      /** Geometría una vez realizado el proceso de transformación.\n       */\n      !!@ ili2db.dispName = "Localización transformada"\n      Localizacion_Transformada : MANDATORY ISO19107_PLANAS_V3_0.GM_Point3D;\n    END COL_Transformacion;\n\n    /** Control externo de la unidad de edificación física.\n     */\n    STRUCTURE ExtUnidadEdificacionFisica =\n      !!@ ili2db.dispName = "Ext dirección id"\n      Ext_Direccion_ID : LADM_COL_V3_0.LADM_Nucleo.ExtDireccion;\n    END ExtUnidadEdificacionFisica;\n\n    /** Referencia a una imagen mediante su url.\n     */\n    STRUCTURE Imagen =\n      /** url de la imagen.\n       */\n      !!@ ili2db.dispName = "uri"\n      uri : CharacterString;\n    END Imagen;\n\n    /** Clase abstracta que permite gestionar el histórico del conjunto de clases, las cuales heredan de esta, excepto las fuentes.\n     */\n    CLASS ObjetoVersionado (ABSTRACT)\n    EXTENDS Oid =\n      /** Comienzo de la validez actual de la instancia de un objeto.\n       */\n      !!@ ili2db.dispName = "Versión de comienzo de vida útil"\n      Comienzo_Vida_Util_Version : MANDATORY INTERLIS.XMLDateTime;\n      /** Finalización de la validez actual de la instancia de un objeto.\n       */\n      !!@ ili2db.dispName = "Versión de fin de vida útil"\n      Fin_Vida_Util_Version : INTERLIS.XMLDateTime;\n      MANDATORY CONSTRAINT\n        Fin_Vida_Util_Version >= Comienzo_Vida_Util_Version;\n    END ObjetoVersionado;\n\n    /** Referencia a una clase externa para gestionar direcciones.\n     */\n    STRUCTURE ExtInteresado =\n      /** Identificador externo del interesado.\n       */\n      !!@ ili2db.dispName = "Ext dirección id"\n      Ext_Direccion_ID : LADM_COL_V3_0.LADM_Nucleo.ExtDireccion;\n      /** Imagen de la huella dactilar del interesado.\n       */\n      !!@ ili2db.dispName = "Huella dactilar"\n      Huella_Dactilar : LADM_COL_V3_0.LADM_Nucleo.Imagen;\n      /** Campo de nombre del interesado.\n       */\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : CharacterString;\n      /** Fotografía del interesado.\n       */\n      !!@ ili2db.dispName = "Fotografía"\n      Fotografia : LADM_COL_V3_0.LADM_Nucleo.Imagen;\n      /** Firma del interesado.\n       */\n      !!@ ili2db.dispName = "Firma"\n      Firma : LADM_COL_V3_0.LADM_Nucleo.Imagen;\n      /** Ruta de almacenamiento del documento escaneado del interesado.\n       */\n      !!@ ili2db.dispName = "Documento escaneado"\n      Documento_Escaneado : CharacterString;\n    END ExtInteresado;\n\n    /** Referencia a una clase externa para gestionar las redes físicas de servicios.\n     */\n    STRUCTURE ExtRedServiciosFisica =\n      /** Indica si la red de servicios tiene un gradiente o no.\n       */\n      !!@ ili2db.dispName = "Orientada"\n      Orientada : BOOLEAN;\n      /** Identificador de referencia a un interesado externo que es el administrador.\n       */\n      !!@ ili2db.dispName = "Ext interesado administrador id"\n      Ext_Interesado_Administrador_ID : LADM_COL_V3_0.LADM_Nucleo.ExtInteresado;\n    END ExtRedServiciosFisica;\n\n    /** Referencia a clase externa desde donde se gestiona el repositorio de archivos.\n     */\n    !!@ ili2db.dispName = "Archivo fuente"\n    STRUCTURE ExtArchivo =\n      /** Fecha en la que ha sido aceptado el documento.\n       */\n      !!@ ili2db.dispName = "Fecha de aceptación"\n      Fecha_Aceptacion : INTERLIS.XMLDate;\n      /** Datos que contiene el documento.\n       */\n      !!@ ili2db.dispName = "Datos"\n      Datos : CharacterString;\n      /** Última fecha de extracción del documento.\n       */\n      !!@ ili2db.dispName = "Extracción"\n      Extraccion : INTERLIS.XMLDate;\n      /** Fecha en la que el documento es aceptado en el sistema.\n       */\n      !!@ ili2db.dispName = "Fecha de grabación"\n      Fecha_Grabacion : INTERLIS.XMLDate;\n      /** Fecha en la que fue entregado el documento.\n       */\n      !!@ ili2db.dispName = "Fecha de entrega"\n      Fecha_Entrega : INTERLIS.XMLDate;\n      !!@ ili2db.dispName = "Espacio de nombres"\n      Espacio_De_Nombres : MANDATORY CharacterString;\n      !!@ ili2db.dispName = "Local ID"\n      Local_Id : MANDATORY CharacterString;\n    END ExtArchivo;\n\n    /** Clase abstracta. Esta clase es la personalización en el modelo del perfil colombiano de la clase de LADM LA_Source.\n     */\n    CLASS COL_Fuente (ABSTRACT)\n    EXTENDS Oid =\n      /** Indica si la fuente está o no disponible y en qué condiciones. También puede indicar porqué ha dejado de estar disponible, si ha ocurrido.\n       */\n      !!@ ili2db.dispName = "Estado de disponibilidad"\n      Estado_Disponibilidad : MANDATORY COL_EstadoDisponibilidadTipo;\n      /** Identificador del archivo fuente controlado por una clase externa.\n       */\n      !!@ ili2db.dispName = "Ext archivo id"\n      Ext_Archivo_ID : LADM_COL_V3_0.LADM_Nucleo.ExtArchivo;\n      /** Tipo de formato en el que es presentada la fuente, de acuerdo con el registro de metadatos.\n       */\n      !!@ ili2db.dispName = "Tipo principal"\n      Tipo_Principal : CI_Forma_Presentacion_Codigo;\n      /** Fecha de expedición del documento de la fuente.\n       */\n      !!@ ili2db.dispName = "Fecha de documento fuente"\n      Fecha_Documento_Fuente : INTERLIS.XMLDate;\n    END COL_Fuente;\n\n    /** Estructura para la definición de un tipo de dato personalizado que permite indicar la medición de un volumen y la naturaleza de este.\n     */\n    STRUCTURE COL_VolumenValor =\n      /** Medición del volumen en m3.\n       */\n      !!@ ili2db.dispName = "Volumen medición"\n      Volumen_Medicion : MANDATORY 0.0 .. 99999999999999.9 [INTERLIS.m];\n      /** Indicación de si el volumen es calculado, si figura como oficial o si se da otra circunstancia.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_VolumenTipo;\n    END COL_VolumenValor;\n\n    /** Especialización de la clase COL_Fuente para almacenar aquellas fuentes constituidas por documentos (documento hipotecario, documentos notariales, documentos históricos, etc.) que documentan la relación entre instancias de interesados y de predios.\n     */\n    CLASS COL_FuenteAdministrativa (ABSTRACT)\n    EXTENDS COL_Fuente =\n      /** Observaciones o descripción del documento de la fuente administrativa.\n       */\n      !!@ ili2db.dispName = "Observación"\n      Observacion : CharacterString;\n      /** Tipo de documento de fuente administrativa.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_FuenteAdministrativaTipo;\n      /** Identificador del documento, ejemplo: número de la resolución, número de la escritura pública o número de radicado de una sentencia.\n       */\n      !!@ ili2db.dispName = "Número de fuente"\n      Numero_Fuente : TEXT*150;\n    END COL_FuenteAdministrativa;\n\n    /** Representación gráfica del terreno, construcción, unidad de construcción y/o servidumbre de paso.\n     */\n    CLASS COL_UnidadEspacial (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Registros del área en diferentes sistemas.\n       */\n      !!@ ili2db.dispName = "Área"\n      Area : LIST {0..*} OF LADM_COL_V3_0.LADM_Nucleo.COL_AreaValor;\n      /** Dimensión del objeto.\n       */\n      !!@ ili2db.dispName = "Dimensión"\n      Dimension : COL_DimensionTipo;\n      /** Corresponde al atributo extAddressID de la clase en LADM.\n       */\n      !!@ ili2db.dispName = "Ext dirección id"\n      Ext_Direccion_ID : LIST {0..*} OF LADM_COL_V3_0.LADM_Nucleo.ExtDireccion;\n      /** Corresponde al atributo label de la clase en LADM.\n       */\n      !!@ ili2db.dispName = "Etiqueta"\n      Etiqueta : CharacterString;\n      /** Corresponde al atributo surfaceRelation de la clase en LADM.\n       */\n      !!@ ili2db.dispName = "Relación superficie"\n      Relacion_Superficie : COL_RelacionSuperficieTipo;\n      /** Corresponde al atributo volume de la clase en LADM.\n       */\n      !!@ ili2db.dispName = "Volumen"\n      Volumen : LIST {0..*} OF LADM_COL_V3_0.LADM_Nucleo.COL_VolumenValor;\n      /** Materializacion del metodo createArea(). Almacena de forma permanente la geometría de tipo poligonal.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\n    END COL_UnidadEspacial;\n\n    /** Agrupa unidades espaciales, es decir, representaciones geográficas de las unidades administrativas básicas (clase LA_BAUnit) para representar otras unidades espaciales que se forman en base a estas, como puede ser el caso de los polígonos catastrales.\n     */\n    CLASS COL_AgrupacionUnidadesEspaciales (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Nivel jerárquico de la agrupación, dentro del anidamiento de diferentes agrupaciones.\n       */\n      !!@ ili2db.dispName = "Nivel jerárquico"\n      Nivel_Jerarquico : MANDATORY Integer;\n      /** Definición de la agrupación.\n       */\n      !!@ ili2db.dispName = "Etiqueta"\n      Etiqueta : CharacterString;\n      /** Nombre que recibe la agrupación.\n       */\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : CharacterString;\n      /** Punto de referencia de toda la agrupación, a modo de centro de masas.\n       */\n      !!@ ili2db.dispName = "Punto de referencia"\n      Punto_Referencia : ISO19107_PLANAS_V3_0.GM_Point3D;\n    END COL_AgrupacionUnidadesEspaciales;\n\n    /** Traducción al español de la clase LA_LegalSpaceBuildingUnit. Sus intancias son las unidades de edificación\n     */\n    CLASS COL_EspacioJuridicoUnidadEdificacion (ABSTRACT)\n    EXTENDS COL_UnidadEspacial =\n      /** Identificador de la unidad de edificación.\n       */\n      !!@ ili2db.dispName = "Ext unidad edificación física id"\n      Ext_Unidad_Edificacion_Fisica_ID : LADM_COL_V3_0.LADM_Nucleo.ExtUnidadEdificacionFisica;\n      /** Tipo de unidad de edificación de la que se trata.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : COL_UnidadEdificacionTipo;\n    END COL_EspacioJuridicoUnidadEdificacion;\n\n    ASSOCIATION col_ueJerarquiaGrupo =\n      agrupacion -<> {0..1} COL_AgrupacionUnidadesEspaciales;\n      elemento -- {0..*} COL_AgrupacionUnidadesEspaciales;\n    END col_ueJerarquiaGrupo;\n\n    /** Traducción al español de la clase LA_LegalSpaceUtilityNetwork. Representa un tipo de unidad espacial (LA_UNidadEspacial) cuyas instancias son las redes de servicios.\n     */\n    CLASS COL_EspacioJuridicoRedServicios (ABSTRACT)\n    EXTENDS COL_UnidadEspacial =\n      /** Identificador de la red física hacia una referencia externa.\n       */\n      !!@ ili2db.dispName = "Ext id red física"\n      ext_ID_Red_Fisica : LADM_COL_V3_0.LADM_Nucleo.ExtRedServiciosFisica;\n      /** Estado de operatividad de la red.\n       */\n      !!@ ili2db.dispName = "Estado"\n      Estado : COL_EstadoRedServiciosTipo;\n      /** Tipo de servicio que presta.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : COL_RedServiciosTipo;\n    END COL_EspacioJuridicoRedServicios;\n\n    ASSOCIATION col_ueUeGrupo =\n      parte -- {0..*} COL_UnidadEspacial;\n      todo -- {0..*} COL_AgrupacionUnidadesEspaciales;\n    END col_ueUeGrupo;\n\n    /** Traducción de la clase LA_Level de LADM.\n     */\n    CLASS COL_Nivel (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : CharacterString;\n      !!@ ili2db.dispName = "Tipo de registro"\n      Registro_Tipo : COL_RegistroTipo;\n      !!@ ili2db.dispName = "Estructura"\n      Estructura : COL_EstructuraTipo;\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : COL_ContenidoNivelTipo;\n    END COL_Nivel;\n\n    /** Traducción al español de la clase LA_RequiredRelationshipSpatialUnit de LADM.\n     */\n    CLASS COL_RelacionNecesariaUnidadesEspaciales (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      !!@ ili2db.dispName = "Relación"\n      Relacion : MANDATORY COL_ISO19125_Tipo;\n    END COL_RelacionNecesariaUnidadesEspaciales;\n\n    ASSOCIATION col_ueNivel =\n      ue -- {0..*} COL_UnidadEspacial;\n      nivel -- {0..1} COL_Nivel;\n    END col_ueNivel;\n\n    /** Clase abstracta que agrupa los atributos comunes de las clases para los derechos (rights), las responsabilidades (responsabilities) y las restricciones (restrictions).\n     */\n    CLASS COL_DRR (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Descripción asociada al derecho, la responsabilidad o la restricción.\n       */\n      !!@ ili2db.dispName = "Descripción"\n      Descripcion : CharacterString;\n    END COL_DRR;\n\n    /** De forma genérica, representa el objeto territorial legal (Catastro 2014) que se gestiona en el modelo, en este caso, la parcela catastral o predio. Es independiente del conocimiento de su realidad espacial y se centra en su existencia conocida y reconocida.\n     */\n    CLASS COL_UnidadAdministrativaBasica (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Nombre que recibe la unidad administrativa básica, en muchos casos toponímico, especialmente en terrenos rústicos.\n       */\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : CharacterString;\n      /** Tipo de derecho que la reconoce.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_UnidadAdministrativaBasicaTipo;\n    END COL_UnidadAdministrativaBasica;\n\n    ASSOCIATION col_rrrFuente =\n      fuente_administrativa -- {1..*} COL_FuenteAdministrativa;\n      rrr -- {0..*} COL_DRR;\n    END col_rrrFuente;\n\n    /** Traducción de la clase LA_RequiredRelationshipBAUnit de LADM.\n     */\n    CLASS COL_RelacionNecesariaBAUnits (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      !!@ ili2db.dispName = "Relación"\n      Relacion : MANDATORY CharacterString;\n    END COL_RelacionNecesariaBAUnits;\n\n    ASSOCIATION col_baunitRrr =\n      unidad -- {1} COL_UnidadAdministrativaBasica;\n      rrr -- {1..*} COL_DRR;\n    END col_baunitRrr;\n\n    ASSOCIATION col_ueBaunit =\n      ue (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n      baunit -- {0..*} COL_UnidadAdministrativaBasica;\n    END col_ueBaunit;\n\n    ASSOCIATION col_relacionFuente =\n      fuente_administrativa -- {0..*} COL_FuenteAdministrativa;\n      relacionrequeridaBaunit -- {0..*} COL_RelacionNecesariaBAUnits;\n    END col_relacionFuente;\n\n    ASSOCIATION col_unidadFuente =\n      fuente_administrativa -- {0..*} COL_FuenteAdministrativa;\n      unidad -- {0..*} COL_UnidadAdministrativaBasica;\n    END col_unidadFuente;\n\n    /** Clase especializada para la administración de los tipos de puntos.\n     */\n    CLASS COL_Punto (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Posición de interpolación.\n       */\n      !!@ ili2db.dispName = "Posición interpolación"\n      Posicion_Interpolacion : COL_InterpolacionTipo;\n      /** Clasificación del tipo de punto identificado en el levantamiento catastral.\n       */\n      !!@ ili2db.dispName = "Tipo de punto"\n      PuntoTipo : MANDATORY COL_PuntoTipo;\n      /** Indica si el método de levantamiento catastral: método directo o indirecto.\n       */\n      !!@ ili2db.dispName = "Método de producción"\n      MetodoProduccion : MANDATORY COL_MetodoProduccionTipo;\n      /** Transformación y Resultado.\n       */\n      !!@ ili2db.dispName = "Transformación y resultado"\n      Transformacion_Y_Resultado : LIST {0..*} OF LADM_COL_V3_0.LADM_Nucleo.COL_Transformacion;\n      /** Geometria punto para administración de los objetos: punto de lindero, punto levantamiento y punto de control.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : MANDATORY ISO19107_PLANAS_V3_0.GM_Point3D;\n    END COL_Punto;\n\n    /** Especialización de la clase COL_Fuente para almacenar las fuentes constituidas por datos espaciales (entidades geográficas, imágenes de satélite, vuelos fotogramétricos, listados de coordenadas, mapas, planos antiguos o modernos, descripción de localizaciones, etc.) que documentan técnicamente la relación entre instancias de interesados y de predios\n     */\n    CLASS COL_FuenteEspacial (ABSTRACT)\n    EXTENDS COL_Fuente =\n      /** Nombre de la fuente espacial del levantamiento catastral de un predio.\n       */\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : MANDATORY TEXT*255;\n      /** Tipo de fuente espacial.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_FuenteEspacialTipo;\n      /** Descripción de la fuente espacial.\n       */\n      !!@ ili2db.dispName = "Descripción"\n      Descripcion : MANDATORY MTEXT;\n      /** Metadato de la fuente espacial.\n       */\n      !!@ ili2db.dispName = "Metadato"\n      Metadato : MTEXT;\n    END COL_FuenteEspacial;\n\n    /** Traducción al español de la clase LA_BoundaryFaceString de LADM. Define los linderos y a su vez puede estar definida por una descrición textual o por dos o más puntos. Puede estar asociada a una fuente espacial o más.\n     */\n    CLASS COL_CadenaCarasLimite (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Geometría lineal que define el lindero. Puede estar asociada a geometrías de tipo punto que definen sus vértices o ser una entidad lineal independiente.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : ISO19107_PLANAS_V3_0.GM_Curve3D;\n      /** Descripción de la localización, cuando esta se basa en texto.\n       */\n      !!@ ili2db.dispName = "Localización textual"\n      Localizacion_Textual : CharacterString;\n    END COL_CadenaCarasLimite;\n\n    /** Traducción de la clase LA_BoundaryFace de LADM. De forma similar a LA_CadenaCarasLindero, representa los límites, pero en este caso permite representación 3D.\n     */\n    CLASS COL_CarasLindero (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Geometría en 3D del límite o lindero, asociada a putos o a descripciones textuales.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\n      /** Cuando la localización del límte está dada por una descripción textual, aquí se recoge esta.\n       */\n      !!@ ili2db.dispName = "Localización textual"\n      Localizacion_Textual : CharacterString;\n    END COL_CarasLindero;\n\n    ASSOCIATION col_puntoReferencia =\n      ue (EXTERNAL) -- {0..1} COL_UnidadEspacial;\n      punto -- {0..1} COL_Punto;\n    END col_puntoReferencia;\n\n    ASSOCIATION col_puntoFuente =\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n      punto -- {0..*} COL_Punto;\n    END col_puntoFuente;\n\n    ASSOCIATION col_ueFuente =\n      ue (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n    END col_ueFuente;\n\n    ASSOCIATION col_baunitFuente =\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n      unidad (EXTERNAL) -- {0..*} COL_UnidadAdministrativaBasica;\n    END col_baunitFuente;\n\n    ASSOCIATION col_relacionFuenteUespacial =\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n      relacionrequeridaUe (EXTERNAL) -- {0..*} COL_RelacionNecesariaUnidadesEspaciales;\n    END col_relacionFuenteUespacial;\n\n    ASSOCIATION col_cclFuente =\n      ccl -- {0..*} COL_CadenaCarasLimite;\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n    END col_cclFuente;\n\n    ASSOCIATION col_menosCcl =\n      ccl_menos -- {0..*} COL_CadenaCarasLimite;\n      ue_menos (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n    END col_menosCcl;\n\n    ASSOCIATION col_masCcl =\n      ccl_mas -- {0..*} COL_CadenaCarasLimite;\n      ue_mas (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n    END col_masCcl;\n\n    ASSOCIATION col_puntoCcl =\n      punto -- {2..*} COL_Punto;\n      ccl -- {0..*} COL_CadenaCarasLimite;\n    END col_puntoCcl;\n\n    ASSOCIATION col_clFuente =\n      cl -- {0..*} COL_CarasLindero;\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n    END col_clFuente;\n\n    ASSOCIATION col_menosCl =\n      cl_menos -- {0..*} COL_CarasLindero;\n      ue_menos (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n    END col_menosCl;\n\n    ASSOCIATION col_masCl =\n      cl_mas -- {0..*} COL_CarasLindero;\n      ue_mas (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n    END col_masCl;\n\n    ASSOCIATION col_puntoCl =\n      punto -- {3..*} COL_Punto;\n      cl -- {0..*} COL_CarasLindero;\n    END col_puntoCl;\n\n    /** Traducción de la clase LA_Party de LADM. Representa a las personas que ejercen derechos y responsabilidades  o sufren restricciones respecto a una BAUnit.\n     */\n    CLASS COL_Interesado (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Identificador del interesado.\n       */\n      !!@ ili2db.dispName = "Ext PID"\n      ext_PID : LADM_COL_V3_0.LADM_Nucleo.ExtInteresado;\n      /** Nombre del interesado.\n       */\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : CharacterString;\n    END COL_Interesado;\n\n    /** Relaciona los interesados que ostentan la propiedad, posesión u ocupación de un predio. Se registra el grupo en si e independientemete las personas por separado.\n     */\n    CLASS COL_AgrupacionInteresados (ABSTRACT)\n    EXTENDS COL_Interesado =\n      /** Indica el tipo de agrupación del que se trata.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_GrupoInteresadoTipo;\n    END COL_AgrupacionInteresados;\n\n    ASSOCIATION col_baunitComoInteresado =\n      interesado -- {0..*} COL_Interesado;\n      unidad (EXTERNAL) -- {0..*} COL_UnidadAdministrativaBasica;\n    END col_baunitComoInteresado;\n\n    ASSOCIATION col_responsableFuente =\n      fuente_administrativa (EXTERNAL) -- {0..*} COL_FuenteAdministrativa;\n      interesado -- {0..*} COL_Interesado;\n    END col_responsableFuente;\n\n    ASSOCIATION col_rrrInteresado =\n      rrr (EXTERNAL) -- {0..*} COL_DRR;\n      interesado -- {0..1} COL_Interesado;\n    END col_rrrInteresado;\n\n    ASSOCIATION col_topografoFuente =\n      fuente_espacial (EXTERNAL) -- {0..*} COL_FuenteEspacial;\n      topografo -- {0..*} COL_Interesado;\n    END col_topografoFuente;\n\n    ASSOCIATION col_miembros =\n      interesado -- {2..*} COL_Interesado;\n      agrupacion -<> {0..*} COL_AgrupacionInteresados;\n      participacion : LADM_COL_V3_0.LADM_Nucleo.Fraccion;\n    END col_miembros;\n\n  END LADM_Nucleo;\n\nEND LADM_COL_V3_0.\n	2020-07-22 10:37:35.576
Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.ili	2.3	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0{ LADM_COL_V3_0 Submodelo_Integracion_Insumos_V1_0 ISO19107_PLANAS_V3_0}	INTERLIS 2.3;\n\n/** ISO 19152 LADM country profile COL modeled with INTERLIS 2.\n * \n * -----------------------------------------------------------\n * revision history\n * -----------------------------------------------------------\n * \n * 10.05.2016/mg: EJEMPLO INTERLIS POR OFERTAS\n * 16.06.2016/mg: Taller IGAC/SNR\n * 23.08.2016/mg: Relaciones\n * 15.09.2016/mg: Comentarios Modelo\n * 20.11.2016/aa: Topic Ficha\n * 25.11.2016/aa: Ajustes FichaPredio\n * 02.12.2016/ss: Nuevas clases, atributos y tipos\n * 15.12.2016/lj: Ajuste tipos (IGAC/SNR), BAUnit GM_surface\n * 31.03.2017/fm: Simplificación de herencia\n * 25.05.2017/fm: Se elimina la relacion HipotecaDerecho, se elimina la clase InteresadoBAUnit, se elimina marca abstract en las clases derivadas de RRR\n * 26.05.2017/fm: Se cambian las clases terreno servidumbre de paso y construccion al paquete de unidades espaciales. Se acorta el nombre del Modelo. ajuste al diseño del diagrama de clases. Se elimina InteresadoNacion\n * 09.06.2017/vm: Referido al modelo LADM traducido al español\n * 09.06.2017/vm: cambio de version a 2.1.1, incluye cambios por LADM en español y de  nombres de atributo por no seguir las convenciones adoptadas.\n * 15.06.2017/fm: cambio de version a 2.1.2, se quita el atributo geometría de la clase predio. se reemplaza el atributo OID por los atributos atributos namespace y localId. Se añaden atributos folio matriz y segregados al predio. se elimina el dominio transaccion_registral_tipo\n * 20.06.2017/fm: Ajuste a nombres de las clases y atributos LA_\n * 04.07.2017/sr: Ajuste de nombres de clases y atributos, creacion de relaciones, ajuste subdominios\n * 04.07.2017/fm: Se unifican los modelos LADM_ES y Catastro_COL, se eliminan las clases que extienden de responsabilidad, restriccion, derecho, hipoteca, fuente_administrativa y fuente espacial. eliminan atributos opcionales no usados de la clase hipoteca\n * 11.07.2017/fm: se adiciona el atributo poligono_creado\n * 12.07.2017/fm: se adiciona el atributo Estado_Nupre en la clase predio\n * 17.07.2017/fm: poligono creado debe ser obligatorio para la clase terreno.\n * 28.09.2017/fm : Cambio del nombre en la clase alerta por publicidad, Publicidad Extiende de objeto versionado, se elimita atributo fecha de vigencia. Ajuste al atributo plantacion comercial de la clase terreno. Se extraen los atributos de la clase predio e interesados a los modelos extendidos de ficha y registro. version 2.2.0\n * 20.10.2017/ag : Ajustes a atributos de la clase terreno, cambio a dominio multivalorado, se crean dominios, col_servidumbre, col_afectacion, col_explotacion, col_territorioAgricula, col_cuerpoAgua, se elimina la obligatoriedad del rol responsable en las relaciones responsableFuente y topografoFuente\n * 28.10.2017/gc : Soporte de geometrías multi-parte para LA_UnidadEspacial (y las clases que la extienden) y Terreno.\n * 02.11.2017/ : Cambio del nombre del modelo de Catastro_COL_ES a Catastro_Registro_Nucleo\n * 07.11.2017/fm: Cambio de nombre a la clase CadenaCarasLindero a CadenaCarasLimite \n * 14.11.2017/fm : taducción del dominio COL_BuildingUnitTipo\n * 14.12.2017/fm : definicion de extends entre topics catastro registro nucleo y Ladm_nucleo\n * 30.01.2018/fm : Cambio del tipo de dato del atributo Ext_Direccion de la clase Unidad Espacial a ExtDireccion; atributo ext_PID de la calse LA_Interesado cambia de OID a ExtInteresado; Cambio de cardinalidad en relacion miembros entre LA_Interesado y LA_Agrupacion_Interesados de 0..1 a 0..*\n * 19.02.2018/fm : Cambio en longitud de atributo DocumentoIdentidad de 10 a 12 posiciones\n * 17.07.2018/fm : cambio en cardinalidad asociación ConstruccionUnidadConstruccion de 1..* a 0..*; ampliación del tamaño para campo de nombre en Interesado Natural; se incluyen los valores nuip, cedula militar, registro civil, cedula militar, secuencial SRN y secuencial IGAC al dominio COL_InteresadoDocumentoTipo\n * 30.07.2018/fm : Cambio obligatoriedad atributo area_registral de clase terreno de 1 a 0..1\n * 31.07.2018/fm: Creación de la clase COL_Interesado integrando los atributos de interesado natural e interesado jurídico; se agrega area en la clase construcción; se adiciona valor Carta_Venta al dominio COL_FuenteAdministrativaTipo; inclusion de atributo nombre en la clase COL_FuenteAdministrativa\n * 10.08.2018/fm: Eliminado clase Interesado Natural e Interesado Juridico\n * 28.08.2018/fm: Ajuste a cardinalidad en la composición predio_copropiedad, se elimina el requerido.\n * 28.08.2018/fm-at: Se incluye el tipo de predio conforme a la resolucion 070 de 2011; Se elimina el atributo tipo_construccion de la clase Unidad_Construcción ya que el dominio hace referencia a tipos de predios y no a tipos de construcciones\n * 10.09.2018/fm-at: Ajuste a los tipos de Predio conforme a la resolucion 070\n * 21.09.2018/at: Se agrega el valor "Hipoteca" al dominio COL_RestriccionTipo, se ajusta la longitud del atributo Codigo_Registral en las clases especializadas de LA_RRR de 3 a 4 caracteres\n * 25.09.2018/at: Se ajusta la longitud del atributo Codigo_Registral en las clases especializadas de LA_RRR a 5 caracteres de acuerdo a la Resolución 3973 de 2018\n * 18.10.2018/at: Se agregan los atributos p_Espacio_De_Nombres y p_Local_Id a la clase Publicidad\n * 29.10.2018/fm: se amplia el tamaño de campo FMI en la clase predio para almacenar cadenas como 'LIBRO 2 TOMO 1/961 FOLIO 37/46 PARTIDA N 58'\n * -----------------------------------------------------------\n * \n * (c) IGAC y SNR con apoyo de la Cooperacion Suiza\n * \n * -----------------------------------------------------------\n */\nCONTRACTED MODEL Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0 (es)\nAT "http://www.proadmintierra.info/"\nVERSION "V2.2.1"  // 2018-02-19 // =\n  IMPORTS ISO19107_PLANAS_V3_0,LADM_COL_V3_0,Submodelo_Integracion_Insumos_V1_0;\n\n  DOMAIN\n\n    /** Valores para indicar el nivel de acuerdo\n     */\n    LC_AcuerdoTipo = (\n      /** Existe un acuerdo sobre la posición del punto\n       */\n      !!@ ili2db.dispName = "Acuerdo"\n      Acuerdo,\n      /** Existe un desacuerdo sobre la posición del punto\n       */\n      !!@ ili2db.dispName = "Desacuerdo"\n      Desacuerdo\n    );\n\n    LC_AnexoTipo = (\n      !!@ ili2db.dispName = "Enramadas o cobertizos o caneyes"\n      Enramadas_Cobertizos_Caneyes(\n        /** Locales de venta de vehículos: Estructura concreto, cubierta cercha metálica y teja canaleta; fachada vidrio y polarizado, piso baldosín conservación general buena.\n         */\n        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 90"\n        Tipo_90,\n        /** Estructura metálica; cubierta de zinc, eternit o teja de barro, pisos de cemento, conservación general buena.\n         */\n        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 80"\n        Tipo_80,\n        /** Estructura en madera fina; cubierta de zinc, eternit o teja de barro pisos de cemento; conservación general buena a regular.\n         */\n        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 60"\n        Tipo_60,\n        /** Estructura en madera común; cubierta de zinc, eternit o teja de barro; pisos en tierra; conservación regular a mala.\n         */\n        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 40"\n        Tipo_40\n      ),\n      !!@ ili2db.dispName = "Galpones o gallineros"\n      Galpones_Gallineros(\n        /** Estructura metálica o madera fina, cubierta de zinc, eternit o teja de barro; muros a mediana altura en bloque o ladrillo; pisos de cemento; conservación general buena.\n         */\n        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 80"\n        Tipo_80,\n        /** Estructura ladrillo o bloque; cubierta de zinc, eternit o teja de barro semi muros en bloque o ladrillo; pisos de cemento; conservación general buena a regular.\n         */\n        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 60"\n        Tipo_60,\n        /** Estructura en ladrillo, bloque o madera sencilla; cubierta de zinc, eternit o teja de barro; con o sin muros; pisos en tierra; conservación regular a mala.\n         */\n        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 40"\n        Tipo_40,\n        /** Estructura en madera; cubierta de zinc, eternit, teja de barro, paja o material de desecho; con o sin muros; pisos en tierra; conservación regular o mala.\n         */\n        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 20"\n        Tipo_20\n      ),\n      !!@ ili2db.dispName = "Establos o pesebreras"\n      Establos_Pesebreras(\n        /** Estructura metálica o de concreto; cubierta de zinc, eternit a teja de barro muros en bloque o ladrillo, pisos de cemento, conservación en general buena.\n         */\n        !!@ ili2db.dispName = "(Establos o pesebreras) Tipo 80"\n        Tipo_80,\n        /** Estructura en bloque, ladrillo o madera fina; cubierta de zinc, eternit o teja de barro muros en bloque o ladrillo, pisos de cemento, conservación en general buena o regular\n         */\n        !!@ ili2db.dispName = "(Establos o pesebreras) Tipo 60"\n        Tipo_60,\n        /** Estructura en ladrillo cubierta  de  zinc,  eternit  o  teja  de  barro  muros de ladrillo, pisos en tierra, conservación regular a mala.\n         */\n        !!@ ili2db.dispName = "(Establos o pesebreras) Tipo 40"\n        Tipo_40,\n        /** Estructura en madera cubierta de  zinc,  eternit  o  teja  de  barro  muros en madera, pisos en tierra, conservación regular a mala.\n         */\n        !!@ ili2db.dispName = "(Establos o pesebreras) Tipo 20"\n        Tipo_20\n      ),\n      !!@ ili2db.dispName = "Cocheras o marraneras o porquerizas"\n      Cocheras_Marraneras_Porquerizas(\n        /** Estructura concreto; cubierta de zinc, eternit o teja de barro, muros en bloque o ladrillo, pisos en cemento o baldosa, conservación general buena.\n         */\n        !!@ ili2db.dispName = "(Cocheras o marraneras o porquerizas) Tipo 80"\n        Tipo_80,\n        /** Estructura en ladrillo o bloque, cubierta de zinc, eternit o teja de barro, semi muros en bloque o ladrillo, pisos en cemento o baldosa conservación general buena a regular.\n         */\n        !!@ ili2db.dispName = "(Cocheras o marraneras o porquerizas) Tipo 60"\n        Tipo_60,\n        /** Estructura en ladrillo; cubierta de zinc, eternit o teja de barro; con muros o sin muros; pisos en tierra; conservación regular a mala.\n         */\n        !!@ ili2db.dispName = "(Cocheras o marraneras o porquerizas) Tipo 40"\n        Tipo_40,\n        /** Estructura en madera; cubierta de zinc, eternit o teja de barro con o sin muros, pisos en tierra, conservación regular a mala.\n         */\n        !!@ ili2db.dispName = "(Cocheras o marraneras o porquerizas) Tipo 20"\n        Tipo_20\n      ),\n      !!@ ili2db.dispName = "Silos"\n      Silos(\n        /** Estructura en ferroconcreto metálica\n         */\n        !!@ ili2db.dispName = "(Silos) Tipo 80"\n        Tipo_80,\n        /** Estructura en concreto\n         */\n        !!@ ili2db.dispName = "(Silos) Tipo 60"\n        Tipo_60\n      ),\n      !!@ ili2db.dispName = "Piscina"\n      Piscinas(\n        /** Piscinas olímpicas, con sistemas de purificación e iluminación; enchape en azulejo fino, trampolín a diferentes alturas. Se encuentra comúnmente en clubes y coliseos.\n         */\n        !!@ ili2db.dispName = "(Piscina) Tipo 80"\n        Tipo_80,\n        /** Piscinas semi olímpicas, con sistemas de purificación; enchape en azulejo fino, comunes en clubes y centros de recreación.\n         */\n        !!@ ili2db.dispName = "(Piscina) Tipo 60"\n        Tipo_60,\n        /** Piscinas de tamaño mediano, enchape en azulejo, sistemas de purificación rudimentaria, comunes en fincas de recreo o centros de recreación.\n         */\n        !!@ ili2db.dispName = "(Piscina) Tipo 50"\n        Tipo_50,\n        /** Piscinas pequeña, cubierta en baldosín o cemento. Comunes en fincas o casas de campo\n         */\n        !!@ ili2db.dispName = "(Piscina) Tipo 40"\n        Tipo_40\n      ),\n      !!@ ili2db.dispName = "Tanques"\n      Tanques(\n        /** Tanques que por su capacidad y/b altura requieren estructura en ferroconcreto con revestimiento, encontrándose en buen estado de conservación.\n         */\n        !!@ ili2db.dispName = "(Tanques) Tipo 80"\n        Tipo_80,\n        /** Tanques de mediana capacidad con estructura metálica con altura o profundidad no superior a 10 metros; en buen estado de conservación.\n         */\n        !!@ ili2db.dispName = "(Tanques) Tipo 60"\n        Tipo_60,\n        /** Tanques pequeños con estructura en ladrillo o bloque revestido en cemento con altura no mayor a 3 metros o poca profundidad; conservación buena a regular\n         */\n        !!@ ili2db.dispName = "(Tanques) Tipo 40"\n        Tipo_40,\n        /** Tanques con altura menor a 3 metros o poca profundidad; estructura en ladrillo conservación regular a mala.\n         */\n        !!@ ili2db.dispName = "(Tanques) Tipo 20"\n        Tipo_20\n      ),\n      !!@ ili2db.dispName = "Beneficiaderos"\n      Beneficiaderos(\n        /** Estructura en ladrillo o bloque; cubierta en zinc, teja de barro o eternit rustico; pisos en cemento, con tanques lavadores y serpentina o canal de carreteo y silo o patio quindiano incorporado estado de conservación bueno a regular.\n         */\n        !!@ ili2db.dispName = "(Beneficiaderos) Tipo 80"\n        Tipo_80,\n        /** Estructura en madera; muros en ladrillos o bloque; cubierta en zinc, teja de barro o eternit; existencia de tanques y/o silos; pisos en cemento estado de conservación bueno a regular.\n         */\n        !!@ ili2db.dispName = "(Beneficiaderos) Tipo 60"\n        Tipo_60,\n        /** Beneficiaderos construidos en materiales económicos (bareque, tapia) pisos en tierra conservación regular a mala; se encuentran en este tipo los elementos apenas necesarios: tanques, despulpaderos, canales, etc. en condiciones rudimentarias, comunes en fincas minifundistas.\n         */\n        !!@ ili2db.dispName = "(Beneficiaderos) Tipo 40"\n        Tipo_40\n      ),\n      !!@ ili2db.dispName = "Secaderos"\n      Secaderos(\n        /** Estructura metálica y cercha de madera o metálica muros medianos o totales en ladrillo marquesina de vidrio; pisos en cemento; estado de conservación buena.\n         */\n        !!@ ili2db.dispName = "(Secaderos) Tipo 80"\n        Tipo_80,\n        /** Estructura en ladrillo; pisos en cemento; oreador en madera con sistema de rodamiento; buen estado de conservación.\n         */\n        !!@ ili2db.dispName = "(Secaderos) Tipo 60"\n        Tipo_60,\n        /** Estructura en madera pisos en tierra oreador con especificaciones mínimas; estado de conservación regular a mala. Dentro de este tipo se consideran as condiciones de los tipos anteriores, que se encuentran en regular a mal estado de conservación\n         */\n        !!@ ili2db.dispName = "(Secaderos) Tipo 40"\n        Tipo_40\n      ),\n      !!@ ili2db.dispName = "Kioskos"\n      Kioscos(\n        /** Estructura en bloque o ladrillo cubierta en zinc, teja de barro o paja; estado de conservación general bueno.\n         */\n        !!@ ili2db.dispName = "(Kioskos) Tipo 80"\n        Tipo_80,\n        /** Estructura metálica; todo tipo de cubiertas; piso en cemento; estado de conservación bueno a regular\n         */\n        !!@ ili2db.dispName = "(Kioskos) Tipo 60"\n        Tipo_60,\n        /** Estructura en madera fina; todo tipo de cubiertas; piso en cemento; estado de conservación bueno a regular.\n         */\n        !!@ ili2db.dispName = "(Kioskos) Tipo 40"\n        Tipo_40,\n        /** Estructura en madera común; cubierta en zinc, paja o teja de barro piso en tierra estado de conservación regular a mala.\n         */\n        !!@ ili2db.dispName = "(Kioskos) Tipo 20"\n        Tipo_20\n      ),\n      !!@ ili2db.dispName = "Albercas o bañaderas"\n      Albercas_Baniaderas(\n        /** Estructura en concreto; cubierta en zinc, eternit o teja de barro; piso en cemento; conservación buena a regular.\n         */\n        !!@ ili2db.dispName = "(Albercas o bañaderas) Tipo 80"\n        Tipo_80,\n        /** Estructura en ladrillo; cubierta en zinc, eternit o teja de barro; piso  en cemento; conservación buena a regular.\n         */\n        !!@ ili2db.dispName = "(Albercas o bañaderas) Tipo 60"\n        Tipo_60,\n        /** Estructura en madera; cubierta en zinc, eternit o teja de barro; piso en cemento; conservación regular a mala. Se incluyen en este tipo las condiciones dadas en los anteriores en mal estado de conservación.\n         */\n        !!@ ili2db.dispName = "(Albercas o bañaderas) Tipo 40"\n        Tipo_40\n      ),\n      !!@ ili2db.dispName = "Corrales"\n      Corrales(\n        /** Estructura metálica o de madera aserrada, formado por cuatro varales, pisos en cemento y conservación buena.\n         */\n        !!@ ili2db.dispName = "(Corrales) Tipo 80"\n        Tipo_80,\n        /** Estructura en madera aserrada, formado por tres varales, pisos en cemento y conservación general buena.\n         */\n        !!@ ili2db.dispName = "(Corrales) Tipo 60"\n        Tipo_60,\n        /** Estructura en madera aserrada, formado por tres varales, pisos en tierra y conservación general regular a mala.\n         */\n        !!@ ili2db.dispName = "(Corrales) Tipo 40"\n        Tipo_40,\n        /** Estructura en madera burda, pisos en tierra y conservación general regular a mala\n         */\n        !!@ ili2db.dispName = "(Corrales) Tipo 20"\n        Tipo_20\n      ),\n      !!@ ili2db.dispName = "Pozos"\n      Pozos(\n        /** Pozo de profundidad aproximada a 40 m, revestido en concreto, con tubería, anillado 100% , diámetro pozo de 2m\n         */\n        !!@ ili2db.dispName = "(Pozos) Tipo 80"\n        Tipo_80,\n        /** Pozo de profundidad aproximada 20 m, revestido en concreto, con tubería, anillado 100 % , diámetro pozo < 2m\n         */\n        !!@ ili2db.dispName = "(Pozos) Tipo 60"\n        Tipo_60,\n        /** Pozo profundidad < a 10m, sin revestimiento ni anillar, diámetro pozo de 2m\n         */\n        !!@ ili2db.dispName = "(Pozos) Tipo 40"\n        Tipo_40\n      ),\n      /** Estructura en concreto y tanque en concreto, fibrocemento o metálico con recubrimiento interior en resinas de poliéster reforzadas con fibra de vidrio, partes metálicas en acero inoxidable o galvanizadas buen estado de conservación\n       */\n      !!@ ili2db.dispName = "(Torres de enfriamiento)"\n      TorresEnfriamiento,\n      !!@ ili2db.dispName = "Muelles"\n      Muelles(\n        /** Muelle, estructura en concreto, piso en madera deck para exteriores\n         */\n        !!@ ili2db.dispName = "(Muelles) Tipo 80"\n        Tipo_80,\n        /** Muelle, estructura y piso en concreto\n         */\n        !!@ ili2db.dispName = "(Muelles) Tipo 60"\n        Tipo_60,\n        /** Muelle, estructura y, piso en madera.\n         */\n        !!@ ili2db.dispName = "(Muelles) Tipo 40"\n        Tipo_40\n      ),\n      !!@ ili2db.dispName = "Canchas de tenis"\n      CanchasTenis(\n        /** En polvo de ladrillo\n         */\n        !!@ ili2db.dispName = "(Canchas de tenis) Tipo 20"\n        Tipo_20,\n        /** Cemento y/o asfalto.\n         */\n        !!@ ili2db.dispName = "(Canchas de tenis) Tipo 10"\n        Tipo_10\n      ),\n      !!@ ili2db.dispName = "Toboganes"\n      Toboganes(\n        /** Altura entre 9 y 15 Mts., longitud de canal entre 75 y 120 Mts. Fibra de vidrio. Estructura de concreto o metálica. Incluye piscina de Llegada. Sistema de bombeo, purificación.\n         */\n        !!@ ili2db.dispName = "(Toboganes) Tipo 80"\n        Tipo_80,\n        /** Altura entre 3 y 9 Mts., longitud 25 a 75 Mts. Estructura y soportes en concreto o metálica. Incluye piscina de acceso y sistema de bombeo y purificación.\n         */\n        !!@ ili2db.dispName = "(Toboganes) Tipo 60"\n        Tipo_60,\n        /** Altura de 6 a 9 Mts. Únicamente deslizadero de velocidad de longitud de 20 a 40 Mts. Equipo de bombeo y purificación. Estructura metálica o concreto; piscina de acceso.\n         */\n        !!@ ili2db.dispName = "(Toboganes) Tipo 50"\n        Tipo_50,\n        /** Altura de 3 a 5 Mts. Únicamente deslizadero; longitud de 10 a 20 Mts. No tienen planta de tratamiento ni de bombeo.\n         */\n        !!@ ili2db.dispName = "(Toboganes) Tipo 40"\n        Tipo_40\n      ),\n      !!@ ili2db.dispName = "Marquesinas"\n      Marquesinas(\n        /** Estructura metálica; cubierta cristalita o vidrio; piso en baldosa fina.\n         */\n        !!@ ili2db.dispName = "(Marquesinas) Tipo 80"\n        Tipo_80,\n        /** Estructura metálica; cubierta en cristalita o vidrio; piso en baldosa común.\n         */\n        !!@ ili2db.dispName = "(Marquesinas) Tipo 60"\n        Tipo_60,\n        /** Estructura metálica; cubierta de eternit y piso en cemento.\n         */\n        !!@ ili2db.dispName = "(Marquesinas) Tipo 40"\n        Tipo_40,\n        /** Estructura en madera; cubierta de zinc o eternit; Piso en baldosín o cemento.\n         */\n        !!@ ili2db.dispName = "(Marquesinas) Tipo 20"\n        Tipo_20\n      ),\n      !!@ ili2db.dispName = "Estadios o coliseos"\n      Estadios_Coliseos(\n        /** Estadio, estructura en concreto reforzado, graderías, con o sin cubierta parcial, capacidad mayor a 8.000 personas\n         */\n        !!@ ili2db.dispName = "(Estadios o coliseos) Tipo 80"\n        Tipo_80,\n        /** Estadio, estructura en concreto reforzado, graderías, con o sin cubierta parcial, capacidad mayor a 8.000 personas\n         */\n        !!@ ili2db.dispName = "(Estadios o coliseos) Tipo 60"\n        Tipo_60,\n        /** Coliseo, incluye cerramiento en malla, o en bloque pañetado cancha multifuncional, cubierta en teja termo acústica\n         */\n        !!@ ili2db.dispName = "(Estadios o coliseos) Tipo 40"\n        Tipo_40\n      ),\n      !!@ ili2db.dispName = "Plaza de toros"\n      Plazas_de_Toros(\n        /** Plaza de toros con estructura en concreto y madera capacidad de más de 10000 espectadores\n         */\n        !!@ ili2db.dispName = "(Plaza de toros) Tipo 80"\n        Tipo_80,\n        /** Plaza de toros para corralejas, estructura en madera capacidad menor a 4000 estructura en concreto y madera capacidad\n         */\n        !!@ ili2db.dispName = "(Plaza de toros) Tipo 20"\n        Tipo_20\n      ),\n      !!@ ili2db.dispName = "Vía férrea"\n      Via_Ferrea(\n        /** Via férrea de trocha  normal o estándar (4 pies, 8 1/2 pulgadas o 1435 metros) con capacidad de transporte mayor a 50 toneladas, conformada por una capa de balasto, sobre la cual se disponen traviesas de madera que soportan los rieles, entiéndase como trocha a la distancia mínima entre los dos rieles.\n         */\n        !!@ ili2db.dispName = "(Anexo) (Vía férrea) Tipo 80"\n        Tipo_80,\n        /** Via férrea de trocha angosta o yardica de 0.915 metros con capacidad menor a 50 toneladas, conformada por una capa de balasto, sobre la cual se disponen traviesas de madera que soportan los rieles, entiéndase como trocha a la distancia mínima entre los dos rieles.\n         */\n        !!@ ili2db.dispName = "(Anexo) (Vía férrea) Tipo 60"\n        Tipo_60\n      ),\n      !!@ ili2db.dispName = "Carreteras"\n      Carreteras(\n        /** Carretera pavimentada. Compuesta de una subbase granular, base en suelo cemento y carpeta asfáltica, entiéndase por sub-base granular como la capa de material granular situada entre la base del firme y la explanada.\n         */\n        !!@ ili2db.dispName = "(Anexo) (Carreteras) Tipo 60"\n        Tipo_60,\n        /** Carretera sin pavimento. Compuesta de una sub-base granular, entiéndase por su-base granular como la capa de material granular situada entre la base del firme y la explanada.\n         */\n        !!@ ili2db.dispName = "(Anexo) (Carreteras) Tipo 40"\n        Tipo_40\n      ),\n      !!@ ili2db.dispName = "Cimientos estructura muros placabase"\n      Cimientos_Estructura_Muros_Placabase(\n        /** Cimientos y estructura soportes verticales (columnas) y horizontales (vigas) destinados a sostener la totalidad o parte de la futura construcción o edificación, acompañados de muros y placas base. Esta tipología se caracteriza por presentar de manera simultánea los 4 elementos (Cimientos, Estructura, Muro o Pared y Losa de Contra piso)\n         */\n        !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 80"\n        Tipo_80,\n        /** Cimentación y estructura con soportes verticales (columnas) y horizontales (vigas) destinados a sostener la totalidad o parte de la futura construcción o edificación, acompañados de muros o placas base. Esta tipología se caracteriza por presentar de manera simultánea 3 elementos (Cimientos, Estructura, y alguno de estos dos elementos Muro Pared o Losa en Contra piso)\n         */\n        !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 60"\n        Tipo_60,\n        /** Cimentación sin estructura destinada a sostener la totalidad o parte de una futura construcción o edificación, pueden estar acompañados de muros o placas base. Esta tipología se caracteriza por presentar de manera simultánea 2 elementos (Cimientos y alguno de estos dos elemetnos Muro - Pared o Losa de Contra piso)\n         */\n        !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 40"\n        Tipo_40,\n        /** Cimentación sin estructura, destinada a sostener la totalidad o parte de una futura construcción o edificación. Esta tipología se caracteriza por presentar un solo elemento, la cimentación.\n         */\n        !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 20"\n        Tipo_20\n      ),\n      !!@ ili2db.dispName = "Lagunas de oxidación"\n      Lagunas_de_Oxidacion(\n        /** Lagunas de oxidación que en su construcción requieren excavaciones en la estructura de la laguna, con o sin protección del área de la laguna con geotextil o geomembrana, construcción de diques, protección de los taludes con geotextil o geomembrana y enrocado de taludes.\n         */\n        !!@ ili2db.dispName = "(Anexo) (Lagunas de oxidación) Tipo 20"\n        Tipo_20\n      )\n    );\n\n    /** Calificación del suelo.\n     */\n    LC_CalificarTipo = (\n      /** Calificación para predios de uso residencial.\n       */\n      !!@ ili2db.dispName = "Residencial"\n      Residencial,\n      /** Calificación para predios de uso industrial.\n       */\n      !!@ ili2db.dispName = "Industrial"\n      Industrial,\n      /** Calificación para predios de uso Institucional.\n       */\n      !!@ ili2db.dispName = "Institucional"\n      Institucional,\n      /** Calificación para predios de uso comercial.\n       */\n      !!@ ili2db.dispName = "Comercial"\n      Comercial\n    );\n\n    /** Categoría de suelo de la clasificación del Plan de Ordenamiento Territorial.\n     */\n    LC_CategoriaSueloTipo = (\n      /** Constituyen esta categoría las áreas ubicadas dentro del suelo rural, en las que se mezclan los usos del suelo y las formas de vida del campo y la ciudad, diferentes a las clasificadas como áreas de expansión urbana, que pueden ser objeto de desarrollo con restricciones de uso, de intensidad y de densidad, garantizando el autoabastecimiento en servicios públicos domiciliarios, de conformidad con lo establecido en la Ley 99 de 1993 y en la Ley 142 de 1994. Podrán formar parte de esta categoría los suelos correspondientes a los corredores urbanos interregionales.\n       * \n       * Los municipios y distritos deberán establecer las regulaciones complementarias tendientes a impedir el desarrollo de actividades y usos urbanos en estas áreas, sin que previamente se surta el proceso de incorporación al suelo urbano, para lo cual deberán contar con la infraestructura de espacio público, de infraestructura vial y redes de energía, acueducto y alcantarillado requerida para este tipo de suelo. (Artículo 34, Ley 388 de 1997)\n       */\n      !!@ ili2db.dispName = "Suburbano"\n      Suburbano,\n      /** Constituido por las zonas y áreas de terrenos localizados dentro de cualquiera de las anteriores clases, que por sus características geográficas, paisajísticas o ambientales, o por formar parte de las zonas de utilidad pública para la ubicación de infraestructuras para la provisión de servicios públicos domiciliarios o de las áreas de amenazas y riesgo no mitigable para la localización de asentamientos humanos, tiene restringida la posibilidad de urbanizarse. (Articulo 35, Ley 388 de 1997)\n       */\n      !!@ ili2db.dispName = "Protección"\n      Proteccion\n    );\n\n    LC_ClaseCalificacionTipo = (\n      /** En construcción, es el nombre que recibe el conjunto de elementos, unidos, ensamblados o conectados entre sí, que tienen la función de recibir cargas, soportar esfuerzos y transmitir esas cargas al suelo, garantizando así la función estático - resistente de la construcción. Sus componentes son: armazón, muros y cubierta.\n       */\n      !!@ ili2db.dispName = "Estructura"\n      Estructura,\n      /** Son los revestimientos o recubrimientos a todos aquellos materiales que se colocan sobre una superficie de obra negra, para darle terminación a las obras, quedando ésta con un aspecto habitable. Sus componentes son: fachada, cubrimiento de muros y pisos.\n       */\n      !!@ ili2db.dispName = "Acabados principales"\n      Acabados_Principales,\n      /** Espacio o lugar especialmente equipado para el aseo personal. Sus componentes son: tamaño, enchapes y mobiliario.\n       */\n      !!@ ili2db.dispName = "Baño"\n      Banio,\n      /** Espacio o lugar especialmente equipado para la preparación de alimentos. Sus componentes son: tamaño, enchapes y mobiliario.\n       */\n      !!@ ili2db.dispName = "Cocina"\n      Cocina,\n      /** Elemento adicional para la calificación de las Cerchas para las construcciones industriales.\n       */\n      !!@ ili2db.dispName = "Complemento industria"\n      Complemento_Industria\n    );\n\n    /** Clase de suelo de la clasificación del Plan de Ordenamiento Territorial.\n     */\n    LC_ClaseSueloTipo = (\n      /** Constituyen el suelo urbano, las áreas del territorio distrital o municipal destinadas a usos urbanos por el plan de ordenamiento, que cuenten con infraestructura vial y redes primarias de energía, acueducto y alcantarillado, posibilitándose su urbanización y edificación, según sea el caso. Podrán pertenecer a esta categoría aquellas zonas con procesos de urbanización incompletos, comprendidos en áreas consolidadas con edificación, que se definan como áreas de mejoramiento integral en los planes de ordenamiento territorial.\n       * \n       * Las áreas que conforman el suelo urbano serán delimitadas por perímetros y podrán incluir los centros poblados de los corregimientos. En ningún caso el perímetro urbano podrá ser mayor que el denominado perímetro de servicios públicos o sanitario. (Artículo 31, Ley 388 de 1997)\n       */\n      !!@ ili2db.dispName = "Urbano"\n      Urbano,\n      /** Constituyen esta categoría los terrenos no aptos para el uso urbano, por razones de oportunidad, o por su destinación a usos agrícolas, ganaderos, forestales, de explotación de recursos naturales y actividades análogas. (Artículo 33, Ley 388 de 1997)\n       */\n      !!@ ili2db.dispName = "Rural"\n      Rural,\n      /** Constituido por la porción del territorio municipal destinada a la expansión urbana, que se habilitará para el uso urbano durante la vigencia del plan de ordenamiento, según lo determinen los Programas de Ejecución.\n       * \n       * La determinación de este suelo se ajustará a las previsiones de crecimiento de la ciudad y a la posibilidad de dotación con infraestructura para el sistema vial, de transporte, de servicios públicos domiciliarios, áreas libres, y parques y equipamiento colectivo de interés público o social.\n       * \n       * Dentro de la categoría de suelo de expansión podrán incluirse áreas de desarrollo concertado, a través de procesos que definan la conveniencia y las condiciones para su desarrollo mediante su adecuación y habilitación urbanística a cargo de sus propietarios, pero cuyo desarrollo estará condicionado a la adecuación previa de las áreas programadas. (Artículo 32, Ley 388 de 1997)\n       */\n      !!@ ili2db.dispName = "Expansión urbana"\n      Expansion_Urbana\n    );\n\n    /** Valores para indicar el tipo de condición de predio\n     */\n    LC_CondicionPredioTipo = (\n      /** Predio no sometido al régimen de propiedad horizontal.\n       */\n      !!@ ili2db.dispName = "No propiedad horizontal"\n      NPH,\n      /** Predio sometido al régimen de propiedad horizontal mediante escritura pública registrada\n       */\n      !!@ ili2db.dispName = "Propiedad horizontal"\n      PH(\n        /** Predio matriz del régimen de propiedad horizontal sobre el cual se segregan todas las unidades prediales.\n         */\n        !!@ ili2db.dispName = "(Propiedad horizontal) Matriz"\n        Matriz,\n        /** Apartamento, garaje, depósito o cualquier otro tipo de unidad predial dentro del PH que se encuentra debidamente inscrito en el registro de instrumentos públicos\n         */\n        !!@ ili2db.dispName = "(Propiedad horizontal) Unidad Predial"\n        Unidad_Predial\n      ),\n      /** Predio sometido al régimen de propiedad horizontal mediante escritura pública registrada en cuyo reglamento define para cada unidad predial un área privada de terreno.\n       */\n      !!@ ili2db.dispName = "Condominio"\n      Condominio(\n        /** Predio matriz del condominio sobre el cual se segregan todas las unidades prediales.\n         */\n        !!@ ili2db.dispName = "(Condominio) Matriz"\n        Matriz,\n        /** Unidad predial dentro del condominio matriz.\n         */\n        !!@ ili2db.dispName = "(Condominio) Unidad predial"\n        Unidad_Predial\n      ),\n      /** Es la construcción o edificación instalada por una persona natural o jurídica sobre un predio que no le pertenece.\n       */\n      !!@ ili2db.dispName = "Mejora"\n      Mejora(\n        /** Mejora sobre un predio sometido a régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Mejora) Propiedad horizontal"\n        PH,\n        /** Mejora sobre un predio no sometido a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Mejora) No propiedad horizontal"\n        NPH\n      ),\n      /** Predios sobre los cuales las áreas de terreno y construcciones son dedicadas a la cremación, inhumación o enterramiento de personas fallecidas.\n       */\n      !!@ ili2db.dispName = "Parque cementerio"\n      Parque_Cementerio(\n        /** Predios sobre los cuales las áreas de terreno y construcciones son dedicadas a la cremación, inhumación o enterramiento de personas fallecidas.\n         */\n        !!@ ili2db.dispName = "(Parque cementerio) Matriz"\n        Matriz,\n        /** Área o sección de terreno con función de tumba, esta debe encontrarse inscrita en el registro de instrumentos públicos.\n         */\n        !!@ ili2db.dispName = "(Parque Cementerio) Unidad predial"\n        Unidad_Predial\n      ),\n      /** Espacio (terreno y construcción) diseñado y destinado para el tránsito de vehículos, personas, entre otros\n       */\n      !!@ ili2db.dispName = "Vía"\n      Via,\n      /** Inmuebles que siendo de dominio de la Nación, o una entidad territorial o de particulares, están destinados al uso de los habitantes.\n       */\n      !!@ ili2db.dispName = "Bien de uso público"\n      Bien_Uso_Publico\n    );\n\n    LC_ConstruccionPlantaTipo = (\n      /** Superficie horizontal de un espacio arquitectónico que divide los espacios en altura.\n       */\n      !!@ ili2db.dispName = "Piso"\n      Piso,\n      /** Piso intermedio entre los pisos principales de una casa o edificio.\n       */\n      !!@ ili2db.dispName = "Mezanine"\n      Mezanine,\n      /** Piso de un edificio situado por debajo del nivel de la calle.\n       */\n      !!@ ili2db.dispName = "Sótano"\n      Sotano,\n      /** Piso que sobresale por lo menos la mitad de su altura, del nivel de un patio de la calle.\n       */\n      !!@ ili2db.dispName = "Semisótano"\n      Semisotano,\n      /** Construcción que se encuentra por debajo del nivel de la calle y que comprende grandes espacios.\n       */\n      !!@ ili2db.dispName = "Subterráneo"\n      Subterraneo\n    );\n\n    LC_ConstruccionTipo = (\n      /** Se refiere aquellas construcciones de uso residencial, comercial e industrial.\n       */\n      !!@ ili2db.dispName = "Convencional"\n      Convencional,\n      /** Se refiere aquellas construcciones consideradas anexos de construcción.\n       */\n      !!@ ili2db.dispName = "No convencional"\n      No_Convencional\n    );\n\n    LC_DerechoTipo = (\n      /** El dominio que se llama también propiedad es el derecho real en una cosa corporal, para gozar y disponer de ella arbitrariamente, no siendo contra ley o contra derecho ajeno. (Art. 669 CC): 0100 0101 0102 0103 0106 0107 0108 0109 0110 0111 0112 0113 0114 0115 0116 0117 0118 0119 0120 0121 0122 0124 0125 0126 0127 0128 0129 0130 0131 0132 0133 0135 0137 0138 0139 0140 0141 0142 0143 0144 0145 0146 0147 0148 0150 0151 0152 0153 0154 0155 0156 0157 0158 0159 0160 0161 0163 0164 0165 0166 0167 0168 0169 0171 0172 0173 0175 0177 0178 0179 0180 0181 0182 0183 0184 0185 0186 0187 0188 0189 0190 0191 0192 0193 0194 0195 0196 0197 0198 0199 01003 01004 01005 01006 01007 01008 01009 01010 01012 01013 01014 0301 0307 0321 0332 0348 0356 0374 0375 0376 0377 0906 0907 0910 0911 0912 0913 0915 0917 0918 0919 0920 0924 0935 0959 0962 0963\n       */\n      !!@ ili2db.dispName = "Dominio"\n      Dominio,\n      /** En el ámbito de la gestión catastral, es el polígono que representa el asentamiento de personas naturales o jurídicas dentro de un terreno baldío, el cual puede contar o no con construcciones y/o edificaciones.\n       */\n      !!@ ili2db.dispName = "Ocupación"\n      Ocupacion,\n      /** En el ámbito de la gestión catastral, es el polígono que representa el asentamiento de personas naturales o jurídicas, con ánimo de señor y dueño sobre un predio privado, el cual puede contar o no con construcciones y/o edificaciones.\n       */\n      !!@ ili2db.dispName = "Posesión"\n      Posesion\n    );\n\n    /** Uso económico de la propiedad inmobiliaria.\n     */\n    LC_DestinacionEconomicaTipo = (\n      /** Se califica con destino acuícola, aquellos predios donde se realizan cultivos de organismos acuáticos, en ambientes naturales o artificiales.\n       */\n      !!@ ili2db.dispName = "Acuicola"\n      Acuicola,\n      /** Se califica con destino agrícola, aquellos predios con funcionalidad de laboreo agrícola, terrenos que han sido transformados y ocupados para la producción de cultivos cuyo objetivo es satisfacer las necesidades alimentarias, comerciales y agrícolas.\n       * \n       * En caso de encontrar actividad agrícola y actividad pecuaria en un mismo predio, se califica según la actividad que predomine. Si, ambas actividades tienen el mismo porcentaje de participación en el predio, se debe calificar como agrícola.\n       */\n      !!@ ili2db.dispName = "Agrícola"\n      Agricola,\n      /** Se califica con destino agroindustrial, aquellos predios destinados a la actividad que implica cultivo (producción) y transformación (industrialización y comercialización) de productos agrícola, pecuario y forestal.\n       */\n      !!@ ili2db.dispName = "Agroindustrial"\n      Agroindustrial,\n      /** Se califica con destino agroforestal, aquellos predios destinados al establecimiento y aprovechamiento combinado de especies forestales con actividades agrícolas o pecuarias con arreglos diferenciados. Incluye la actividad agrosilvícola, silvopastoril y agrosilvopastoril.\n       */\n      !!@ ili2db.dispName = "Agroforestal"\n      Agroforestal,\n      /** Se califica con destino comercial, aquellos predios cuya finalidad es la de realizar la actividad económica de ofrecer, transar o almacenar bienes y/o servicios a través de un mercader o comerciante.\n       */\n      !!@ ili2db.dispName = "Comercial"\n      Comercial,\n      /** Se califica con destino cultural, aquellos predios considerados como bienes culturales de la nación, además los espacios destinados al desarrollo de actividades artísticas.\n       */\n      !!@ ili2db.dispName = "Cultural"\n      Cultural,\n      /** Se califica con destino educativo, aquellos predios donde se desarrollan actividades académicas, tanto de la educación inicial, preescolar, básica, media y superior. Incluye los jardines, escuelas, colegios, institutos técnicos, fundaciones educativas, centros de investigación y universidades.\n       */\n      !!@ ili2db.dispName = "Educativo"\n      Educativo,\n      /** Se califica con destino forestal, aquellos predios con áreas naturales o seminaturales, constituidas principalmente por elementos arbóreos de especies nativas, exóticas e introducidas.  Incluye las plantaciones forestales comerciales y los bosques naturales y seminaturales.\n       */\n      !!@ ili2db.dispName = "Forestal"\n      Forestal,\n      /** Se califica con destino habitacional, aquellos predios de uso residencial cuya finalidad es la vivienda habitual de las personas. Incluye los parqueaderos, garajes y depósitos dentro de propiedad horizontal como también los predios rurales de vivienda campestre.\n       */\n      !!@ ili2db.dispName = "Habitacional"\n      Habitacional,\n      /** Se califica con destino industrial, aquellos predios donde se desarrollan actividades de producción, fabricación, preparación, recuperación, reproducción, ensamblaje, construcción, transformación, tratamiento y manipulación de materias primas para producir bienes o productos materiales y que no estén clasificados dentro de los predios mineros.\n       */\n      !!@ ili2db.dispName = "Industrial"\n      Industrial,\n      /** Se califica con destino infraestructura asociada a la producción agropecuaria, aquellos predios sobre los cuales se encuentra la infraestructura requerida dentro de la actividad agropecuaria y que son de interés para el sector agropecuario, como: bancos de maquinaria, plantas de almacenamiento, centros de acopio, centros de transformación agrícola, mataderos, etc.\n       */\n      !!@ ili2db.dispName = "Infraestructura asociada a producción agropecuaria"\n      Infraestructura_Asociada_Produccion_Agropecuaria,\n      /** Se califica con destino infraestructura hidráulica, aquellos predios sobre los cuales se encuentra establecida infraestructura para controlar, almacenar y conducir un flujo continuo de agua. Incluye los embalses, represas, acueductos, centrales de tratamiento y distribución, alcantarillados, estaciones depuradoras de aguas residenciales y distrito de adecuación de tierras.\n       */\n      !!@ ili2db.dispName = "Infraestructura hidráulica"\n      Infraestructura_Hidraulica,\n      /** Se califica con destino infraestructura de saneamiento básico, aquellos predios sobre los cuales se encuentra establecida la infraestructura para el saneamiento básico, con excepción del alcantarillado. Incluye los centros de acopio de basura y material reciclable, rellenos sanitarios e incineradoras.\n       */\n      !!@ ili2db.dispName = "Infraestructura saneamiento"\n      Infraestructura_Saneamiento_Basico,\n      /** Se califica con destino infraestructura de seguridad, aquellos predios sobre los cuales se encuentra establecida infraestructura destina a salvaguardar el orden público. Incluye las estaciones de policía, batallones, cárceles, etc.\n       */\n      !!@ ili2db.dispName = "Infraestructura seguridad"\n      Infraestructura_Seguridad,\n      /** Se califica con destino infraestructura de transporte, aquellos predios en los cuales se encuentra establecida infraestructura para el desarrollo de actividad de transporte, muelles para embarque, desembarque de carga y/o pasajeros, pistas de aterrizaje, torres de control, centros de almacenamiento y venta de combustible, etc. Se exceptúan de estas, aquellas plataformas flotantes y aquellas que se encuentren fuera de la plataforma continental.\n       */\n      !!@ ili2db.dispName = "Infraestructura transporte"\n      Infraestructura_Transporte,\n      /** Se califica con destino institucional, aquellos predios destinados a la administración y prestación de servicios del Estado tanto de orden nacional como territorial.\n       */\n      !!@ ili2db.dispName = "Institucional"\n      Institucional,\n      /** Se califica con destino minería e hidrocarburos, aquellos predios donde se hace aprovechamiento directo de los recursos minerales o transformación primaria de los mismos.\n       */\n      !!@ ili2db.dispName = "Minería hidrocarburos"\n      Mineria_Hidrocarburos,\n      /** Se califica con este destino, aquellos predios urbanos no construidos, ubicados en terrenos de grandes áreas que no han sido desarrollados y sin restricción legal para adelantar algún tipo de desarrollo urbanístico.\n       */\n      !!@ ili2db.dispName = "Lote urbanizable no urbanizado"\n      Lote_Urbanizable_No_Urbanizado,\n      /** Se califica con este destino, aquellos predios urbanos no construidos, ubicados en zonas urbanizadas, es decir, con infraestructura de servicios públicos e infraestructura vial.\n       */\n      !!@ ili2db.dispName = "Lote urbanizado no construido"\n      Lote_Urbanizado_No_Construido,\n      /** Se califica con este destino, aquellos predios urbanos o rurales clasificados por el instrumento de planeación como suelo de protección, también se incluyen los predios con afectación, por ejemplo los utilizados como servidumbres para los servicios públicos.\n       */\n      !!@ ili2db.dispName = "Lote no urbanizable"\n      Lote_No_Urbanizable,\n      /** Se califica con destino pecuario, aquellos predios destinados a la cría, beneficio y aprovechamiento de especies de animales no domésticos, para el consumo humano (productos cárnicos y lácteos), uso artesanal (lana, cuero, plumas, etc.) y conservación de fauna (zoocría).\n       */\n      !!@ ili2db.dispName = "Pecuario"\n      Pecuario,\n      /** Se califica con destino recreacional, aquellos predios que corresponden a equipamientos deportivos y recreativos, parques de propiedad privada o pública, clubes, generando bienestar físico y social.\n       */\n      !!@ ili2db.dispName = "Recreacional"\n      Recreacional,\n      /** Se califica con destino religioso, aquellos predios cuya finalidad es el culto religioso público, incluye las parroquias, basílicas, catedrales, santuarios, capillas, colegiatas, monasterios, conventos y seminarios.\n       */\n      !!@ ili2db.dispName = "Religioso"\n      Religioso,\n      /** Se califica con destino salubridad, aquellos predios destinados al cuidado de la salud de los ciudadanos, incluye los hospitales, centros de salud, clínicas, laboratorios y consultorios que prestan el servicio de salud tanto carácter público o privado\n       */\n      !!@ ili2db.dispName = "Salubridad"\n      Salubridad,\n      /** Se califica con destino infraestructura de servicios funerarios, aquellos predios que prestan servicios de velatorio, cremación y entierro de personas fallecidas, incluye los cementerios, funerarias, morgue, anfiteatros, crematorios y demás relacionados.\n       */\n      !!@ ili2db.dispName = "Servicios funerarios"\n      Servicios_Funerarios,\n      /** Se califica con destino uso público, aquellos predios urbanos o rurales, que conforman el espacio público, como las zonas verdes, alamedas, plazas (no se incluyen las plazas de mercado), plazoletas parques, cuerpos de agua, áreas de control y protección ambiental, túneles, vías, ciclorutas, glorietas, etc.\n       */\n      !!@ ili2db.dispName = "Uso público"\n      Uso_Publico\n    );\n\n    LC_DominioConstruccionTipo = (\n      /** Tipo de dominio común.\n       */\n      !!@ ili2db.dispName = "Común"\n      Comun,\n      /** Tipo de dominio privado.\n       */\n      !!@ ili2db.dispName = "Privado"\n      Privado\n    );\n\n    LC_EstadoConservacionTipo = (\n      /** Se agrupan en este concepto, aquellas estructuras con el mayor grado de deterioro que se puedan encontrar, en condiciones precarias lo cual las hace prácticamente inhabitables.  Generalmente se presenta en construcciones antiguas o con material de muy mala calidad.\n       */\n      !!@ ili2db.dispName = "Malo"\n      Malo,\n      /** En esta categoría, se clasifican aquellas estructuras que tienen algunos daños menores, (agrietamiento de paredes, hundimiento de pisos, etc.) pero que todavía se encuentran en condiciones aceptables, sin peligros eminentes o exigencias imperativa de reparaciones inmediatas.  Se presenta con frecuencia en construcciones más o menos antiguas o materiales de regular calidad.\n       */\n      !!@ ili2db.dispName = "Regular"\n      Regular,\n      /** Se calificarán como tales, aquellas estructuras, no necesariamente nuevas, que se hallan cumpliendo a cabalidad con la función para las que fueron construidas, no demuestran deterioro, al menos visibles, y por efectos de uso se encuentran solamente un tanto deslucidas y sus materiales son de buena calidad.\n       */\n      !!@ ili2db.dispName = "Bueno"\n      Bueno,\n      /** Se define en este grado, el estado de conservación de una estructura nueva en la que no se vislumbra deterioro, no se observa daño y en la cual los materiales y los acabados son de óptima calidad.\n       */\n      !!@ ili2db.dispName = "Excelente"\n      Excelente\n    );\n\n    LC_FotoidentificacionTipo = (\n      /** Demarcación de un área con un punto que se encuentra visible en un proceso de fotoidentificación.\n       */\n      !!@ ili2db.dispName = "Visible"\n      Visible,\n      /** Demarcación estimada mediante la interpretación de coberturas  de un área con un punto en un proceso de fotoidentificación.\n       */\n      !!@ ili2db.dispName = "Estimado"\n      Estimado\n    );\n\n    LC_FuenteAdministrativaTipo = (\n      /** Una escritura pública es un documento público en el que se realiza ante un notario público un determinado hecho o un derecho autorizado por dicho fedatario público, que firma con el otorgante u otorgantes,mostrando sobre la capacidad jurídica del contenido y de la fecha en que se realizó\n       */\n      !!@ ili2db.dispName = "Escritura pública"\n      Escritura_Publica,\n      /** La sentencia es la resolución judicial definitiva dictada por un juez o tribunal que pone fin a la litis o caso sometido a su conocimiento y cierra definitivamente su actuación en el mismo\n       */\n      !!@ ili2db.dispName = "Sentencia judicial"\n      Sentencia_Judicial,\n      /** Un acto administrativo es toda manifestación o declaración emanada de la administración pública en el ejercicio de potestades administrativas, mediante el que impone su voluntad sobre los derechos, libertades o intereses de otros sujetos públicos o privados y que queda bajo el del comienzo.\n       */\n      !!@ ili2db.dispName = "Acto administrativo"\n      Acto_Administrativo,\n      /** Documento que contiene un compromiso entre dos o más personas que lo firman.\n       */\n      !!@ ili2db.dispName = "Documento privado"\n      Documento_Privado,\n      /** Cuando no se haya documento soporte pero puede ser una declaración verbal.\n       */\n      !!@ ili2db.dispName = "Sin documento"\n      Sin_Documento\n    );\n\n    LC_GrupoEtnicoTipo = (\n      /** Son el grupo humano que vive de acuerdo con las formas de relación con el medio natural en el que se asentaron los diferentes grupos aborígenes desde antes de la conquista y la han conservado y dinamizado a lo largo de la historia.\n       */\n      !!@ ili2db.dispName = "Indígena"\n      Indigena,\n      /** El pueblo Rrom o gitano se consolida y fortalece como grupo étnico que hacer parte de la diversidad étnica y cultural de la nación colombiana. Su origen se remonta a más de 1000 años, proviene del norte de la India y conserva un alto bagaje cultural que lo diferencia de otros pueblos y de la sociedad mayoritaria. En este sentido, cuenta con unos elementos identitarios que los diferencian notablemente de los demás grupos étnicos de la sociedad. Sé es Rrom o gitano por derecho de nacimiento y se lleva la sangre gitana.\n       */\n      !!@ ili2db.dispName = "Rrom"\n      Rrom,\n      /** Es la población nativa de las Islas de San Andrés, Providencia Y Santa Catalina descendientes de la unión entre europeos (principalmente ingleses, españoles y holandeses) y esclavos africanos. Se distinguen por su cultura, lengua (creole), creencias religiosas (iglesia bautista) y pasado histórico similar a los pueblos antillanos como Jamaica y Haití.\n       */\n      !!@ ili2db.dispName = "Raizal"\n      Raizal,\n      /** La comunidad palenquera está conformada por los descendientes de los esclavizados que mediante actos de resistencia y de libertad, se refugiaron en los territorios de la Costa Norte de Colombia desde el Siglo XV denominados palenques. Existen 4 Palenques reconocidos: San Basilio de Palenque (Mahates – Bolívar), San José de Uré (Córdoba), Jacobo Pérez escobar (Magdalena) y La Libertad (Sucre).\n       */\n      !!@ ili2db.dispName = "Palenquero"\n      Palenquero,\n      /** Es el conjunto de familias de ascendencia afrocolombiana que poseen una cultura propia, comparten una historia y tienen sus propias tradiciones y costumbres dentro de la relación campo-poblado, además revelan y conservan conciencia de identidad que las distinguen de otros grupos étnicos. Se suele denominar a este grupo humano como negros, morenos, mulatos y afrodescendientes.\n       */\n      !!@ ili2db.dispName = "Negro o afrocolombiano"\n      Negro_Afrocolombiano,\n      /** No pertenece a ningún grupo étnico.\n       */\n      !!@ ili2db.dispName = "Ninguno"\n      Ninguno\n    );\n\n    LC_InteresadoDocumentoTipo = (\n      /** Es un documento emitido por la Registraduría Nacional del Estado Civil para permitir la identificación personal de los ciudadanos.\n       */\n      !!@ ili2db.dispName = "Cédula de ciudadanía"\n      Cedula_Ciudadania,\n      /** Es el documento que cumple los fines de identificación de los extranjeros en el territorio nacional y su utilización deberá estar acorde con la visa otorgada al extranjero.\n       */\n      !!@ ili2db.dispName = "Cédula de extranjería"\n      Cedula_Extranjeria,\n      /** El Número de Identificación Tributaria (NIT) es un código privado, secreto e intransferible que solamente debe conocer el contribuyente.\n       */\n      !!@ ili2db.dispName = "NIT"\n      NIT,\n      /** Es el documento oficial que hace las veces de identificación para los menores de edad entre los 7 y los 18 años.\n       */\n      !!@ ili2db.dispName = "Tarjeta de identidad"\n      Tarjeta_Identidad,\n      /** Registro donde se hacen constar por autoridades competentes los nacimientos, matrimonios, defunciones y demás hechos relativos al estado civil de las personas. En el modelo se tendrá en cuenta el número de registro como identificación personal de las personas de 0 a 7 años.\n       */\n      !!@ ili2db.dispName = "Registro civil"\n      Registro_Civil,\n      /** Es un consecutivo asignado automáticamente en registro en lugar del número de la identificación de la persona que hace el trámite, se usa especialmente en trámites de construcción cuando el proyecto está a nombre de una Fiducia el cual tiene el mismo número del banco.\n       */\n      !!@ ili2db.dispName = "Secuencial"\n      Secuencial\n    );\n\n    LC_InteresadoTipo = (\n      /** Se refiere a la persona humana.\n       */\n      !!@ ili2db.dispName = "Persona natural"\n      Persona_Natural,\n      /** Se llama persona jurídica, una persona ficticia, capaz de ejercer derechos y contraer obligaciones civiles, y de ser representada judicial y extrajudicialmente. Las personas jurídicas son de dos especies: corporaciones y fundaciones de beneficencia pública.\n       */\n      !!@ ili2db.dispName = "Persona jurídica"\n      Persona_Juridica\n    );\n\n    LC_ObjetoConstruccionTipo = (\n      /** Se refiere al conjunto compuesto por los cimientos, columnas, vigas, entrepisos y demás componentes del esqueleto o armadura que soportan las cargas y sostienen la edificación.  El adobe, bahareque, tapia, califíquelos con el puntaje correspondiente a madera.  En el caso de tener muros de carga en ladrillo, califíquelos como armazón de ladrillo.  En aquellas viviendas de hasta tres pisos y en donde se observe, vigas, columnas y planchas se colocan en la opción “concreto hasta tres pisos”.  La máxima calificación será para edificaciones de concreto de 4 o más pisos.\n       */\n      !!@ ili2db.dispName = "Armazón"\n      Armazon(\n        !!@ ili2db.dispName = "(Armazón) Madera"\n        Madera,\n        !!@ ili2db.dispName = "(Armazón) Prefabricado"\n        Prefabricado,\n        !!@ ili2db.dispName = "(Armazón) Ladrillo, bloque"\n        Ladrillo_Bloque,\n        !!@ ili2db.dispName = "(Armazón) Concreto hasta tres pisos"\n        Concreto_Hasta_Tres_Pisos,\n        !!@ ili2db.dispName = "(Armazón) Concreto cuatro o más pisos"\n        Concreto_Cuatro_O_Mas_Pisos\n      ),\n      /** Se refiere a los muros divisorios no considerados como parte del armazón.\n       */\n      !!@ ili2db.dispName = "Muros"\n      Muros(\n        !!@ ili2db.dispName = "(Muros) Materiales de desecho, esterilla"\n        Materiales_Desecho_Esterilla,\n        !!@ ili2db.dispName = "(Muros) Bahareque, adobe, tapia"\n        Bahareque_Adobe_Tapia,\n        !!@ ili2db.dispName = "(Muros) Madera"\n        Madera,\n        !!@ ili2db.dispName = "(Muros) Concreto prefabricado"\n        Concreto_Prefabricado,\n        !!@ ili2db.dispName = "(Muros) Bloque, ladrillo"\n        Bloque_Ladrillo\n      ),\n      /** Techo exterior o tejado de la edificación\n       */\n      !!@ ili2db.dispName = "Cubierta"\n      Cubierta(\n        !!@ ili2db.dispName = "(Cubierta) Materiales de desecho, telas asfalticas"\n        Materiales_Desecho_Telas_Asfalticas,\n        !!@ ili2db.dispName = "(Cubierta) Zinc, teja de barro, eternit rústico"\n        Zinc_Teja_De_Barro_Eternit_Rustico,\n        !!@ ili2db.dispName = "(Cubierta) Entrepiso (cubierta provisional) prefabricado"\n        Entrepiso_Cubierta_Provisional_Prefabricado,\n        !!@ ili2db.dispName = "(Cubierta) Eternit o teja de barro (cubierta sencilla)"\n        Eternit_O_Teja_De_Barro_Cubierta_Sencilla,\n        !!@ ili2db.dispName = "(Cubierta) Azotea, aluminio, placa sencilla con eternit o teja de barro"\n        Azotea_Aluminio_Placa_Sencilla_Con_Eternit,\n        !!@ ili2db.dispName = "(Cubierta) Placa imperbeabilizada cubierta lujosa u ornamental"\n        Placa_Impermeabilizada_Cubierta_Lujosa_U_Ornamental\n      ),\n      /** Nombrase como tal al conjunto de elementos que constituyen el frente o parte exterior de una construcción, que da cara a la vía o camino, que incluye la puerta de acceso.  Tomada dentro de la variable, acabados principales constituyen un concepto bastante representativo de la calidad de la vivienda.\n       */\n      !!@ ili2db.dispName = "Fachada"\n      Fachada(\n        /** -Puerta:  Fabricada con materiales como: Maderas burdas, lámina de zinc, lata o latones carecen por completo de lujos.\n         * \n         * -Ventanas:  En la gran mayoría de casos son pequeñas, en madera burda o ángulo de hierro sencillo.\n         * \n         * -Cubrimiento del muro:  Generalmente los muros no tienen cubrimiento, se presentan con ladrillo corrientes o bloque a la vista y en algunos casos pintura de cal o carburo directamente sobre el ladrillo, y en ocasiones pañete sin pintar o con pinturas muy económicas.\n         */\n        !!@ ili2db.dispName = "(Fachada) Pobre"\n        Pobre,\n        /** -Puerta:  En maderas sin trabajar o láminas metálicas sin ornamentación\n         * \n         * -Ventanas:  Pequeñas o de regular tamaño, en madera sin trabajo ornamental o metal con pintura de aceite.\n         * \n         * -Cubrimiento de muros:  En la mayoría de los casos se encuentran pañetes con pinturas económicas, o ladrillo prensado a la vista, generalmente un solo plano en el frente.\n         */\n        !!@ ili2db.dispName = "(Fachada) Sencilla"\n        Sencilla,\n        /** -Puerta de distintos tamaños, construidas en madera elaborada, o metal en lámina doblada, con rejas en ornamentación metálica en la mayoría de los casos.\n         * \n         * -Cubrimiento:  Se encuentran frecuentemente pañetados y enlucidos con pintura de regular calidad; en urbanizaciones se utiliza bastante el pañete rústico pintado con cal o carburo.  Otras opciones son: En ladrillo prensado a la vista, el granito y la chapa de piedra de presentación sencilla.  Hasta dos planos enfrente y con una longitud entre 7 y 8 mts, con antejardín, donde la puerta de garaje forma parte integral de esta fachada.\n         */\n        !!@ ili2db.dispName = "(Fachada) Regular"\n        Regular,\n        /** -Puertas en maderas con cierto trabajo manual; en algunos casos en lámina prensada (pintada en aceite o en muy pocos casos al duco) con metal ornamentado y vidrio martillado.\n         * \n         * -Ventanas:  Amplias, en lámina prensada o madera trabajada, pintura de aceite.  Las ventanas ocupan buena parte del frente y la fachada.\n         * \n         * -Cubrimiento:  Pañete en cemento, pintura en vinilo, ladrillo prensado a la vista pintado en aceite, granito rústico fino pintado en vinilo, piedra pulida.\n         * \n         * -La fachada presenta varios planos y tiene una longitud entre 10 y 14 mts, en el cual la puerta del garaje, en ocasiones doble, participa en forma importante.\n         */\n        !!@ ili2db.dispName = "(Fachada) Buena"\n        Buena,\n        /** -Puertas en maderas con cierto trabajo manual; en algunos casos en lámina prensada (pintada en aceite o en muy pocos casos al duco) con metal ornamentado y vidrio martillado.\n         * \n         * -Ventanas:  Amplias, en lámina prensada o madera trabajada, pintura de aceite.  Las ventanas ocupan buena parte del frente y la fachada.\n         * \n         * -Cubrimiento:  Pañete en cemento, pintura en vinilo, ladrillo prensado a la vista pintado en aceite, granito rústico fino pintado en vinilo, piedra pulida.\n         * \n         * -La fachada presenta varios planos y tiene una longitud entre 10 y 14 mts, en el cual la puerta del garaje, en ocasiones doble, participa en forma importante.\n         */\n        !!@ ili2db.dispName = "(Fachada) Lujosa"\n        Lujosa\n      ),\n      /** Se califica de acuerdo al material y según las opciones que se presentan en el formulario, se tendrá en cuenta que si aparece por lo menos el 80% en pañete, se marcará este material y si aparece por lo menos un 20% de otro material de los más costosos (granito, madera, mármol), se marcará este en el formulario.  Si se encuentra por lo menos el 50% sin cubrimiento, se calificará como tal.  En caso de encontrarse un cubrimiento no completado en el formulario se asimilará, según el factor, más cercano de los referidos.  El pañete se refiere al cubrimiento en el cual se emplea solamente arena y cemento; el estuco es el cubrimiento fino sobre pañete.\n       * \n       * Es necesario aclarar que en el caso del papel de colgadura, se debe tener en cuenta que éste se encuentra en dos categorías:\n       * \n       * Papel común:  Características de las construcciones de estratos medio bajo y medio medio, se presenta en la mayoría de los casos textura gruesa y superficie corrugada.\n       * \n       * Papel fino: Contrario al anterior, se encuentra normalmente en construcciones lujosas y se caracteriza por su textura fina, visible en los orillos y superficie lisa.  Sus acabados siempre son finos.\n       * \n       * Además de los muros, el papel se encuentra en enchapes de baños y cocinas.\n       */\n      !!@ ili2db.dispName = "Cubrimiento de muros"\n      Cubrimiento_Muros(\n        !!@ ili2db.dispName = "(Cubrimiento de muros) Sin cubrimiento"\n        Sin_Cubrimiento,\n        !!@ ili2db.dispName = "(Cubrimiento de muros) Pañete, papel común, ladrillo prensado"\n        Paniete_Papel_Comun_Ladrillo_Prensado,\n        !!@ ili2db.dispName = "(Cubrimiento de muros) Estuco, cerámica, papel fino"\n        Estuco_Ceramica_Papel_Fino,\n        !!@ ili2db.dispName = "(Cubrimiento de muros) Madera, piedra ornamental"\n        Madera_Piedra_Ornamental,\n        !!@ ili2db.dispName = "(Cubrimiento de muros) Mármol, lujosos otros"\n        Marmol_Lujosos_Otros\n      ),\n      /** En esta componente, se inscribirá lo referente al material predominante en el piso de la construcción según las opciones indicadas en el formulario y el más costoso si se encuentra en partes iguales.  Se marcará también con una X según la unidad de avalúo reconocida.\n       */\n      !!@ ili2db.dispName = "Piso"\n      Piso(\n        !!@ ili2db.dispName = "(Piso) Tierra pisada"\n        Tierra_Pisada,\n        !!@ ili2db.dispName = "(Piso) Cemento, madera burda"\n        Cemento_Madera_Burda,\n        !!@ ili2db.dispName = "(Piso) Baldosa común de cemento, tablón de ladrillo"\n        Baldosa_Comun_De_Cemento_Tablon_Ladrillo,\n        !!@ ili2db.dispName = "(Piso) Listón machihembrado"\n        Liston_Machihembrado,\n        !!@ ili2db.dispName = "(Piso) Tableta, caucho, acrílico, granito, baldosa fina"\n        Tableta_Caucho_Acrilico_Granito_Baldosa_Fina,\n        !!@ ili2db.dispName = "(Piso) Parquet, alfombra, retal de marmol (grano pequeño)"\n        Parquet_Alfombra_Retal_De_Marmol,\n        !!@ ili2db.dispName = "(Piso) Retal de mármol, mármol, otros lujosos"\n        Retal_De_Marmol_Marmol_Otros_Lujosos\n      ),\n      !!@ ili2db.dispName = "Tamaño de baño"\n      Tamanio_Banio(\n        /** Sin baño\n         */\n        !!@ ili2db.dispName = "(Tamaño de baño) Sin baño"\n        Sin_Banio,\n        /** Si mide menos de 4 mts cuadrados.\n         */\n        !!@ ili2db.dispName = "(Tamaño de baño) Pequeño"\n        Pequenio,\n        /** Si su área aproximada se encuentra entre 4 y 6 mts.\n         */\n        !!@ ili2db.dispName = "(Tamaño de baño) Mediano"\n        Mediano,\n        /** Si su área es mayor a 6 mts cuadrados.\n         */\n        !!@ ili2db.dispName = "(Tamaño de baño) Grande"\n        Grande\n      ),\n      /** Se refiere al cubrimiento de los muros del baño principal, se calificará según las opciones establecidas en el formulario de reconocimiento, teniendo en cuenta que los materiales y condiciones no contemplados se deben asimilar al más parecido de ellos de acuerdo con el costo.  Marque el material que corresponda al mayor porcentaje o al más costoso si se encuentran por partes iguales.\n       */\n      !!@ ili2db.dispName = "Enchape de baño"\n      Enchape_Banio(\n        !!@ ili2db.dispName = "(Enchape de baño) Sin cubrimiento"\n        Sin_Cubrimiento,\n        !!@ ili2db.dispName = "(Enchape de baño) Pañete, baldosa común de cemento"\n        Paniete_Baldosa_Comun_De_Cemento,\n        !!@ ili2db.dispName = "(Enchape de baño) Baldosín unicolor, papel común"\n        Baldosin_Unicolor_Papel_Comun,\n        !!@ ili2db.dispName = "(Enchape de baño) Baldosín decorado, papel fino"\n        Baldosin_Decorado_Papel_Fino,\n        !!@ ili2db.dispName = "(Enchape de baño) Cerámica cristanac, granito"\n        Ceramica_Cristanac_Granito,\n        !!@ ili2db.dispName = "(Enchape de baño) Mármol, enchape lujoso"\n        Marmol_Enchape_Lujoso\n      ),\n      !!@ ili2db.dispName = "Mobiliario de baño"\n      Mobiliario_Banio(\n        /** Cuenta con uno o máximo dos servicios entre lavamanos retrete y ducha; los porcelanizados, en caso de tenerlos, son muy económicos; exceptuando los gabinetes pequeños de latón, no tiene ningún otro mobiliario ni divisiones.\n         */\n        !!@ ili2db.dispName = "(Mobiliario de baño) Pobre"\n        Pobre,\n        /** Esta categoría de baños cuenta con tres servicios.  Los porcenalizados de esta categoría son del tipo standard, se encuentran gabinetes muy sencillos y en latón y ocasionalmente pequeños armarios en madera burda o metal.\n         */\n        !!@ ili2db.dispName = "(Mobiliario de baño) Sencillo"\n        Sencillo,\n        /** Tiene mínimo tres servicios pero de tipo económico.  Tienen gabinetes de regular tamaño, algunas veces empotrados, lavamanos con mueble o pedestal y división de la ducha.\n         */\n        !!@ ili2db.dispName = "(Mobiliario de baño) Regular"\n        Regular,\n        /** Cuenta como mínimo con cuatro servicios, los porcenalizados son finos, en colores, con pedestales, adornos y grifería fina, tina, planchas de lavamanos generalmente en mármol con muebles en madera trabajada de tamaños regulares a grandes, con espejos más o menos grandes con luz integrada, la tina forma parte de la ducha, en el mismo espacio.\n         * \n         * También se encuentran pequeños armarios y gabinetes auxiliares en madera o acrílico, empotrados o sobrepuestos.  Normalmente presentan división de la ducha, construida en aluminio y cristalita.\n         */\n        !!@ ili2db.dispName = "(Mobiliario de baño) Bueno"\n        Bueno,\n        !!@ ili2db.dispName = "(Mobiliario de baño) Lujoso"\n        Lujoso\n      ),\n      !!@ ili2db.dispName = "Tamaño de cocina"\n      Tamanio_Cocina(\n        !!@ ili2db.dispName = "(Tamaño de cocina) Sin cocina"\n        Sin_Cocina,\n        !!@ ili2db.dispName = "(Tamaño de cocina) Pequeña"\n        Pequenia,\n        !!@ ili2db.dispName = "(Tamaño de cocina) Mediana"\n        Mediana,\n        !!@ ili2db.dispName = "(Tamaño de cocina) Grande"\n        Grande\n      ),\n      !!@ ili2db.dispName = "Enchape de cocina"\n      Enchape_Cocina(\n        !!@ ili2db.dispName = "(Enchape de cocina) Sin cubrimiento"\n        Sin_Cubrimiento,\n        !!@ ili2db.dispName = "(Enchape de cocina) Pañete, baldosa de cemento"\n        Paniete_Baldosa_De_Cemento,\n        !!@ ili2db.dispName = "(Enchape de cocina) Baldosín unicolor, papel común"\n        Baldosin_Unicolor_Papel_Comun,\n        !!@ ili2db.dispName = "(Enchape de cocina) Baldosín decorado, papel fino"\n        Baldosin_Decorado_Papel_Fino,\n        !!@ ili2db.dispName = "(Enchape de cocina) Cerámica cristanac, granito"\n        Ceramica_Cristanac_Granito,\n        !!@ ili2db.dispName = "(Enchape de cocina) Mármol, enchape lujoso"\n        Marmol_Enchape_Lujoso\n      ),\n      !!@ ili2db.dispName = "Mobiliario de cocina"\n      Mobiliario_Cocina(\n        !!@ ili2db.dispName = "(Mobiliario de cocina) Pobre"\n        Pobre,\n        !!@ ili2db.dispName = "(Mobiliario de cocina) Sencillo"\n        Sencillo,\n        !!@ ili2db.dispName = "(Mobiliario de cocina) Regular"\n        Regular,\n        !!@ ili2db.dispName = "(Mobiliario de cocina) Bueno"\n        Bueno,\n        !!@ ili2db.dispName = "(Mobiliario de cocina) Lujoso"\n        Lujoso\n      ),\n      !!@ ili2db.dispName = "Cerchas complemento industria"\n      Cerchas_Complemento_Industria(\n        !!@ ili2db.dispName = "(Cerchas complemento industria) Madera"\n        Madera,\n        !!@ ili2db.dispName = "(Cerchas complemento industria) Metálica liviana"\n        Metalica_Liviana,\n        !!@ ili2db.dispName = "(Cerchas complemento industria) Metálica mediana"\n        Metalica_Mediana,\n        !!@ ili2db.dispName = "(Cerchas complemento industria) Metálica pesada"\n        Metalica_Pesada,\n        !!@ ili2db.dispName = "(Cerchas complemento industria) Altura"\n        Altura\n      )\n    );\n\n    LC_OfertaTipo = (\n      /** Es una operación que se realiza a través del mercado inmobiliario, mediante la cual un ofertante pone a la venta algún un inmueble.\n       */\n      !!@ ili2db.dispName = "Venta"\n      Venta,\n      /** Es una operación que se realiza a través del mercado inmobiliario, mediante la cual un ofertante pone en alquiler o arriendo un bien inmueble.\n       */\n      !!@ ili2db.dispName = "Arriendo"\n      Arriendo\n    );\n\n    LC_PredioTipo = (\n      /** Es el predio que pertenece al estado y/o cuyo propietario es una entidad de derecho público\n       */\n      !!@ ili2db.dispName = "Público"\n      Publico(\n        /** Es un bien inmueble de propiedad de la Nación y ubicado en zonas rurales\n         */\n        !!@ ili2db.dispName = "(Público) Baldío"\n        Baldio,\n        /** Los bienes de la Unión cuyo uso no pertenece generalmente a los habitantes, se llaman bienes de la Unión o bienes fiscales\n         */\n        !!@ ili2db.dispName = "(Público) Fiscal"\n        Fiscal,\n        /** Son bienes patrimoniales los de titularidad de las administraciones públicas que no tengan el carácter de bienes de dominio público, es decir, que no estén destinados directamente al uso público o afectados a un servicio público. Si no consta la afectación de un bien se presume su carácter patrimonial.\n         */\n        !!@ ili2db.dispName = "(Público) Patrimonial"\n        Patrimonial,\n        /** Son aquellos inmuebles de dominio público cuyo uso pertenece a todos los habitantes del territorio nacional, destinados al uso o disfrute colectivo.\n         */\n        !!@ ili2db.dispName = "(Público) Uso público"\n        Uso_Publico\n      ),\n      /** Es aquel que ha salido del patrimonio del estado, cuenta con un propietario inscrito en el folio de matrícula y se considera propiedad privada en los términos del artículo 48 de la Ley 160 de 1993.\n       */\n      !!@ ili2db.dispName = "(Privado)"\n      Privado,\n      /** Son los predios adjudicados a comunidades pertenecientes a grupos étnicos en el marco del reconocimiento de los resguardos legalmente constituidos según el Decreto 2164 de 1995 o de las propiedades colectivas de comunidades negras conforme Ley 70 de 1993.\n       */\n      !!@ ili2db.dispName = "(Territorio colectivo)"\n      Territorio_Colectivo,\n      /** Son bienes inmuebles que se encuentran dentro de territorio respectivo a cargo de la Nación, sin dueño aparente o conocido\n       */\n      !!@ ili2db.dispName = "Vacante"\n      Vacante\n    );\n\n    LC_ProcedimientoCatastralRegistralTipo = (\n      /** El gestor catastral competente, de oficio o a solicitud de parte del titular del derecho de dominio, o de las entidades públicas que con ocasión de sus funciones legales administran inmuebles propios o ajenos, podrán efectuar la actualización mediante la descripción técnica de linderos de bienes inmuebles, cuando sean verificables mediante métodos directos y/o indirectos sin variación, o cuando la variación o diferencia se encuentre dentro de los márgenes de tolerancia establecidos por la máxima autoridad catastral. La descripción de los linderos llevará a la certeza del área. Articulo 2.2.2.2.17. Decreto 148 de 2020.\n       */\n      !!@ ili2db.dispName = "Actualización linderos con efectos registrales"\n      Actualizacion_Linderos,\n      /** La rectificación de área en el sistema catastral y/o registral procederá ante el gestor catastral, de oficio o a solicitud de parte del titular  del derecho de dominio, o de las entidades públicas que con ocasión de sus funciones legales administran inmuebles propios o ajenos, cuando los linderos estén debida y técnicamente descritos, sean verificables mediante métodos directos y/o indirectos sin variación, pero que a lo largo de la tradición del bien inmueble el área de éste no haya sido determinada adecuadamente, o cuando la variación o diferencia se encuentre dentro de los márgenes de tolerancia establecidos por la máxima autoridad catastral. Artículo 2.2.2.2.17. Decreto 148 de 2020.\n       */\n      !!@ ili2db.dispName = "Rectificación de área por imprecisa determinación con efectos registrales"\n      Rectificacion_Area,\n      /** La rectificación de linderos en el sistema catastral y registral procederá de oficio o a solicitud de parte, ante el gestor catastral, siempre y cuando se haya suscrito acta de colindancia con pleno acuerdo entre los propietarios que compartan uno o varios linderos, pero se adviertan diferencias de linderos y áreas, entre la verificación mediante métodos directos y/o indirectos y la información del folio de matricula inmobiliaria. La rectificación de todos los linderos puede llevar a la certeza del área del inmueble. Artículo 2.2.2.2.17. Decreto 148 de 2020.\n       */\n      !!@ ili2db.dispName = "Rectificación de linderos por acuerdo entre las partes con efectos registrales"\n      Rectificacion_Linderos,\n      /** n los casos donde los folios de matrícula inmobiliaria no hayan contado con información de área y/o linderos, desde el inicio del ciclo traslaticio del bien\n       * inmueble que identifican; la Oficina de Registro de Instrumentos Públicos procederá la inclusión del dato de área y/o linderos en las respectivas matrículas inmobiliarias, que se tomará de la base catastral administrada por el gestor catastral competente.\n       */\n      !!@ ili2db.dispName = "Inclusión en el campo de cabida y linderos del dato del área y/o linderos en los folios de matrícula inmobiliaria"\n      Inclusion_Cabida_Linderos,\n      /** No requiere procedimiento catastral con efecto registral.\n       */\n      !!@ ili2db.dispName = "No requiere procedimiento"\n      No_Requiere\n    );\n\n    /** Conjunto de valores para indicar si se trata de un punto de control de referencia (un punto principal) o de apoyo (uso para levantamientos locales con estación total)\n     */\n    LC_PuntoControlTipo = (\n      /** Puntos en el terreno levantados por topografía o geodesia que sirven de base para la orientación absoluta en la restitución fotogramétrica, y para efectuar un tratamiento geométrico o geo-referenciación de los datos en teledetección.\n       */\n      !!@ ili2db.dispName = "Control"\n      Control,\n      /** Puntos en el terreno levantados por topografía o geodesia que sirven de base para la orientación absoluta en la restitución fotogramétrica, y para efectuar un tratamiento geométrico o geo-referenciación de los datos en teledetección.\n       */\n      !!@ ili2db.dispName = "Apoyo"\n      Apoyo\n    );\n\n    /** Punto de leventamiento planimetrico que se identifican en el marco de la identificación de las construcciones, los linderos o puntos auxiliares levantado para el apoyo en la mediciión\n     */\n    LC_PuntoLevTipo = (\n      /** Puntos de levantamiento para delimitar las construcción y unidades de construcción.\n       */\n      !!@ ili2db.dispName = "Construcción"\n      Construccion,\n      /** Puntos de levantamiento para las servidumbres de tránsito.\n       */\n      !!@ ili2db.dispName = "Servidumbre"\n      Servidumbre\n    );\n\n    LC_PuntoTipo = (\n      /** Punto referido a los soportes verticales que sirven de apoyo,utilizados en la construcción de alambradas, tendidos eléctricos y telefónicos, televisión por cable, para iluminar calles, plazas o estadios y en las actividades agrícolas.\n       */\n      !!@ ili2db.dispName = "Poste"\n      Poste,\n      /** Punto referido a las esquina o sección de los paramentos de las construcción y unidades de construcción.\n       */\n      !!@ ili2db.dispName = "Construcción"\n      Construccion,\n      /** Punto referido a los puntos limitantes con elementos hidrográficos que por su condición pueden variar su límite con el tiempo.\n       */\n      !!@ ili2db.dispName = "Punto dinámico"\n      Punto_Dinamico,\n      /** Punto referido a los elementos naturales de la vegetación  como los árboles, arbustos o cualquier otra especie de la fauna.\n       */\n      !!@ ili2db.dispName = "elemento natural"\n      Elemento_Natural,\n      /** Punto referido a los elementos piedra o rocas.\n       */\n      !!@ ili2db.dispName = "Piedra"\n      Piedra,\n      /** Puntos referido a las áreas de campos abiertos, zonas boscosas, desérticas o cualquier otro tipo de espacio donde no se aprecia una clara delimitación.\n       */\n      !!@ ili2db.dispName = "Sin materialización"\n      Sin_Materializacion,\n      /** Puntos referidos a los mojones utilizados en topografía que tienen datos de coordenadas espaciales.\n       */\n      !!@ ili2db.dispName = "Mojón"\n      Mojon,\n      /** Puntos referidos a las incrustaciones realizadas en el suelo.\n       */\n      !!@ ili2db.dispName = "Incrustación"\n      Incrustacion,\n      /** Puntos referidos a las columnas verticales donde se encuentra materializado un punto con coordenadas espaciales.\n       */\n      !!@ ili2db.dispName = "Pilastra"\n      Pilastra\n    );\n\n    LC_RelacionPredioTipo = (\n      /** Parte interesada (Propietario, Poseedor, Ocupante)\n       */\n      !!@ ili2db.dispName = "Parte interesada (Propietario, Poseedor, Ocupante)"\n      Parte_Interesada,\n      /** Indica si un vecino de la parte interesada (propietario, poseedor u ocupante) fue el encargado de atender la visita predial.\n       */\n      !!@ ili2db.dispName = "Vecino"\n      Vecino,\n      /** Indica si un familiar de la parte interesada (propietario, poseedor u ocupante) fue el encargado de atender la visita predial.\n       */\n      !!@ ili2db.dispName = "Familiar"\n      Familiar,\n      /** Indica si el arrendatario o alguna persona de su núcleo familiar fue el encargado de atender la visita predial.\n       */\n      !!@ ili2db.dispName = "Arrendatario"\n      Arrendatario,\n      /** Indica si el administrador o alguna persona de su núcleo familiar fue el encargado de atender la visita predial.\n       */\n      !!@ ili2db.dispName = "Administrador"\n      Administrador\n    );\n\n    LC_RestriccionTipo = (\n      /** Es la agrupación de códigos registrales que hacen referencia a servidumbres:\n       * \n       * 0325\n       * 0334\n       * 0335\n       * 0336\n       * 0337\n       * 0338\n       * 0339\n       * 0340\n       * 0341\n       * 0342\n       * 0343\n       * 0344\n       * 0350\n       * 0351\n       * 0354\n       * 0358\n       * 0373\n       * 0381\n       */\n      !!@ ili2db.dispName = "Servidumbre de paso"\n      Servidumbre(\n        /** Se trata de predio sirviente que sufre el gravamen para permitir la comunicación uso y bienestar de otro predio. (Artículo 905 del C.C.)\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Tránsito"\n        Transito,\n        /** Es el gravamen impuesto sobre un predio para permitir la salida de las aguas sobrantes de otro predio. (Art. 928 del C.C.).\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Aguas negras"\n        Aguas_Negras,\n        /** Permite realizar y mantener las obras necesarias para la eficiencia y segura ventilación. Las empresas de servicios públicos podrán pasar por predios ajenos por vía aérea y realizar en ellos las actividades necesarias para prestar el servicio. (Artículo 215 del Decreto 1275 de 1970, artículo 57 de la Ley 142 de 1994).\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Aire"\n        Aire,\n        /** Supone para las entidades públicas que tienen a su cargo la construcción de centrales generadoras, líneas de interconexión, transmisión y prestación del servicio público de distribución de energía eléctrica, la facultad de pasar por los predios afectados, por vía aérea, subterránea o superficial, las líneas de transmisión y distribución del fluido eléctrico, ocupar las zonas objeto de servidumbre, transitar por los mismos, adelantar las obras, ejercer la vigilancia, conservación y mantenimiento y emplear los demás medios necesarios para su ejercicio. (Artículo 18 de la Ley 126 de 1938 y Artículo 25 de la Ley 56 de 1981). (Artículo 57 de la Ley 142 de 1994).\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Energía eléctrica"\n        Energia_Electrica,\n        /** Es el conjunto de actividades ordenadas a la distribución de gas combustible, por tubería u otro medio, desde un sitio de acopio de grandes volúmenes o desde un gasoducto central hasta la instalación de un consumidor final, incluyendo su conexión y medición. \n         *  Se constituye la servidumbre a favor de la explotación de los gases derivados del petróleo.\n         *  Cuando sea necesario las empresas que prestan el servicio podrán pasar por predios ajenos por vía subterránea o superficial los cables o tuberías, ocupar temporalmente las zonas que requieren esos predios, remover los cultivos y obstáculos de toda clase que se encuentren en ellos, transitar, adelantar las obras y ejercer vigilancia en ellos y en general realizar todas las actividades necesarias para prestar el servicio.\n         *  Las líneas de distribución de gas combustible, podrán atravesar los ríos, caudales, líneas férreas, puentes, calles, caminos, y cruzar acueductos, oleoductos, y otras líneas o conducciones. (Art. 14 númeral 28, y artículo 57 de la Ley 142 de 1994).\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Gasoducto"\n        Gasoducto,\n        /** Tiene por objeto dar luz a un espacio cualquiera, cerrado y techado. \n         * Se llama predio sirviente el que debe permitir el paso de la luz y predio dominante el que tiene derecho a ella. (Artículos 931 al 935 del Código Civil).\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Luz"\n        Luz,\n        /** Se constituye a favor de la explotación de petróleo, comprendiendo el terreno suficiente para las estaciones de bombeo y demás dependencias necesarias para el funcionamiento de los oleoductos y el de establecer muelles, cargaderos y tuberías submarinas y fluviales. (Artículo 9 Decreto 1056 de 1954).\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Oleoducto"\n        Oleoducto,\n        /** El predio inferior está sujeto a recibir las aguas que descienden del predio superior naturalmente, es decir, sin que la mano del hombre contribuya a ello. No se puede, por consiguiente, dirigir un albañal o acequia sobre el predio vecino, si no se ha constituido esta servidumbre especial. En el predio servil no se puede hacer cosa alguna que estorbe la servidumbre natural, ni el predio dominante, que la grave.\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Agua"\n        Agua,\n        /** Para el ejercicio eficiente de la industria minera en todas sus fases y etapas, podrán establecerse las servidumbres que sean necesarias sobre los predios ubicados dentro o fuera del área objeto del título minero. Cuando, para la construcción, el montaje, la explotación, el acopio y el beneficio, en ejercicio de las servidumbres se requiera usar recursos naturales renovables, será indispensable que dicho uso esté autorizado por la autoridad ambiental, cuando la ley así lo exija. También procede el establecimiento de servidumbre sobre zonas, objeto de otros títulos mineros. Tales gravámenes no podrán impedir o dificultar la exploración o la explotación de la concesión que los soporte. (Art 166 Ley 685 de 2001)\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Minera"\n        Minera,\n        /** La industria de los hidrocarburos está declarada de utilidad pública en sus ramos de exploración, producción, transporte, refinación y distribución. Los predios deberán soportar todas las servidumbres legales que sean necesarias para realizar las actividades de exploración, producción y transporte de los hidrocarburos, salvo las excepciones establecidas por la ley. Se entenderá que la servidumbre de ocupación de terrenos comprenderá el derecho a construir la infraestructura necesaria en campo e instalar todas las obras y servicios propios para beneficio del recurso de los hidrocarburos y del ejercicio de las demás servidumbres que se requieran. (Art. 1 Ley 1274 de 2009)\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Legal de hidrocarburos"\n        Legal_Hidrocarburos,\n        /** Es el conjunto de derechos y obligaciones que dimanan de la existencia y disfrute en común de una pared, cerca, vallado, etc. \n         * En todos los casos, y aun cuando conste que una cerca o pared divisoria pertenece exclusivamente a uno de los predios contiguos, el dueño del otro predio tendrá el derecho de hacer la medianería en todo o en parte, aun sin el consentimiento de su vecino, pagándole la mitad del valor del terreno en que está hecho el cerramiento, y la mitad del valor actual de la porción del cerramiento cuya medianería pretende. (Artículo 912 del C.C.).\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Medianeria"\n        Medianeria,\n        /** Gravamen que afecta un predio, permitiendo que sobre el se conduzcan el alcantarillado que benefician a otro predio de diferente propietario.\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Alcantarillado"\n        Alcantarillado,\n        /** Gravamen que afecta un predio, permitiendo que sobre el se conduzcan las aguas que benefician a otro predio de diferente propietario. (Artículos 919 a 930 del Código Civil; Artículo 214 del Decreto 1275 de 1970. Artículo 57 de la Ley 142 de 1998).\n         */\n        !!@ ili2db.dispName = "(Servidumbre) Acueducto"\n        Acueducto\n      )\n    );\n\n    LC_ResultadoVisitaTipo = (\n      /** Tuvo acceso total al predio\n       */\n      !!@ ili2db.dispName = "Exitoso"\n      Exitoso,\n      /** Tuvo acceso parcial al predio.\n       */\n      !!@ ili2db.dispName = "Incompleto"\n      Incompleto,\n      /** Sin atención por parte de personas. Predio Desocupado.\n       */\n      !!@ ili2db.dispName = "No hay nadie"\n      No_hay_nadie,\n      /** No permitieron acceso al predio.\n       */\n      !!@ ili2db.dispName = "No permitieron acceso"\n      No_permitieron_acceso,\n      /** No hay adulto en el momento de la visita.\n       */\n      !!@ ili2db.dispName = "Menor de Edad"\n      Menor_de_Edad,\n      /** Por temas de seguridad asociados a orden público no es posible el acceso.\n       */\n      !!@ ili2db.dispName = "Situación de Orden Público"\n      Situacion_de_Orden_Publico,\n      /** Por limitaciones relacionadas con la topografía o accidentes geográficos no hubo acceso al predio.\n       */\n      !!@ ili2db.dispName = "Zona de difícil acceso"\n      Zona_de_dificil_acceso,\n      /** Otros casos no relacionados anteriormente.\n       */\n      !!@ ili2db.dispName = "Otro"\n      Otro\n    );\n\n    LC_SexoTipo = (\n      /** Que tiene órganos para fecundar\n       */\n      !!@ ili2db.dispName = "Masculino"\n      Masculino,\n      /** Que tiene órganos para ser fecundado.\n       */\n      !!@ ili2db.dispName = "Femenino"\n      Femenino\n    );\n\n    LC_TipologiaTipo = (\n      Residencial(\n        /** Armazón: Madera; Muro: Material de desecho, esterilla; Cubierta material desecho, telas asfálticas; Pisos tierra pisada.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 1A"\n        Tipo_1A,\n        /** Armazón: Madera; Muro: Material de bahareque, adobe, tapia; Cubierta: Zinc, teja de barro, Eternit rustico; Pisos: Cemento, madera burda\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 1B"\n        Tipo_1B,\n        /** Armazón: Madera; Muros en madera; Cubierta: Zinc, teja de barro, Eternit rustico; Cubrimiento de Muros: Pañete, papel común, ladrillo presado; Pisos: Cemento, madera burda.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 2A"\n        Tipo_2A,\n        /** Armazón: Prefabricado; Muros: Concreto prefabricado; Cubierta: Zinc, teja de barro, Eternit rustico; cubrimiento de Muros: Pañete, papel común,  ladrillo  presado;  Pisos:  Baldosa común de cemento, Tablón ladrillo.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 2B"\n        Tipo_2B,\n        /** Armazón: Ladrillo, bloque; Muro: ladrillo, Bloque; Cubierta: Eternit o teja de barro; Cubrimiento de muros: Pañete, papel común, ladrillo prensado; Piso: Baldosa común de cemento, tablón ladrillo.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 3A"\n        Tipo_3A,\n        /** Armazón: Ladrillo, bloque; Muro: ladrillo, Bloque; Cubierta: Azotea, aluminio, placa sencilla con eternit o teja de barro; Cubrimiento muros: Estuco, cerámica, papel fino; Piso: Baldosa común de cemento, tablón ladrillo.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 3B"\n        Tipo_3B,\n        /** Armazón: Concreto hasta tres pisos, Muro: Bloque, ladrillo; Cubierta: Azotea, aluminio,\n         * placa sencilla con etnernit o teja de barro; Cubrimiento muro: estuco, cerámica, papel fino; Piso: Listón machi-embredo.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 4A"\n        Tipo_4A,\n        /** Armazón: Concreto hasta tres pisos, Muro: Bloque, Ladrillo; Cubierta: Azotea, aluminio,\n         * placa sencilla con etnernit o teja de barro; Cubrimiento muro: estuco, cerámica, papel fino; Piso: Tableta, caucho, acrilico, granito, baldosa fina.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 4B"\n        Tipo_4B,\n        /** Armazón: Concreto hasta tres pisos; Muro: Bloque, Ladrillo; Cubierta: Azote, Aluminio, placa sencilla con eternit o teja de barro; Cubrimiento muro: Medra, Piedra ornamental; Piso: Tableta, caucho, acrilico, granito, baldosa fina\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 5A"\n        Tipo_5A,\n        /** Armazón: Concreto cuadro y más pisos; Muro: Bloque, Ladrillo; Cubierta: Placa impermeabilizada cubierta lujosa u ornamental; Cubrimiento muro: Mármol, lujoso, otros; Piso: Parquet, alfombra, retal de mármol ( grano pequeño).\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 5B"\n        Tipo_5B,\n        /** Armazón: Concreto hasta tres pisos; Muro: Bloque, ladrillo; Cubierta: Placa impermeabilizada cubierta lujosa u ornamental; Cubrimientos muros: Mármol, lujosos otros; Piso: Parquet, alfombra, Retal de mármol ( grano pequeño).\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 6A"\n        Tipo_6A,\n        /** Armazón: Concreto cuatro o más pisos; Muro: Bloque, ladrillo; Cubierta: Placa impermeabilizada cubierta lujosa u ornamental; Cubrimientos muros: Mármol, lujosos otros; Piso: Retal de mármol, mármol, otros.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 6B"\n        Tipo_6B\n      ),\n      Comercial(\n        /** Armazón: Madera, prefabricado\n         * Muros: adobe, bahareque, tapia\n         * Cubierta: Zinc, material de desecho, telas asfálticas\n         * Fachada: Pobre\n         * Cubrimiento de Muros: Sin cubrimiento\n         * Pisos: tierra, cemento o madera burda.\n         */\n        !!@ ili2db.dispName = "(Comercial) Barrial 1"\n        Barrial_1,\n        /** Armazón: Ladrillo, bloque.\n         * Muros: Ladrillo y Bloque\n         * Cubierta: Zinc, Eternit o teja de barro\n         * Fachada: pobre o sencilla.\n         * Cubrimiento de Muros: Pañete, papel común, ladrillo prensado, estuco, cerámica\n         * Pisos: cemento Baldosa común de cemento, Tablón Ladrillo\n         */\n        !!@ ili2db.dispName = "(Comercial) Barrial 2"\n        Barrial_2,\n        /** Armazón: Madera, Ladrilló, Bloque\n         * Muros: Madera, Bloque, concreto prefabricado\n         * Cubierta: Eternit o teja de barro, Entrepiso, (cubierta provisional) Prefabricado\n         * \n         * Fachada: Regular.\n         * Cubrimiento de Muros: Pañete, papel común, pañete, ladrillo prensado\n         * Pisos: Concreto, Listón machi-ambrado, baldosa común.\n         */\n        !!@ ili2db.dispName = "(Comercial) Sectorial 1"\n        Sectorial_1,\n        /** Armazón: Concreto hasta 3 pisos.\n         * Muros: Bloque, ladrillo\n         * Cubierta: Eternit, teja de barro placa concreto\n         * Fachada: Buena.\n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, cerámica, papel fino\n         * \n         * Pisos: Tableta, caucho, acrílico, granito, baldosa fina\n         */\n        !!@ ili2db.dispName = "(Comercial) Sectorial 2"\n        Sectorial_2,\n        /** Armazón: Concreto hasta 3 pisos\n         * Muros: Concreto prefabricado, bloque o ladrillo\n         * Cubierta: Azotea, aluminio, placa sencilla con eternit o teja de barro\n         * Fachada: Buena.\n         * \n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, Madera, piedra ornamental\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\n         */\n        !!@ ili2db.dispName = "(Comercial) Especializado 1"\n        Especializado_1,\n        /** Armazón: Concreto 4 o más pisos\n         * Muros: Bloque ladrillo\n         * Cubierta: Placa Impermeabilizada cubierta lujosa u ornamental\n         * Fachada: Lujosa.\n         * Cubrimiento de Muros: Mármol, piedra ornamental Estucos especiales, otros lujosos\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\n         */\n        !!@ ili2db.dispName = "(Comercial) Especializado 2"\n        Especializado_2\n      ),\n      Industrial(\n        /** Armazón: Madera, prefabricado\n         * Muros: adobe, bahareque, tapia\n         * Cerchas: Madera\n         * Cubierta: Material de desecho, telas asfálticas\n         * \n         * Fachada: Pobre\n         * Cubrimiento de Muros:\n         * Sin cubrimiento\n         * Pisos: tierra, cemento o madera burda.\n         */\n        !!@ ili2db.dispName = "(Industrial) Liviana 1"\n        Liviana_1,\n        /** Armazón: Prefabricado, Ladrillo, bloque.\n         * Muros: Prefabricado, Ladrillo, bloque\n         * Cubierta: Zinc, Eternit o teja de barro\n         * Fachada: pobre o sencilla.\n         * \n         * Cubrimiento de Muros: Sin, Pañete, papel común, ladrillo prensado, estuco, cerámica\n         * Pisos: Cemento Baldosa común de cemento, Tablón Ladrillo.\n         */\n        !!@ ili2db.dispName = "(Industrial) Liviana 2"\n        Liviana_2,\n        /** Armazón: Muros confinados Ladrillo o bloque\n         * Muros: Ladrillo, bloque o concreto prefabricado\n         * Cubierta: Entrepiso\n         * (cubierta provisional ) Prefabricado, teja eternit\n         * Fachada: Regular.\n         * \n         * Cubrimiento de Muros: Pañete, papel común, pañete, ladrillo prensado\n         * Pisos: Concreto, Listón machi-ambrado, baldosa común.\n         */\n        !!@ ili2db.dispName = "(Industrial) Mediana 1"\n        Mediana_1,\n        /** Armazón: Concreto hasta 3 pisos.\n         * Muros: Bloque, ladrillo\n         * Cubierta: teja eternit, termo acústica o teja de barro\n         * Fachada: Buena.\n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, cerámica, papel fino\n         * Pisos: Tableta, caucho, acrílico, granito, baldosa fina\n         */\n        !!@ ili2db.dispName = "(Industrial) Mediana 2"\n        Mediana_2,\n        /** Armazón: Concreto hasta 3 pisos\n         * Muros: Concreto prefabricado, bloque o ladrillo\n         * Cubierta: Azotea, aluminio, placa sencilla con eternit o teja de barro\n         * Fachada: Buena.\n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, Madera, piedra ornamental\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\n         */\n        !!@ ili2db.dispName = "(Industrial) Pesada 1"\n        Pesada_1,\n        /** Armazón: Concreto 4 o más pisos\n         * Muros: Bloque ladrillo\n         * Cubierta: Placa Impermeabilizada cubierta lujosa u ornamental\n         * Fachada: Lujosa.\n         * Cubrimiento de Muros: Mármol, piedra ornamental Estucos especiales, otros lujosos\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\n         */\n        !!@ ili2db.dispName = "(Industrial) Pesada 2"\n        Pesada_2\n      ),\n      !!@ ili2db.dispName = "Otro"\n      Otro\n    );\n\n    /** Valores válidos para indicar el tipo de construcción empleada para levantar una unidad de construcción, con incidencia en su avalúo. REVISAR DOCUMENTACIÓN\n     */\n    LC_UnidadConstruccionTipo = (\n      /** Tipo de unidad de construcción en uso para vivienda.\n       */\n      !!@ ili2db.dispName = "Residencial"\n      Residencial,\n      /** Tipo de unidad de construcción en uso de actividades comerciales.\n       */\n      !!@ ili2db.dispName = "Comercial"\n      Comercial,\n      /** Tipo de unidad de construcción en uso de actividades industriales.\n       */\n      !!@ ili2db.dispName = "Industrial"\n      Industrial,\n      /** Tipo de unidad de construcción en uso de actividades institucionales.\n       */\n      !!@ ili2db.dispName = "Institucional"\n      Institucional,\n      /** Tipo de unidad de construcción anexa, por ejemplo, piscinas, cobertizos, canchas de tenis, toboganes.\n       */\n      !!@ ili2db.dispName = "Anexo"\n      Anexo\n    );\n\n    LC_UsoUConsTipo = (\n      !!@ ili2db.dispName = "Residencial"\n      Residencial(\n        /** Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos sometido en régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Residencial) Apartamentos 4 y más pisos en PH"\n        Apartamentos_4_y_mas_pisos_en_PH,\n        /** Es una vivienda que comprende una o más habitaciones, en un edificio de 4 o 5 pisos.\n         */\n        !!@ ili2db.dispName = "(Residencial) Apartamentos en Edificio de 4 y 5 Pisos (Cartagena)"\n        Apartamentos_En_Edificio_4_y_5_Pisos_Cartagena,\n        /** Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos\n         */\n        !!@ ili2db.dispName = "(Residencial) Apartamentos mas de 4 Pisos"\n        Apartamentos_Mas_De_4_Pisos,\n        /** Dormitorios de las fuerzas armadas y militares\n         */\n        !!@ ili2db.dispName = "(Residencial) Barracas"\n        Barracas,\n        /** Típica casa con mampostería de piedra, pizarra y madera. Ha sido rehabilitada respetando escrupulosamente sus características exteriores y decorada con un interior tradicional\n         */\n        !!@ ili2db.dispName = "(Residencial) Casa Elbas"\n        Casa_Elbas,\n        /** Edificación destinada al almacenamiento o resguardo de enceres, generalmente ubicados en los sótanos y semisótanos de los edificios, junto a los parqueaderos. Las áreas de estos depósitos generalmente no supera los 25 metros cuadrados.\n         */\n        !!@ ili2db.dispName = "(Residencial) Depósitos o lockers"\n        Depositos_Lockers,\n        /** Es el lugar cubierto, destinado al estacionamiento privado de vehículos.\n         */\n        !!@ ili2db.dispName = "(Residencial) Garajes Cubiertos"\n        Garajes_Cubiertos,\n        /** Es el lugar cubierto, destinado al estacionamiento privado o comunal en viviendas sometidas a régimen de propiedad  horizontal.\n         */\n        !!@ ili2db.dispName = "(Residencial) Garajes en PH"\n        Garajes_En_PH,\n        /** Los salones comunales son dependencias que se construyen dentro de los edificios y conjuntos que sobrepasan un área determinada de construcción, y se clasifican de acuerdo a las normas urbanísticas como equipamiento comunal privado.\n         */\n        !!@ ili2db.dispName = "(Residencial) Salón comunal"\n        Salon_Comunal,\n        /** Bien inmueble cubierto o descubierto ubicado en el último piso de algunos edificios utilizado para extender y secar la ropa y que está sometido a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Residencial) Secadero de ropa"\n        Secadero_Ropa,\n        /** Son las viviendas construidas durante el tiempo de la colonia española, se caracterizan por tener varias habitaciones, con ventanales que dan a uno o dos patios generalmente ubicados en el centro de la vivienda. Los principales materiales de la época era la tapia, bahareque, ladrillo, paja y teja.\n         */\n        !!@ ili2db.dispName = "(Residencial) Vivienda Colonial"\n        Vivienda_Colonial,\n        /** Es una casa de tres niveles cuya función arquitectónica y ambiental principal, es dar albergue en forma adecuada a una familia.\n         */\n        !!@ ili2db.dispName = "(Residencial) Vivienda hasta 3 pisos"\n        Vivienda_Hasta_3_Pisos,\n        /** Corresponde a edificaciones residenciales desarrolladas sobre un lote de terreno que comprende más de tres unidades prediales independientes, generalmente en edificios de varios pisos. Este tipo de vivienda prevé? áreas de servicios comunales cuya propiedad y utilización privada se definen en reglamentos de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Residencial) Vivienda hasta 3 pisos en PH"\n        Vivienda_Hasta_3_Pisos_En_PH,\n        /** Es una vivienda acondicionada para la realización de actividades recreativas libres y el descanso.\n         */\n        !!@ ili2db.dispName = "(Residencial) Vivienda Recreacional"\n        Vivienda_Recreacional,\n        /** Es una casa cuya función arquitectónica y ambiental principal, es brindar descanso y recreación. Este tipo de vivienda  prevé? áreas de servicios comunales cuya propiedad y utilización privada se definen en reglamentos de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Residencial) Vivienda Recreacional en PH"\n        Vivienda_Recreacional_En_PH\n      ),\n      !!@ ili2db.dispName = "Comercial"\n      Comercial(\n        /** Es el espacio construido para la ejecución la recepción, almacenamiento y movimientos de materiales, materias primas y productos semielaborados, hasta el punto de consumo por un cliente externo o interno\n         */\n        !!@ ili2db.dispName = "(Comercial) Bodegas Comerciales - Grandes Almacenes"\n        Bodegas_Comerciales_Grandes_Almacenes,\n        /** Es el espacio construido para la ejecución la recepción, almacenamiento y movimientos de materiales, materias primas y productos semielaborados, hasta el punto de consumo por un cliente externo o interno sometido a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Comercial) Bodegas Comerciales en PH"\n        Bodegas_Comerciales_en_PH,\n        /** es una construcción que consta de uno o varios edificios, por lo general de gran tamaño, que albergan servicios, locales y oficinas comerciales aglutinados en un espacio determinado concentrando mayor cantidad de clientes potenciales dentro del recinto.\n         */\n        !!@ ili2db.dispName = "(Comercial) Centros Comerciales"\n        Centros_Comerciales,\n        /** Es una construcción que consta de uno o varios edificios, por lo general de gran tamaño, que albergan servicios, locales y oficinas comerciales aglutinados en un espacio determinado concentrando mayor cantidad de clientes potenciales dentro del recinto, sometido a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Comercial) Centros Comerciales en PH"\n        Centros_Comerciales_en_PH,\n        /** Es la edificación o  Establecimiento que brinda servicios recreativos y tiene capacidad para ciertos juegos de azar\n         */\n        !!@ ili2db.dispName = "(Comercial) Clubes - Casinos"\n        Clubes_Casinos,\n        /** Se denomina a la construcción en la cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes\n         */\n        !!@ ili2db.dispName = "(Comercial) Comercio"\n        Comercio,\n        /** Se denomina a la construcción con características arquitectónicas coloniales,  en el cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes\n         */\n        !!@ ili2db.dispName = "(Comercial) Comercio Colonial"\n        Comercio_Colonial,\n        /** Se denomina a la construcción en la cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes sometida a régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Comercial) Comercio en PH"\n        Comercio_en_PH,\n        /** Establecimiento que ocupa un edificio total o parcialmente con uso exclusivo de sus servicios (entradas, ascensores, escaleras, etc.) y que ofrece alojamiento y posee características arquitectónicas coloniales.\n         */\n        !!@ ili2db.dispName = "(Comercial) Hotel Colonial"\n        Hotel_Colonial,\n        /** Establecimiento que ocupa un edificio total o parcialmente con uso exclusivo de sus servicios (entradas, ascensores, escaleras, etc.) y que ofrece alojamiento\n         */\n        !!@ ili2db.dispName = "(Comercial) Hoteles"\n        Hoteles,\n        /** Establecimiento que ocupa un edificio total o parcialmente que ofrece alojamiento\n         */\n        !!@ ili2db.dispName = "(Comercial) Hoteles en PH"\n        Hoteles_en_PH,\n        /** Espacio construido en el que se  realiza un trabajo profesional de gestión, administración o atención médica\n         */\n        !!@ ili2db.dispName = "(Comercial) Oficinas - Consultorios"\n        Oficinas_Consultorios,\n        /** Espacio construido con características arquitectónicas coloniales en el que se  realiza un trabajo profesional de gestión, administración o atención médica\n         */\n        !!@ ili2db.dispName = "(Comercial) Oficinas - Consultorios Coloniales"\n        Oficinas_Consultorios_Coloniales,\n        /** espacio construido en el que se  realiza un trabajo profesional de gestión, administración o atención médica, sometida a régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Comercial) Oficinas Consultorios en PH"\n        Oficinas_Consultorios_en_PH,\n        /** Construcciones dedicadas al esparcimiento y a la diversión, generalmente son predios con grandes espacios, ejemplo parque el salitre.\n         */\n        !!@ ili2db.dispName = "(Comercial) Parque de diversiones"\n        Parque_Diversiones,\n        /** Es el espacio que con ánimo de lucro se destina a guardar o arrendar espacios para depositar vehículos dentro de una edificación construida para tal fin, o dentro de un predio habilitado con el mismo objeto.\n         */\n        !!@ ili2db.dispName = "(Comercial) Parqueaderos"\n        Parqueaderos,\n        /** Es el espacio o se destina a guardar o arrendar espacios para depositar vehículos dentro de una edificación construida privado o comunal bajo régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Comercial) Parqueaderos en PH"\n        Parqueaderos_en_PH,\n        /** Vivienda que proporciona alojamiento y hospedaje temporal\n         */\n        !!@ ili2db.dispName = "(Comercial) Pensiones y Residencias"\n        Pensiones_y_Residencias,\n        /** Edificaciones tipo bodega destinadas a la prestacion de un servicio público, como es la oferta de productos básicos, principalmente de origen agropecuario y consumo doméstico\n         */\n        !!@ ili2db.dispName = "(Comercial) Plaza de mercado"\n        Plaza_Mercado,\n        /** Establecimiento con características arquitectónicas coloniales en el que se preparan y sirven comidas.\n         */\n        !!@ ili2db.dispName = "(Comercial) Restaurante Colonial"\n        Restaurante_Colonial,\n        /** Establecimiento en el que se preparan y sirven comidas.\n         */\n        !!@ ili2db.dispName = "(Comercial) Restaurantes"\n        Restaurantes,\n        /** Establecimiento en el que se preparan y sirven comidas sometido a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Comercial) Restaurantes en PH"\n        Restaurantes_en_PH,\n        /** Edificación destinada a la proyección de películas cinematográfica o la presentación de obras artísticas actorales o musicales.\n         */\n        !!@ ili2db.dispName = "(Comercial) Teatro - Cinemas"\n        Teatro_Cinemas,\n        /** Establecimiento destinado a la proyección de películas cinematográficas sometida o la presentación de obras artísticas actores o musicales en un predio sometido en régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Comercial) Teatro - Cinemas en PH"\n        Teatro_Cinemas_en_PH\n      ),\n      !!@ ili2db.dispName = "Industrial"\n      Industrial(\n        /** Infraestructura de bombeo.\n         */\n        !!@ ili2db.dispName = "(Industrial) Bodega Casa Bomba"\n        Bodega_Casa_Bomba,\n        /** Infraestructura de bombeo de bodegas sometidas a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Industrial) Bodegas Casa Bomba en PH"\n        Bodegas_Casa_Bomba_en_PH,\n        /** Conjunto de instalaciones dedicadas a esta actividad de transformar las materias primas en productos elaborados\n         */\n        !!@ ili2db.dispName = "(Industrial) Industrias"\n        Industrias,\n        /** Conjunto de instalaciones sometidas a régimen de propiedad horizontal dedicadas a la actividad de transformar las materias primas en productos elaborados\n         */\n        !!@ ili2db.dispName = "(Industrial) Industrias en PH"\n        Industrias_en_PH,\n        /** Es el espacio construido en el que se realiza un trabajo, manual en su origen, bien de tipo artesanal o fabril.\n         */\n        !!@ ili2db.dispName = "(Industrial) Talleres"\n        Talleres\n      ),\n      !!@ ili2db.dispName = "Institucional"\n      Institucional(\n        /** Es un salón de un edificio que se destina a actividades de enseñanza, y es la unidad básica de todo recinto destinado a la educación.\n         */\n        !!@ ili2db.dispName = "(Institucional) Aula de clases"\n        Aulas_de_Clases,\n        /** Edificación donde podemos encontrar libros o cualquier otro soporte de un texto, como publicaciones, revistas, documentos, catálogo entre otros.\n         */\n        !!@ ili2db.dispName = "(Institucional) Biblioteca"\n        Biblioteca,\n        /** Son instalaciones en las que se encarcela a los prisioneros, se encuentran bajo la autoridad del estado.\n         */\n        !!@ ili2db.dispName = "(Institucional) Cárceles"\n        Carceles,\n        /** Lugar sin altar (diferente a iglesias y capillas) que congrega a un determinado número de personas para actividades de culto asociadas con manifestaciones religiosas.\n         */\n        !!@ ili2db.dispName = "(Institucional) Casas de culto"\n        Casas_de_Culto,\n        /** Establecimiento construido y destinado a proporcionar todo tipo de asistencia médica, incluidas operaciones quirúrgicas y estancia durante la recuperación o tratamiento, y en el que también se practican la investigación y la enseñanza médica\n         */\n        !!@ ili2db.dispName = "(Institucional) Clinicas, hospitales, centros médicos"\n        Clinicas_Hospitales_Centros_Medicos,\n        /** Institución edificada destinada a la enseñanza primaria, secundaria y universitaria\n         */\n        !!@ ili2db.dispName = "(Institucional) Colegios y universidades"\n        Colegio_y_Universidades,\n        /** Teatro o edificio destinado a espectáculos con capacidad para un gran número de personas.\n         */\n        !!@ ili2db.dispName = "(Institucional) Coliseos"\n        Coliseos,\n        /** Institución edificada construcción con características arquitectónicas coloniales destinada a la enseñanza primaria\n         */\n        !!@ ili2db.dispName = "(Institucional) Entidad educativa colonial colegio colonial"\n        Entidad_Educativa_Colonial_Colegio_Colonial,\n        /** Un estadio es una construcción cerrada con graderías para los espectadores, destinado a competiciones deportivas. Puede ser al aire libre o cubierto.\n         */\n        !!@ ili2db.dispName = "(Institucional) Estadios"\n        Estadios,\n        /** Lugar construido  fuerte, cercado de murallas, baluartes, fosos y otras fortificaciones.\n         */\n        !!@ ili2db.dispName = "(Anexo) Fuertes y Castillos"\n        Fuertes_y_Castillos,\n        /** Edificación en la que se reúnen y consagran a los fieles que le rinden culto a un ser superior\n         */\n        !!@ ili2db.dispName = "(Institucional) Iglesia"\n        Iglesia,\n        /** Edificación en la que se reúnen y consagran a los fieles que le rinden culto a un ser superior sometido a régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Institucional) Iglesia en PH"\n        Iglesia_en_PH,\n        /** Construcciones adaptadas o utilizadas por los organismos de seguridad de una nación para acuartelar a las tropas y sus equipos. Estas son organizadas de una forma tal que les facilite cumplir con la rutina diaria de los cuerpos militares, desde dormitorios, patios de ejercicios, estacionamientos para los vehículos, parques, comedores, oficinas y son fortificadas a fin de presentar resistencia al momento de un posible ataque externo.\n         */\n        !!@ ili2db.dispName = "(Institucional) Instalaciones militares"\n        Instalaciones_Militares,\n        /** Construcción con características de una vivienda que se encarga de brindar educación y asistencia integral a los niños\n         */\n        !!@ ili2db.dispName = "(Institucional) Jardín infantil en casa"\n        Jardin_Infantil_en_Casa,\n        /** Es un terreno que está destinado a árboles, jardines y prados donde se depositan los restos mortales o cadáveres.\n         */\n        !!@ ili2db.dispName = "(Institucional) Parque Cementerio"\n        Parque_Cementerio,\n        /** Centro cultural donde se realizan presentaciones astronómicas al público en general.\n         */\n        !!@ ili2db.dispName = "(Institucional) Planetario"\n        Planetario,\n        /** Son recintos cerrados, generalmente circulares y descubiertos, donde se celebran las corridas de toros.\n         */\n        !!@ ili2db.dispName = "(Institucional) Plaza de toros"\n        Plaza_de_Toros,\n        /** Edificio donde se atiende a la población en un primer nivel asistencial sanitario.\n         */\n        !!@ ili2db.dispName = "(Institucional) Puestos de salud"\n        Puestos_de_Salud,\n        /** Construcciones, oficiales o privadas, destinadas a salvaguardar obras de arte, reliquias o antigüedades de carácter histórico, religioso o científico, que representan un periodo, una época de la humanidad o del país.\n         */\n        !!@ ili2db.dispName = "(Institucional) Museos"\n        Museos,\n        /** Edificación donde habitan congregaciones religiosas de distintas órdenes menticantes en el itinerario de formación o consagración religiosa.\n         */\n        !!@ ili2db.dispName = "(Institucional) Seminarios, conventos"\n        Seminarios_Conventos,\n        /** Edificio o sala destinados a la representación de obras de teatro o de otro tipo de espectáculos, que dispone de un escenario y gradas o asientos para el público, se caracterizan por sus condiciones arquitectónicas\n         */\n        !!@ ili2db.dispName = "(Institucional) Teatro"\n        Teatro,\n        /** Escenario deportivo destinado a la práctica de distintas disciplinas deportivas.\n         */\n        !!@ ili2db.dispName = "(Institucional) Unidad deportiva"\n        Unidad_Deportiva,\n        /** Instalación deportiva donde se desarrollan carreras ciclistas o de patinaje.\n         */\n        !!@ ili2db.dispName = "(Institucional) Velódromo, patinódromo"\n        Velodromo_Patinodromo\n      ),\n      !!@ ili2db.dispName = "Anexo"\n      Anexo(\n        /** Depósito de agua construido a nivel del terreno con el propósito de almacenar agua, o en el caso de las bañadera con el fin de hacer limpieza al ganado, estas construcciones son cubiertas para guardar de la intemperie.\n         */\n        !!@ ili2db.dispName = "(Anexo) Albercas - Banaderas"\n        Albercas_Banaderas,\n        /** Nombre dado en zonas cafeteras a aquellas construcciones donde realizan el beneficio del café. Consiste en áreas cubiertas dentro de las cuales se encuentran los elementos destinados a la labor de seleccionar, lavar y despulpar el grano y su posterior empaque\n         */\n        !!@ ili2db.dispName = "(Anexo) Beneficiaderos"\n        Beneficiaderos,\n        /** Construcción para el desarrollo de proyectos acuícolas del cultivo de camarones.\n         */\n        !!@ ili2db.dispName = "(Anexo) Camaroneras"\n        Camaroneras,\n        /** Superficie de terreno adecuada sobre un placa para la practica de deportes como fútbol de salón, voleibol, balocento u alguna otra disciplina que haga uso de la cancha, todo ello a pequeña escala. Se excluyen las canchas de tenis, los estadios, coliseo u otras edificaciones de gran tamaño.\n         */\n        !!@ ili2db.dispName = "(Anexo) Canchas"\n        Canchas,\n        /** Superficie  terreno rectangular cruzada al medio por una red baja.\n         */\n        !!@ ili2db.dispName = "(Anexo) Canchas de Tenis"\n        Canchas_de_Tenis,\n        /** Es una vía de transporte de dominio y uso público, proyectada y construida fundamentalmente para la circulación de vehículos automóviles\n         */\n        !!@ ili2db.dispName = "(Anexo) Carretera"\n        Carretera,\n        /** Cada una de las superficies de un edificio que disponen de una cara al interior y de otra al exterior.\n         */\n        !!@ ili2db.dispName = "(Anexo) Cerramiento"\n        Cerramiento,\n        /** Construcción anexa conformada por unos cimientos, muros y placa base\n         */\n        !!@ ili2db.dispName = "(Anexo) Cimientos, Estructura, Muros y Placa Base"\n        Cimientos_Estructura_Muros_y_Placa_Base,\n        /** Construcciòn destinada a la cría y albergue de cerdos. Se utiliza cualesquiera de los tres nombres enunciados según la región donde se ubique; los elementos que la conforman son: estructura, muros y pisos.\n         */\n        !!@ ili2db.dispName = "(Anexo) Cocheras - Marraneras - Porquerizas"\n        Cocheras_Marraneras_Porquerizas,\n        /** Tenso estructuras, arquitectura textil, o membranas arquitectónicas, son los nombres con los que se le conoce a los tipos de estructura que emplean materiales que trabajan bajo tensión, sean membranas textiles, láminas, mallas de cables, etc.\n         */\n        !!@ ili2db.dispName = "(Anexo) Construccion en membrana arquitectónica"\n        Construccion_en_Membrana_Arquitectonica,\n        /** Un contenedor es un recipiente de carga para el transporte marítimo o fluvial, transporte terrestre y transporte multimodal adecuado para la vivienda o el comercio o servicios.\n         */\n        !!@ ili2db.dispName = "(Anexo) Contenedor"\n        Contenedor,\n        /** Sitio cerrado y descubierto que se utiliza par la cría y albergue de ganado generalmente vacuno. consta de los elementos estructura  y pisos.\n         */\n        !!@ ili2db.dispName = "(Anexo) Corrales"\n        Corrales,\n        /** Lugar cubierto donde se encierra ganado o caballos y/o se realizan actividades propias de su explotación, constituidos por estructura, cubierta, muros y pisos.\n         */\n        !!@ ili2db.dispName = "(Anexo) Establos - Pesebreras - Caballerizas"\n        Establos_Pesebreras_Caballerizas,\n        /** Son obras arquitectónicas  que se construyen con el objeto de elevar el nivel del agua de la fuente de riego a los sitios donde se desea utilizar.\n         */\n        !!@ ili2db.dispName = "(Anexo) Estacion de Bombeo"\n        Estacion_Bombeo,\n        /** Instalación que permite el tránsito de personas y la conexión con sistemas de transporte como buses, metro, tren, tranvía, terminales y estaciones, destinadas para la movilidad de las personas.\n         */\n        !!@ ili2db.dispName = "(Anexo) Estación de sistema de transporte"\n        Estacion_Sistema_Transporte,\n        /** Unidad construida con destino a la cría y/o protección de aves principalmente para explotación avícola.  Conformada por estructura cubierta pisos y muros que son parcialmente elaborados en ladrillo y el resto descubierto o con algún material provisional (plásticos, alambres, etc.).\n         */\n        !!@ ili2db.dispName = "(Anexo) Galpones - Gallineros"\n        Galpones_Gallineros,\n        /** Espacio destinado para el almacenamiento y disposición de aeronaves.\n         */\n        !!@ ili2db.dispName = "(Anexo) Hangar"\n        Hangar,\n        /** Construcción consistente en una cubierta apoyada en columnas de materiales diferentes, elaborados con el fin de guarecer de la intemperie.\n         */\n        !!@ ili2db.dispName = "(Anexo) Kioscos"\n        Kioscos,\n        /** Son depósitos construidos mediante la excavación y compactación de la tierra que almacenan agua de cualquier calidad por un periodo determinado\n         */\n        !!@ ili2db.dispName = "(Anexo) Lagunas de Oxidación"\n        Lagunas_de_Oxidacion,\n        /** Cobertizo dentro de una edificación de mayor extensión o patio cubierto, clasificados según su estructura, pisos y el material de la cubierta.\n         */\n        !!@ ili2db.dispName = "(Anexo) Marquesinas - Patios Cubiertos"\n        Marquesinas_Patios_Cubiertos,\n        /** Deberán diferenciarse de acuerdo a su estructura, longitud, capacidad, usos turísticos o de carga\n         */\n        !!@ ili2db.dispName = "(Anexo) Muelles"\n        Muelles,\n        /** Se denomina muralla a un muro cerrado destinado a la protección y defensa de determinado sitio.\n         */\n        !!@ ili2db.dispName = "(Anexo) Murallas"\n        Murallas,\n        /** Las pérgolas son estructuras compuestas por columnas y una armazón superior, cubiertas con mucho follaje o toldo especial que protegen de la lluvia y el sol, también usadas como elemento decorativo en un espacio de las viviendas.\n         */\n        !!@ ili2db.dispName = "(Anexo) Pérgolas"\n        Pergolas,\n        /** Estanque artificial con destino al deporte o a la recreación.  Se diferencia por sus acabados y especificaciones técnicas para su mantenimiento y operación; sus dimensiones deben darse en unidades de área (m2).\n         */\n        !!@ ili2db.dispName = "(Anexo) Piscinas"\n        Piscinas,\n        /** Edificación sin cubierta con que se identifican las pistas de los aeropuertos construidas en asfalto o concreto, incluye la zona o calle de redaje y calles de salida rápida.\n         */\n        !!@ ili2db.dispName = "(Anexo) Pista aeropuerto"\n        Pista_Aeropuerto,\n        /** Perforaciones profundas  manuales para extraer agua subterránea.  Medida en metros de profundidad.\n         */\n        !!@ ili2db.dispName = "(Anexo) Pozos"\n        Pozos,\n        /** Consiste en un sitio cubierto elaborado con el fin de resguardar de la intemperie; el nombre de enramadas, cobertizos o caney se utiliza según la forma de la cubierta y la región donde se ubique.\n         */\n        !!@ ili2db.dispName = "(Anexo) Ramadas - Cobertizos - Caneyes"\n        Ramadas_Cobertizos_Caneyes,\n        /** Construcciones elaboradas con el objeto de secar en condiciones naturales el café principalmente, aunque es común su uso en otros productos.  Consta de estructura y pisos para su calificación\n         */\n        !!@ ili2db.dispName = "(Anexo) Secaderos"\n        Secaderos,\n        /** Construcción de grandes dimensiones que sirve para almacén o depósito, se exceptúan los silos cafeteros\n         */\n        !!@ ili2db.dispName = "(Anexo) Silos"\n        Silos,\n        /** Depósitos subterráneos o de altura, construidos en zonas con deficiencias en abastecimiento para el consumo de los habitantes o para el uso agrícola.  El elemento a calificar es la estructura relacionada con la capacidad de almacenamiento medida en metros cúbicos.\n         *  \n         * Se excluyen de este tipo de construcción los tanques de almacenamiento domiciliario\n         */\n        !!@ ili2db.dispName = "(Anexo) Tanques"\n        Tanques,\n        /** Deslizadores construidos alrededor de piscinas, medidos en metros lineales.  Se clasifican según su altura y materiales de construcción\n         */\n        !!@ ili2db.dispName = "(Anexo) Toboganes"\n        Toboganes,\n        /** Edificio en forma de torre, en cuya cima se sitúa una sala de control, desde la que se dirige y controla el tráfico de un puerto, de un aeropuerto o de un circuito de carreras.\n         */\n        !!@ ili2db.dispName = "(Anexo) Torre de control"\n        Torre_de_Control,\n        /** Son estructuras diseñadas para disminuir la temperatura del agua y otros medios.\n         */\n        !!@ ili2db.dispName = "(Anexo) Torres de Enfriamiento"\n        Torres_de_Enfriamiento,\n        /** Se le asigna a las unidades prediales no edificadas o por construir\n         */\n        !!@ ili2db.dispName = "(Anexo) Unidad predial por construir"\n        Unidad_Predial_por_Construir,\n        /** Parte de la infraestructura ferroviaria que une dos puntos determinados del territorio\n         */\n        !!@ ili2db.dispName = "(Anexo) Vía Férrea"\n        Via_Ferrea\n      )\n    );\n\n    LC_ViaTipo = (\n      /** Vía de un sistema vial urbano con prelación de circulación de tránsito sobre las demás vías, con excepción de la vía férrea y la autopista\n       */\n      !!@ ili2db.dispName = "Arteria"\n      Arteria,\n      /** vía de calzadas separadas, cada una con dos (2) o más carriles, control total de acceso y salida, con intersecciones en desnivel o mediante entradas y salidas directas a otras carreteras y con control de velocidades mínimas y máximas por carril.\n       */\n      !!@ ili2db.dispName = "Autopista"\n      Autopista,\n      /** Vía cuya finalidad es permitir la circulación de vehículos, con niveles adecuados de seguridad y comodidad.\n       */\n      !!@ ili2db.dispName = "Carreteable"\n      Carreteable,\n      /** vía o sección de la calzada destinada al tránsito de bicicletas en forma exclusiva.\n       */\n      !!@ ili2db.dispName = "Ciclorruta"\n      Cicloruta,\n      /** Tramo de carretera que se introduce paralelamente a la carretera principal en la zona de un enlace o entre enlaces consecutivos.\n       */\n      !!@ ili2db.dispName = "Colectora"\n      Colectora,\n      /** Son aquellas a cargo de los departamentos\n       */\n      !!@ ili2db.dispName = "Departamental"\n      Departamental,\n      /** Diseñada para el transito de vehículos sobre rieles, con prelación sobre las demás vías, excepto para las ciudades donde existe metro, en cuyos casos será este el que tenga prelación.\n       */\n      !!@ ili2db.dispName = "Férrea"\n      Ferrea,\n      /** Conforman el sistema vial urbano menor y se conectan solamente con las vías colectoras\n       */\n      !!@ ili2db.dispName = "Local"\n      Local,\n      /** Es aquella de exclusiva destinación para las líneas de metro, independientemente de su configuración y que hacen parte integral de su infraestructura de operación.\n       */\n      !!@ ili2db.dispName = "Metro o metrovía"\n      Metro_o_Metrovia,\n      /** Aquellas vías cuyo mantenimiento corresponde al gobierno nacional.\n       */\n      !!@ ili2db.dispName = "Nacional"\n      Nacional,\n      /** La que tiene tránsito subordinado a las vías principales.\n       */\n      !!@ ili2db.dispName = "Ordinaria"\n      Ordinaria,\n      /** Zonas destinadas para el transito exclusivo de peatones.\n       */\n      !!@ ili2db.dispName = "Peatonal"\n      Peatonal,\n      /** Son aquellas troncales, transversales y accesos a capitales de Departamento que cumplen la función básica de integración de las principales zonas de producción y consumo del país y de éste con los demás países.\n       */\n      !!@ ili2db.dispName = "Principal"\n      Principal,\n      /** Via que está destinada al uso particular.\n       */\n      !!@ ili2db.dispName = "Privada"\n      Privada,\n      /** Son aquellas vías que unen las cabeceras municipales entre sí y/o que provienen de una cabecera municipal y conectan con una carretera Primaria.\n       */\n      !!@ ili2db.dispName = "Secundaria"\n      Secundaria,\n      /** Vía de dos (2) calzadas con ocho o más carriles y con destinación exclusiva de las calzadas interiores para el tránsito de servicio público masivo.\n       */\n      !!@ ili2db.dispName = "Troncal"\n      Troncal\n    );\n\n  TOPIC Levantamiento_Catastral\n  EXTENDS LADM_COL_V3_0.LADM_Nucleo =\n    OID AS INTERLIS.UUIDOID;\n    DEPENDS ON LADM_COL_V3_0.LADM_Nucleo,Submodelo_Integracion_Insumos_V1_0.Datos_Integracion_Insumos;\n\n    /** Clase que hereda los atributos de la  Clase COL_Agrupación_Interesados.\n     */\n    !!@ ili2db.dispName = "Agrupación de Interesados"\n    CLASS LC_AgrupacionInteresados\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_AgrupacionInteresados =\n    END LC_AgrupacionInteresados;\n\n    /** Clase para determinar el tipo de calificación para las unidades de construcción, permite 3 opciones: a) calificación por tipologias constructivas, b)calificación total de la ficha de calificación de construcción y c) calificación parcial de la ficha de calificación de construcción como lo puede ser fachada y estructura.\n     */\n    CLASS LC_CalificacionUnidadConstruccion (ABSTRACT) =\n    END LC_CalificacionUnidadConstruccion;\n\n    /** Es la unión de materiales adheridos al terreno, con carácter de permanente, cualesquiera sean los elementos que la constituyan.\n     */\n    !!@ ili2db.dispName = "Construcción"\n    CLASS LC_Construccion\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_UnidadEspacial =\n      /** Identificado de la unidad de construcción, su codificación puede ser por letras del abecedario.\n       */\n      !!@ ili2db.dispName = "Identificador"\n      Identificador : MANDATORY TEXT*2;\n      /** Indica si la construcción es de tipo convencional o no convencional.\n       */\n      !!@ ili2db.dispName = "Tipo de construcción"\n      Tipo_Construccion : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ConstruccionTipo;\n      /** Indica el tipo de dominio de la unidad de construcción: común y privado.\n       */\n      !!@ ili2db.dispName = "Tipo de dominio"\n      Tipo_Dominio : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_DominioConstruccionTipo;\n      /** Número total de pisos de la construcción.\n       */\n      !!@ ili2db.dispName = "Número de pisos"\n      Numero_Pisos : MANDATORY 0 .. 300;\n      /** Número total de sótanos de la construcción.\n       */\n      !!@ ili2db.dispName = "Número de sótanos"\n      Numero_Sotanos : 0 .. 99;\n      /** Número total de mezanines de la construcción.\n       */\n      !!@ ili2db.dispName = "Número de mezanines"\n      Numero_Mezanines : 0 .. 99;\n      /** Número total de semisótanos de la construcción.\n       */\n      !!@ ili2db.dispName = "Número de semisótanos"\n      Numero_Semisotanos : 0 .. 99;\n      /** Año de edificación de la construcción.\n       */\n      !!@ ili2db.dispName = "Año de la construcción"\n      Anio_Construccion : 1550 .. 2500;\n      /** Avalúo total catastral de la construcción.\n       */\n      !!@ ili2db.dispName = "Ávaluo de construcción"\n      Avaluo_Construccion : LADM_COL_V3_0.LADM_Nucleo.Peso;\n      /** Área total construida.\n       */\n      !!@ ili2db.dispName = "Área de construcción"\n      Area_Construccion : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\n      /** Altura total de la construcción.\n       */\n      !!@ ili2db.dispName = "Altura"\n      Altura : 1 .. 1000 [INTERLIS.m];\n      /** Observaciones generales de la construcción.\n       */\n      !!@ ili2db.dispName = "Observaciones"\n      Observaciones : TEXT;\n    END LC_Construccion;\n\n    !!@ ili2db.dispName = "Contacto Visita"\n    CLASS LC_ContactoVisita =\n      /** Indica el tipo de documento de la persona que atendió la visita predial.\n       */\n      !!@ ili2db.dispName = "Tipo de documento de quien atendió la visita predial"\n      Tipo_Documento_Quien_Atendio : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_InteresadoDocumentoTipo;\n      /** Indica el número de documento de la persona que atendió la visita predial.\n       */\n      !!@ ili2db.dispName = "Numero de documento de quien atendió la visita predial"\n      Numero_Documento_Quien_Atendio : MANDATORY TEXT*50;\n      /** Primer nombre de la persona encargada de atender la visita de ejecución de actividades catastrales sobre el predio.\n       */\n      !!@ ili2db.dispName = "Primer nombre de quien atendió"\n      Primer_Nombre_Quien_Atendio : MANDATORY TEXT*100;\n      /** Segundo nombre de la persona encargada de atender la visita de ejecución de actividades catastrales sobre el predio.\n       */\n      !!@ ili2db.dispName = "Segundo nombre de quien atendió"\n      Segundo_Nombre_Quien_Atendio : TEXT*100;\n      /** Primer apellido de la persona encargada de atender la visita de ejecución de actividades catastrales sobre el predio.\n       */\n      !!@ ili2db.dispName = "Primer apellido de quien atendió"\n      Primer_Apellido_Quien_Atendio : MANDATORY TEXT*100;\n      /** Segundo apellido de la persona encargada de atender la visita de ejecución de actividades catastrales sobre el predio.\n       */\n      !!@ ili2db.dispName = "Segundo apellido de quien atendió"\n      Segundo_Apellido_Quien_Atendio : TEXT*100;\n      /** Relación con el predio de la persona encargada de atender la visita, por ejemplo propietario, encargado, administrador, poseedor, etc.\n       */\n      !!@ ili2db.dispName = "Relación con el predio"\n      Relacion_Con_Predio : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RelacionPredioTipo;\n      /** Dirección de domicilio para notificaciones.\n       */\n      !!@ ili2db.dispName = "Domicilio notificaciones"\n      Domicilio_Notificaciones : TEXT*255;\n      /** Número de celular de la persona que atendió la visita de actividades catastrales.\n       */\n      !!@ ili2db.dispName = "Celular"\n      Celular : TEXT*20;\n      /** Correo electrónico de la persona que atendió la visita de actividades catastrales.\n       */\n      !!@ ili2db.dispName = "Correo electrónico"\n      Correo_Electronico : TEXT*100;\n      /** Indica si autoriza las notificaciones administrativas por medio de vía electrónica.\n       */\n      !!@ ili2db.dispName = "Autoriza notificaciones"\n      Autoriza_Notificaciones : BOOLEAN;\n    END LC_ContactoVisita;\n\n    /** Clase que contiene los datos principales del predio matriz sometido al regimen de propiedad horizontal.\n     */\n    !!@ ili2db.dispName = "Datos PH Condominio"\n    CLASS LC_DatosPHCondominio =\n      /** Área total del terreno del PH o Condominio Matriz.\n       */\n      !!@ ili2db.dispName = "Área total de terreno"\n      Area_Total_Terreno : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\n      /** Área total privada del terreno del PH o Condominio Matriz.\n       */\n      !!@ ili2db.dispName = "Área total de terreno privada"\n      Area_Total_Terreno_Privada : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\n      /** Área total de terreno común del PH o Condominio Matriz.\n       */\n      !!@ ili2db.dispName = "Área total de terreno común"\n      Area_Total_Terreno_Comun : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\n      /** Área total de construida del PH o Condominio Matriz.\n       */\n      !!@ ili2db.dispName = "Área total construida"\n      Area_Total_Construida : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\n      /** Área total construida privada del PH o Condominio Matriz.\n       */\n      !!@ ili2db.dispName = "Área total construida privada"\n      Area_Total_Construida_Privada : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\n      /** Área total construida común del PH o Condominio Matriz.\n       */\n      !!@ ili2db.dispName = "Área total construida común"\n      Area_Total_Construida_Comun : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\n      /** Número de torres en el PH o Condominio.\n       */\n      !!@ ili2db.dispName = "Número de torres"\n      Numero_Torres : 0 .. 1000;\n      /** Total de unidades privadas en el PH o Condominio.\n       */\n      !!@ ili2db.dispName = "Total de unidades privadas"\n      Total_Unidades_Privadas : 0 .. 99999999;\n    END LC_DatosPHCondominio;\n\n    /** Clase que registra las instancias de los derechos que un interesado ejerce sobre un predio. Es una especialización de la clase COL_DRR del propio modelo.\n     */\n    !!@ ili2db.dispName = "Derecho"\n    CLASS LC_Derecho\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_DRR =\n      /** Derecho que se ejerce.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_DerechoTipo;\n      /** Indica la fracción del derecho en relación a la forma de tenencia y el área que esta ocupa dentro de la extensión del predio. Ejemplo: un predio informal que se encuentra sobre un predio baldío y un predio privado tendrá un porcentaje de derecho de ocupación y posesión expresado en tanto por uno (0.0000000000 a 1.0000000000).\n       */\n      !!@ ili2db.dispName = "Fracción de derecho"\n      Fraccion_Derecho : MANDATORY 0.0000000000 .. 1.0000000000;\n      /** Fecha de inicio de tenencia del interesado con respecto al predio.\n       */\n      !!@ ili2db.dispName = "Fecha de inicio de tenencia"\n      Fecha_Inicio_Tenencia : INTERLIS.XMLDate;\n    END LC_Derecho;\n\n    !!@ ili2db.dispName = "(LC) Estructura Novedad FMI"\n    STRUCTURE LC_EstructuraNovedadFMI =\n      !!@ ili2db.dispName = "Código ORIP"\n      Codigo_ORIP : TEXT*3;\n      !!@ ili2db.dispName = "Número FMI"\n      Numero_FMI : TEXT*80;\n    END LC_EstructuraNovedadFMI;\n\n    !!@ ili2db.dispName = "(LC) Estructura Novedad Número Predial"\n    STRUCTURE LC_EstructuraNovedadNumeroPredial =\n      !!@ ili2db.dispName = "Número predial"\n      Numero_Predial : MANDATORY TEXT*30;\n      !!@ ili2db.dispName = "Tipo de novedad"\n      Tipo_Novedad : (\n        !!@ ili2db.dispName = "Predio nuevo"\n        Predio_Nuevo,\n        !!@ ili2db.dispName = "Desenglobe"\n        Desenglobe,\n        !!@ ili2db.dispName = "Englobe"\n        Englobe,\n        !!@ ili2db.dispName = "Cancelación"\n        Cancelacion,\n        !!@ ili2db.dispName = "Cambio de número predial"\n        Cambio_Numero_Predial,\n        !!@ ili2db.dispName = "Ninguna"\n        Ninguna\n      );\n    END LC_EstructuraNovedadNumeroPredial;\n\n    /** Clase que almacena las fuentes administrativas (escrituras, sentencias, actos administrativos, etc) que sustentan el Derecho respecto de la relación de tenencia entre el Interesado y el predio.\n     */\n    !!@ ili2db.dispName = "Fuente Administrativa"\n    CLASS LC_FuenteAdministrativa\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativa =\n      /** Tipo de documento que soporta la relación de tenencia entre el interesado con el predio.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo (EXTENDED) : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_FuenteAdministrativaTipo;\n      /** Es tipo de oficina que emite el documento (notaria, juzgado)\n       */\n      !!@ ili2db.dispName = "Ente emisor"\n      Ente_Emisor : TEXT*255;\n    END LC_FuenteAdministrativa;\n\n    /** Clase que hereda los atributos de la  Clase COL_FuenteEspacial.\n     */\n    !!@ ili2db.dispName = "Fuente Espacial"\n    CLASS LC_FuenteEspacial\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_FuenteEspacial =\n    END LC_FuenteEspacial;\n\n    /** Calificación de la construccion según los item determinados para calificar.\n     */\n    !!@ ili2db.dispName = "Grupo Calificación"\n    CLASS LC_GrupoCalificacion =\n      /** Indica los elementos generales de la calificación de la construcción de acuerdo al método vigente.\n       */\n      !!@ ili2db.dispName = "Clase de calificación"\n      Clase_Calificacion : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ClaseCalificacionTipo;\n      /** Estado de conservación del grupo calificado.\n       */\n      !!@ ili2db.dispName = "Conservación"\n      Conservacion : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_EstadoConservacionTipo;\n      /** Subtotal del grupo calificado.\n       */\n      !!@ ili2db.dispName = "Subtotal"\n      Subtotal : MANDATORY 0 .. 9999999;\n    END LC_GrupoCalificacion;\n\n    /** Es la parte que tiene una relación con el predio por algún tipo de derecho, restricción, publicidad o responsabilidad\n     */\n    !!@ ili2db.dispName = "Interesado"\n    CLASS LC_Interesado\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_Interesado =\n      /** Tipo de persona del que se trata\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_InteresadoTipo;\n      /** Tipo de documento del que se trata.\n       */\n      !!@ ili2db.dispName = "Tipo de documento"\n      Tipo_Documento : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_InteresadoDocumentoTipo;\n      /** Documento de identidad del interesado.\n       */\n      !!@ ili2db.dispName = "Documento de identidad"\n      Documento_Identidad : MANDATORY TEXT*50;\n      /** Primer nombre de la persona física.\n       */\n      !!@ ili2db.dispName = "Primer nombre"\n      Primer_Nombre : TEXT*100;\n      /** Segundo nombre de la persona física.\n       */\n      !!@ ili2db.dispName = "Segundo nombre"\n      Segundo_Nombre : TEXT*100;\n      /** Primer apellido de la persona física.\n       */\n      !!@ ili2db.dispName = "Primer apellido"\n      Primer_Apellido : TEXT*100;\n      /** Segundo apellido de la persona física.\n       */\n      !!@ ili2db.dispName = "Segundo apellido"\n      Segundo_Apellido : TEXT*100;\n      /** Condición orgánica que distingue a los machos de las hembras.\n       */\n      !!@ ili2db.dispName = "Sexo"\n      Sexo : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_SexoTipo;\n      !!@ ili2db.dispName = "Grupo étnico"\n      Grupo_Etnico : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_GrupoEtnicoTipo;\n      /** Nombre con el que está inscrito.\n       */\n      !!@ ili2db.dispName = "Razón social"\n      Razon_Social : TEXT*255;\n    END LC_Interesado;\n\n    /** Datos de contacto de la parte interesada.\n     */\n    !!@ ili2db.dispName = "Interesado Contacto"\n    CLASS LC_InteresadoContacto =\n      /** Numero de telefono de contacto del interesado.\n       */\n      !!@ ili2db.dispName = "Teléfono 1"\n      Telefono1 : TEXT*20;\n      /** Numero de telefono de contacto del interesado.\n       */\n      !!@ ili2db.dispName = "Teléfono 2"\n      Telefono2 : TEXT*20;\n      /** Domicilio para notificaciones del interesado.\n       */\n      !!@ ili2db.dispName = "Domicilio notificación"\n      Domicilio_Notificacion : TEXT*500;\n      /** Dirección de residencia del interesado.\n       */\n      !!@ ili2db.dispName = "Dirección de residencia"\n      Direccion_Residencia : TEXT*500;\n      /** Correo electrónico del interesado.\n       */\n      !!@ ili2db.dispName = "Correo electrónico"\n      Correo_Electronico : TEXT*100;\n      /** Indica si el interesado autoriza notificación vía correo electrónico\n       */\n      !!@ ili2db.dispName = "Autoriza notificación correo"\n      Autoriza_Notificacion_Correo : BOOLEAN;\n      /** Departamento de residencia del interesado.\n       */\n      !!@ ili2db.dispName = "Departamento"\n      Departamento : MANDATORY TEXT*100;\n      /** Municipio de residencia del interesado.\n       */\n      !!@ ili2db.dispName = "Municipio"\n      Municipio : MANDATORY TEXT*100;\n      /** Vereda de residencia del interesado.\n       */\n      !!@ ili2db.dispName = "Vereda"\n      Vereda : TEXT*100;\n      /** Corregimiento de residencia del interesado.\n       */\n      !!@ ili2db.dispName = "Corregimiento"\n      Corregimiento : TEXT*100;\n    END LC_InteresadoContacto;\n\n    /** Linea de división que separa un bien inmueble de otro, que puede o no estar materializada físicamente.\n     */\n    !!@ ili2db.dispName = "Lindero"\n    CLASS LC_Lindero\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_CadenaCarasLimite =\n      /** Longitud en metros del lindero.\n       */\n      !!@ ili2db.dispName = "Longitud"\n      Longitud : MANDATORY 0.0 .. 10000.0 [INTERLIS.m];\n    END LC_Lindero;\n\n    /** Puntaje de cada item de la calificación de construcción.\n     */\n    !!@ ili2db.dispName = "Objeto Construcción"\n    CLASS LC_ObjetoConstruccion =\n      /** Item de la calificación de construcción según la método de calificación vigente.\n       */\n      !!@ ili2db.dispName = "Tipo de objeto de construcción"\n      Tipo_Objeto_Construccion : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ObjetoConstruccionTipo;\n      /** Puntaje del ítem calificado.\n       */\n      !!@ ili2db.dispName = "Puntos"\n      Puntos : MANDATORY 0 .. 16;\n    END LC_ObjetoConstruccion;\n\n    !!@ ili2db.dispName = "Ofertas mercado inmobiliario"\n    CLASS LC_OfertasMercadoInmobiliario =\n      /** La clase de oferta corresponde a una oferta de venta o a una oferta de arriendo del predio.\n       */\n      !!@ ili2db.dispName = "Tipo de oferta"\n      Tipo_Oferta : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_OfertaTipo;\n      /** Dato del valor en pesos de la oferta\n       */\n      !!@ ili2db.dispName = "Valor pedido"\n      Valor_Pedido : MANDATORY LADM_COL_V3_0.LADM_Nucleo.Peso;\n      /** Dato del valor en pesos negociado entre el vendedor y el posible comprador\n       */\n      !!@ ili2db.dispName = "Valor negociado"\n      Valor_Negociado : MANDATORY LADM_COL_V3_0.LADM_Nucleo.Peso;\n      /** Año, mes y día de captura de la oferta en campo.\n       */\n      !!@ ili2db.dispName = "Fecha de captura de la oferta"\n      Fecha_Captura_Oferta : MANDATORY INTERLIS.XMLDate;\n      /** Número de meses de la publicitación de la oferta en el mercado inmobiliario.\n       */\n      !!@ ili2db.dispName = "Tiempo de la oferta en el mercado inmobiliario en meses"\n      Tiempo_Oferta_Mercado : 0 .. 1000;\n      /** Número de teléfono fijo o número celular de la persona que está publicitando el bien inmueble.\n       */\n      !!@ ili2db.dispName = "Número de contacto del oferente"\n      Numero_Contacto_Oferente : MANDATORY TEXT*20;\n      !!@ ili2db.dispName = "Nombre del oferente"\n      Nombre_Oferente : MANDATORY TEXT*255;\n    END LC_OfertasMercadoInmobiliario;\n\n    /** Clase especializada de BaUnit, que describe la unidad administrativa básica para el caso de Colombia.\n     * El predio es la unidad territorial legal propia de Catastro. Está formada por el terreno y puede o no tener construcciones asociadas.\n     */\n    !!@ ili2db.dispName = "Predio"\n    CLASS LC_Predio\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasica =\n      /** Corresponde al código del departamento al cual pertenece el predio. Es asignado por DIVIPOLA y tiene 2 dígitos.\n       */\n      !!@ ili2db.dispName = "Departamento"\n      Departamento : MANDATORY TEXT*2;\n      /** Corresponde al código del municipio al cual pertenece el predio. Es asignado por DIVIPOLA y tiene 3 dígitos.\n       */\n      !!@ ili2db.dispName = "Municipio"\n      Municipio : MANDATORY TEXT*3;\n      /** Identificador único temporal de cada predio que se asigna en el desarrollo del levantamiento catastral.\n       */\n      !!@ ili2db.dispName = "Identificador único de operación"\n      Id_Operacion : MANDATORY TEXT*30;\n      /** Indica si el predio tiene matricula inmobiliaria.\n       */\n      !!@ ili2db.dispName = "Tiene FMI"\n      Tiene_FMI : MANDATORY BOOLEAN;\n      /** Circulo registral\n       */\n      !!@ ili2db.dispName = "Código ORIP"\n      Codigo_ORIP : TEXT*3;\n      /** Matricula inmobiliaria\n       */\n      !!@ ili2db.dispName = "Matrícula inmobiliaria"\n      Matricula_Inmobiliaria : TEXT*80;\n      /** Nuevo Código numérico de treinta (30) dígitos, que se le asigna a cada predio y busca localizarlo inequívocamente en los documentos catastrales, según el modelo determinado por el Instituto Geográfico Agustín Codazzi.\n       */\n      !!@ ili2db.dispName = "Número predial"\n      Numero_Predial : TEXT*30;\n      /** Anterior código númerico de veinte (20) digitos, que se le asigna a cada predio y busca localizarlo inequívocamente en los documentos catastrales, según el modelo determinado por el Instituto Geográfico Agustin Codazzi.\n       */\n      !!@ ili2db.dispName = "Número predial anterior"\n      Numero_Predial_Anterior : TEXT*20;\n      /** Es un código único para identificar los inmuebles tanto en los sistemas de información catastral como registral. El NUPRE no implicará supresión de la numeración catastral ni registral asociada a la cédula catastral ni a la matrícula inmobiliaria actual.\n       */\n      !!@ ili2db.dispName = "Número único predial"\n      NUPRE : TEXT*11;\n      /** Valor catastral del predio, obtenido mediante investigación y análisis estadístico del mercado inmobiliario y la metodología de aplicación correspondiente.\n       */\n      !!@ ili2db.dispName = "Avalúo catastral"\n      Avaluo_Catastral : LADM_COL_V3_0.LADM_Nucleo.Peso;\n      !!@ ili2db.dispName = "Tipo de predio"\n      Tipo (EXTENDED) : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PredioTipo;\n      /** Caracterización temática del predio.\n       */\n      !!@ ili2db.dispName = "Condición del predio"\n      Condicion_Predio : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_CondicionPredioTipo;\n      /** Dirección del predio.\n       */\n      !!@ ili2db.dispName = "Dirección"\n      Direccion : BAG {1..*} OF LADM_COL_V3_0.LADM_Nucleo.ExtDireccion;\n      UNIQUE Id_Operacion; \n    END LC_Predio;\n\n    /** Puntos topograficos o geodesicos utilizados como amarre para la ejecución del levantamiento catastral.\n     */\n    !!@ ili2db.dispName = "Punto Control"\n    CLASS LC_PuntoControl\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_Punto =\n      /** Nombre o código del punto de control.\n       */\n      !!@ ili2db.dispName = "ID del punto de control"\n      ID_Punto_Control : MANDATORY TEXT*255;\n      /** Indica la clasificación del tipo de punto de acuerdo a sus características.\n       */\n      !!@ ili2db.dispName = "Tipo de punto"\n      PuntoTipo (EXTENDED) : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PuntoTipo;\n      /** Si se trata de un punto de control o de apoyo.\n       */\n      !!@ ili2db.dispName = "Tipo de punto de control"\n      Tipo_Punto_Control : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PuntoControlTipo;\n      /** Exactitud horizontal de la medición del punto.\n       */\n      !!@ ili2db.dispName = "Exactitud horizontal"\n      Exactitud_Horizontal : MANDATORY 0.000 .. 10.000 [INTERLIS.m];\n      /** Exactitud vertical de la medición del punto.\n       */\n      !!@ ili2db.dispName = "Exactitud vertical"\n      Exactitud_Vertical : MANDATORY 0.000 .. 10.000 [INTERLIS.m];\n    END LC_PuntoControl;\n\n    /** Puntos que definen los lindero de un terreno. La sucesión de estos puntos forman una línea que representa el límite entre dos terrenos.\n     */\n    !!@ ili2db.dispName = "Punto Lindero"\n    CLASS LC_PuntoLindero\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_Punto =\n      /** Nombre o código del punto lindero\n       */\n      !!@ ili2db.dispName = "ID del punto de lindero"\n      ID_Punto_Lindero : MANDATORY TEXT*255;\n      /** Indica la clasificación del tipo de punto de acuerdo a sus características.\n       */\n      !!@ ili2db.dispName = "Tipo de punto"\n      PuntoTipo (EXTENDED) : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PuntoTipo;\n      /** Indica si existe acuerdo o no entre los colindantes en relación al punto lindero que se está midiendo.\n       */\n      !!@ ili2db.dispName = "Acuerdo"\n      Acuerdo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_AcuerdoTipo;\n      /** Indica si el punto es fotoidentificable.\n       */\n      !!@ ili2db.dispName = "Fotoidentificación"\n      Fotoidentificacion : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_FotoidentificacionTipo;\n      /** Corresponde a la exactitud horizontal del punto lindero\n       */\n      !!@ ili2db.dispName = "Exactitud horizontal"\n      Exactitud_Horizontal : MANDATORY 0.000 .. 10.000 [INTERLIS.m];\n      /** Corresponde a la exactitud vertical del punto lindero\n       */\n      !!@ ili2db.dispName = "Exactitud vertical"\n      Exactitud_Vertical : 0.000 .. 10.000 [INTERLIS.m];\n    END LC_PuntoLindero;\n\n    /** Restricción legalmente constituida y registrada que afecta el derecho de un persona en relación con el predio.\n     */\n    !!@ ili2db.dispName = "Restricción"\n    CLASS LC_Restriccion\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_DRR =\n      /** Tipo de Restricción que afecta el derecho.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo;\n    END LC_Restriccion;\n\n    /** Porción de tierra con una extensión geográfica definida.\n     */\n    !!@ ili2db.dispName = "Terreno"\n    CLASS LC_Terreno\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_UnidadEspacial =\n      /** Área total del terreno  resultante del levantamiento catastral..\n       */\n      !!@ ili2db.dispName = "Área de terreno"\n      Area_Terreno : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\n      /** Valor catastral asignado en el proceso de valoración económica masiva al terreno del predio.\n       */\n      !!@ ili2db.dispName = "Avalúo de terreno"\n      Avaluo_Terreno : LADM_COL_V3_0.LADM_Nucleo.Peso;\n      /** Corresponde la identificación del número predial hasta la posición 21, permite identificar la relación espacial en sus componentes: departamento, municipio, zona, sector, comuna, barrio, manzana o vereda y terreno de acuerdo a su codificación en el número predial.\n       */\n      !!@ ili2db.dispName = "Numero predial hasta la posición 21"\n      Manzana_Vereda_Codigo : TEXT*21;\n      /** Corresponde a la figura geométrica vectorial poligonal, generada a partir de los linderos del predio.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria (EXTENDED) : MANDATORY ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\n    END LC_Terreno;\n\n    /** Proceso mediante el cual se le asigna un puntaje a las edificaciones de acuerdo a sus características constructivas\n     */\n    !!@ ili2db.dispName = "Calificación Convencional"\n    CLASS LC_CalificacionConvencional\n    EXTENDS LC_CalificacionUnidadConstruccion =\n      /** Indica si la calificación de construcción corresponde a residencial, comercial o industrial.\n       */\n      !!@ ili2db.dispName = "Tipo a calificar"\n      Tipo_Calificar : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_CalificarTipo;\n      /** Puntaje total de la calificación de la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Total calificación"\n      Total_Calificacion : MANDATORY LADM_COL_V3_0.LADM_Nucleo.Integer;\n    END LC_CalificacionConvencional;\n\n    /** Relaciona el tipo de construcción consideradas como anexo para el catastro.\n     */\n    !!@ ili2db.dispName = "Calificación No Convencional"\n    CLASS LC_CalificacionNoConvencional\n    EXTENDS LC_CalificacionUnidadConstruccion =\n      /** Relaciona el tipo de construcción consideradas como anexo para el catastro.\n       */\n      !!@ ili2db.dispName = "Tipo de anexo"\n      Tipo_Anexo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_AnexoTipo;\n    END LC_CalificacionNoConvencional;\n\n    /** Datos de adicionales del predio para catastro multipropósito\n     */\n    !!@ ili2db.dispName = "Datos adicionales levantamiento catastral"\n    CLASS LC_DatosAdicionalesLevantamientoCatastral =\n      /** Indica si el predio según la información registral cuenta con el valor de área en la cabida y linderos.\n       */\n      !!@ ili2db.dispName = "¿El predio tiene área registral?"\n      Tiene_Area_Registral : MANDATORY BOOLEAN;\n      /** Indica el valor del área registral del predio en metros cuadrados.\n       */\n      !!@ ili2db.dispName = "Área registral en metros cuadrados"\n      Area_Registral_M2 : 0.00 .. 10000000000000000000000.00 [LADM_COL_V3_0.m2];\n      /** Se considerará como procedimientos catastrales con efectos registrales los siguientes: actualización de linderos, rectificación de área por imprecisa determinación, actualización masiva y puntual de linderos y áreas, rectificación de linderos por acuerdo entre las partes, e inclusión de área y/o linderos.\n       */\n      !!@ ili2db.dispName = "Procedimientos catastrales con efectos registrales"\n      Procedimiento_Catastral_Registral : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ProcedimientoCatastralRegistralTipo;\n      /** Es la clasificación para fines estadísticos que se da a cada inmueble en su conjunto–terreno, construcciones o edificaciones-, en el momento de la identificación predial de conformidad con la actividad predominante que en él se desarrolle.\n       */\n      !!@ ili2db.dispName = "Destinación económica"\n      Destinacion_Economica : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_DestinacionEconomicaTipo;\n      /** Clasificación del suelo según el instrumento de planeación vigente.\n       */\n      !!@ ili2db.dispName = "Clase de suelo"\n      Clase_Suelo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ClaseSueloTipo;\n      /** Categoría del suelo según el instrumento de planeación vigente.\n       */\n      !!@ ili2db.dispName = "Categoría de suelo"\n      Categoria_Suelo : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_CategoriaSueloTipo;\n      /** Relaciona los cambios del predio respecto de la información catastral vigente.\n       */\n      !!@ ili2db.dispName = "Novedad números prediales"\n      Novedad_Numeros_Prediales : BAG {0..*} OF Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.Levantamiento_Catastral.LC_EstructuraNovedadNumeroPredial;\n      /** Relaciona los cambios del predio respecto de la información registral vigente.\n       */\n      !!@ ili2db.dispName = "Novedad folio de matrícula de inmobiliaria"\n      Novedad_FMI : BAG {0..*} OF Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.Levantamiento_Catastral.LC_EstructuraNovedadFMI;\n      /** Observaciones generales respecto del predio.\n       */\n      !!@ ili2db.dispName = "Observaciones"\n      Observaciones : MTEXT*500;\n      /** Fecha de la visita en campo al predio.\n       */\n      !!@ ili2db.dispName = "Fecha de visita predial"\n      Fecha_Visita_predial : MANDATORY INTERLIS.XMLDate;\n      /** Indica el tipo de documento del reconocedor predial encargado de efectuar el levantamiento catastral.\n       */\n      !!@ ili2db.dispName = "Tipo de documento del reconocedor predial"\n      Tipo_Documento_Reconocedor : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_InteresadoDocumentoTipo;\n      /** Indica el número de documento del reconocedor predial encargado de efectuar el levantamiento catastral.\n       */\n      !!@ ili2db.dispName = "Numero de documento del reconocedor predial"\n      Numero_Documento_Reconocedor : MANDATORY TEXT*50;\n      /** Primer nombre del delegado de ejecutar las actividades catastrales en campo en el predio.\n       */\n      !!@ ili2db.dispName = "Primer nombre del reconocedor"\n      Primer_Nombre_Reconocedor : MANDATORY TEXT*100;\n      /** Segundo nombre del delegado de ejecutar las actividades catastrales en campo en el predio.\n       */\n      !!@ ili2db.dispName = "Segundo nombre del reconocedor"\n      Segundo_Nombre_Reconocedor : TEXT*100;\n      /** Primer apellido del delegado de ejecutar las actividades catastrales en campo en el predio.\n       */\n      !!@ ili2db.dispName = "Primer apellido del reconocedor"\n      Primer_Apellido_Reconocedor : MANDATORY TEXT*100;\n      /** Segundo apellido del delegado de ejecutar las actividades catastrales en campo en el predio.\n       */\n      !!@ ili2db.dispName = "Segundo apellido del reconocedor"\n      Segundo_Apellido_Reconocedor : TEXT*100;\n      /** Posibles situaciones que se presentan y afectan el resultado del levantamiento de la información en campo.\n       */\n      !!@ ili2db.dispName = "Resultado de la visita predial"\n      Resultado_Visita : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ResultadoVisitaTipo;\n      /** Indica si dentro del proceso de formación o actualización catastral se suscribe acta de colindancia para el predio objeto de levantamiento catastral.\n       */\n      !!@ ili2db.dispName = "¿Se suscribe acta de colindancia?"\n      Suscribe_Acta_Colindancia : BOOLEAN;\n    END LC_DatosAdicionalesLevantamientoCatastral;\n\n    /** Puntos que definen los limites de las construcciones, unidad de construcción y servidumbres de transito.\n     */\n    !!@ ili2db.dispName = "Punto Levantamiento"\n    CLASS LC_PuntoLevantamiento\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_Punto =\n      /** Nombre o código del punto levantamiento.\n       */\n      !!@ ili2db.dispName = "ID del punto de levantamiento"\n      ID_Punto_Levantamiento : MANDATORY TEXT*255;\n      /** Indica la clasificación del tipo de punto de acuerdo a sus características.\n       */\n      !!@ ili2db.dispName = "Tipo de punto"\n      PuntoTipo (EXTENDED) : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PuntoTipo;\n      /** Indica si el tipo de punto corresponde a una construcción o servidumbre de tránsito.\n       */\n      !!@ ili2db.dispName = "Tipo de punto de levantamiento"\n      Tipo_Punto_Levantamiento : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PuntoLevTipo;\n      /** Indica si el punto es fotoidentificable.\n       */\n      !!@ ili2db.dispName = "Fotoidentificación"\n      Fotoidentificacion : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_FotoidentificacionTipo;\n      /** Corresponde a la exactitud horizontal del punto levantamiento.\n       */\n      !!@ ili2db.dispName = "Exactitud horizontal"\n      Exactitud_Horizontal : MANDATORY 0.000 .. 10.000 [INTERLIS.m];\n      /** Corresponde a la exactitud vertical del punto levantamiento\n       */\n      !!@ ili2db.dispName = "Exactitud vertical"\n      Exactitud_Vertical : 0.000 .. 10.000 [INTERLIS.m];\n    END LC_PuntoLevantamiento;\n\n    /** Son las características de diseño y constructivas especiales de las construcciones y/o edificaciones.\n     */\n    !!@ ili2db.dispName = "Tipología de la construcción"\n    CLASS LC_TipologiaConstruccion\n    EXTENDS LC_CalificacionUnidadConstruccion =\n      /** Son las características de diseño y constructivas especiales de las construcciones y/o edificaciones.\n       */\n      !!@ ili2db.dispName = "Tipo de tipología"\n      Tipo_Tipologia : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_TipologiaTipo;\n    END LC_TipologiaConstruccion;\n\n    ASSOCIATION lc_interesado_interesadocontacto =\n      lc_contacto -- {0..*} LC_InteresadoContacto;\n      lc_interesado -- {1} LC_Interesado;\n    END lc_interesado_interesadocontacto;\n\n    ASSOCIATION lc_objetoconstruccion_grupocalificacion =\n      lc_grupo_calificacion -- {1} LC_GrupoCalificacion;\n      lc_objeto_construccion -- {0..*} LC_ObjetoConstruccion;\n    END lc_objetoconstruccion_grupocalificacion;\n\n    ASSOCIATION lc_ph_predio =\n      lc_predio -- {1} LC_Predio;\n      lc_datos_ph -- {0..1} LC_DatosPHCondominio;\n    END lc_ph_predio;\n\n    ASSOCIATION lc_predio_copropiedad =\n      predio -- {0..*} LC_Predio;\n      copropiedad -<> {0..1} LC_Predio;\n      coeficiente : LADM_COL_V3_0.LADM_Nucleo.Fraccion;\n    END lc_predio_copropiedad;\n\n    ASSOCIATION lc_predio_ini_predioinsumos =\n      ini_predio_insumos (EXTERNAL) -- {0..*} Submodelo_Integracion_Insumos_V1_0.Datos_Integracion_Insumos.INI_PredioInsumos;\n      lc_predio -- {0..*} LC_Predio;\n    END lc_predio_ini_predioinsumos;\n\n    ASSOCIATION lc_predio_ofertas_mercado_inmobiliario =\n      lc_predio -- {0..1} LC_Predio;\n      lc_ofertas_mercado_inmobiliario -- {0..*} LC_OfertasMercadoInmobiliario;\n    END lc_predio_ofertas_mercado_inmobiliario;\n\n    /** Tipo de unidad espacial que permite la representación de una servidumbre de paso asociada a una COL_BAUnit.\n     */\n    !!@ ili2db.dispName = "Servidumbre de Tránsito"\n    CLASS LC_ServidumbreTransito\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_UnidadEspacial =\n      /** Área total de la servidumbre.\n       */\n      !!@ ili2db.dispName = "Área de la servidumbre"\n      Area_Servidumbre : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\n    END LC_ServidumbreTransito;\n\n    ASSOCIATION lc_grupo_calificacionconvencional =\n      lc_calificacion_convencional -- {1} LC_CalificacionConvencional;\n      lc_grupo_calificacion -- {1..*} LC_GrupoCalificacion;\n    END lc_grupo_calificacionconvencional;\n\n    ASSOCIATION lc_informacion_adicional_contacto =\n      lc_contacto_visita -- {0..*} LC_ContactoVisita;\n      lc_datos_adicionales -- {1} LC_DatosAdicionalesLevantamientoCatastral;\n    END lc_informacion_adicional_contacto;\n\n    /** Relación entre el Predio catastral y la clase información adicional, que permite determinar sobre qué predio se toman los datos específicos del predio para catastro multipropósito\n     */\n    ASSOCIATION lc_informacion_adicional_predio =\n      lc_predio (EXTERNAL) -- {1} LC_Predio;\n      lc_datos_adicionales -- {0..1} LC_DatosAdicionalesLevantamientoCatastral;\n    END lc_informacion_adicional_predio;\n\n    /** Es cada conjunto de materiales consolidados dentro de un predio que tiene unas características específicas en cuanto a elementos constitutivos físicos y usos de la misma.\n     */\n    !!@ ili2db.dispName = "Unidad de Construcción"\n    CLASS LC_UnidadConstruccion\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_UnidadEspacial =\n      /** Identificado de la unidad de construcción, su codificación puede ser por letras del abecedario.\n       */\n      !!@ ili2db.dispName = "Identificador"\n      Identificador : MANDATORY TEXT*3;\n      /** Indica el tipo de dominio de la unidad de construcción: común y privado.\n       */\n      !!@ ili2db.dispName = "Tipo de dominio"\n      Tipo_Dominio : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_DominioConstruccionTipo;\n      /** Indica si la construcción es de tipo convencional o no convencional.\n       */\n      !!@ ili2db.dispName = "Tipo de construcción"\n      Tipo_Construccion : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ConstruccionTipo;\n      /** Indica si la unidad de construcción es residencial, comercial, industrial o anexo.\n       */\n      !!@ ili2db.dispName = "Tipo de unidad de construcción"\n      Tipo_Unidad_Construccion : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_UnidadConstruccionTipo;\n      /** Indica el tipo de planta donde se ubica la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Tipo de planta"\n      Tipo_Planta : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ConstruccionPlantaTipo;\n      /** Indica numéricamente la ubicación del predio de acuerdo al tipo de planta.\n       */\n      !!@ ili2db.dispName = "Planta ubicación"\n      Planta_Ubicacion : MANDATORY 0 .. 500;\n      /** Número total de  habitaciones en la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Total de habitaciones"\n      Total_Habitaciones : 0 .. 999999;\n      /** Número total de baños en la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Total de baños"\n      Total_Banios : 0 .. 999999;\n      /** Número total de locales en la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Total de locales"\n      Total_Locales : 0 .. 999999;\n      /** Número total de pisos en la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Total de pisos"\n      Total_Pisos : 0 .. 150;\n      /** Actividad que se desarrolla en una unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Uso"\n      Uso : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_UsoUConsTipo;\n      /** Año de construcción de la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Año de construcción"\n      Anio_Construccion : 1512 .. 2500;\n      /** Avalúo catastral de la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Avalúo de la unidad de construcción"\n      Avaluo_Unidad_Construccion : LADM_COL_V3_0.LADM_Nucleo.Peso;\n      /** Área total construida en la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Área construida"\n      Area_Construida : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\n      /** Área total privada de la unidad de construcción para los predios en régimen de propiedad horizontal.\n       */\n      !!@ ili2db.dispName = "Área privada construida"\n      Area_Privada_Construida : 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\n      /** Altura total de la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Altura"\n      Altura : 1 .. 1000 [INTERLIS.m];\n      /** Observaciones generales respecto de la unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Observaciones"\n      Observaciones : TEXT;\n    END LC_UnidadConstruccion;\n\n    /** Relación entre la clase Unidad_Construccion del modelo de Avalúos y Calificacion_Unidad_Construccion de modelo de Avalúos\n     */\n    ASSOCIATION lc_calificacion_unidadconstruccion =\n      lc_unidad_construccion (EXTERNAL) -- {1} LC_UnidadConstruccion;\n      lc_calificacion_unidad_construccion -- {0..1} LC_CalificacionUnidadConstruccion;\n    END lc_calificacion_unidadconstruccion;\n\n    ASSOCIATION lc_construccion_unidadconstruccion =\n      lc_unidadconstruccion -- {0..*} LC_UnidadConstruccion;\n      lc_construccion -<> {1} LC_Construccion;\n    END lc_construccion_unidadconstruccion;\n\n  END Levantamiento_Catastral;\n\nEND Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.\n	2020-07-22 10:37:35.576
Submodelo_Avaluos_V1_0.ili	2.3	Submodelo_Avaluos_V1_0{ Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0 LADM_COL_V3_0 ISO19107_PLANAS_V3_0}	INTERLIS 2.3;\n\n/** Perfil Nacional colombiano de la ISO 19152 LADM COL generado con INTERLIS 2 - Extension de Avaluos.\n * \n * -----------------------------------------------------------\n *  Revisiones historicas\n *  2017.06.02 vbp: Extraido el modelo a parir del TOPIC del mismo nombre en el modelo de Catastro y Registro\n *  2017.06.29 vbp: Añadidos dominios procedentes de Catastro-Registro\n *  2017.06.29 vbp: Extraidos dominios de valores de atributos de las clases --> integridad estructural, facilidad de lectura, unicidad de criterio en todos los modelos.\n * -----------------------------------------------------------\n * \n *  02.06.2017/vb: Generacion del modelo extraido a partir de version anterior del modelo de Catastro, donde aparecia como TOPIC\n *  09.11.2017/ : cambio de nombre al dominio COL_DestinoEconomicoTipo\n *  01.02.2018/ : Cambio en cardinalidad en asociacion avaluoPredio de 1 a 0..1\n *  05.02.2018/ : Cambio en cardinalidad en asociaciones avaluoConstruccion y AvaluoUnidadConstruccion de 1 a 0..1\n *  07.03.2018/fm-gc : Cambio en tipo de geometria de las clases Zona_Homogenea_Fisica y Zona_Homogenea_Geoeconomica de GM_Surface2D a GM_MultiSurface2D\n *  08.03.2018/fm-gc: se ajusta la cardinalidad de atributo Comun_Uso_Exclusivo en la clase Predio\n *  09.07.2018/ : Cambio en cardinalidad en asociaciones avaluoConstruccion y AvaluoUnidadConstruccion de 1 a 0..1\n * 08.08.2018/ : (AT) Se agrega la clase abstracta Calificacion_Unidad_Construccion con clases especializadas Calificacion_No_Convencional y Calificacion_Convencional; Cambio en la cardinalidad de relación entre Unidad_Construccion y Calificacion_Unidad_Construccion pasa de 1 - 1..* a 1 - 1; Cambio en los valores del dominio COL_AccesoTipo; Se agrega el atributo numérico Nivel_de_Acceso en clase Unidad_Construccion; Cambio en el nombre del atributo Actividad_Econo por Uso; Se agrega el dominio COL_UsoConstruccionTipo para que tengan correspondencia con dominios SNC; Cambio en tipo de dato Material de manera que se quita el dominio y se deja abierto para el operador; Cambio en los valores del dominio COL_DestinoEconomicoTipo; Se elimina el atributo numero_total_pisos de clase Unidad_Construccion; Se cambia la cardinalidad de los atributos de Unidad_Construccion y Predio; Cambio de nombre en los atributos Conservacion_Cubierta y Puntos_Cubierta_Conservacion de la clase Calificacion_Convencional por Conservacion_Estructura y Puntos_Estructura_Conservacion; Ajuste de valores de los dominio COL_TipoCalificarTipo, COL_ArmazonTipo, COL_MurosTipo, COL_CubiertaTipo, COL_CubrimientoMurosTipo, COL_CalidadEnchapeTipo; Se agregan los dominios COL_ConservacionCalificacion y COL_AnexoTipo; Se adiciona el atributo Num_Sotanos en la clase Predio_Matriz_PH\n * 21.08.2018/ : (AT) Se modifica el atributo Cercania_Hitos de la clase Predio dejandolo de tipo String\n * 23.08.2018/ : (AT) Se cambia el nombre de la relación y de los roles entre unidad_construccion y calificacion_unidad_construccion\n * \n * -----------------------------------------------------------\n * \n *  (c) IGAC y SNR con apoyo de la Cooperacion Suiza\n * \n * -----------------------------------------------------------\n */\nMODEL Submodelo_Avaluos_V1_0 (es)\nAT "http://www.proadmintierra.info/"\nVERSION "V2.2.1"  // 2018-02-01 // =\n  IMPORTS ISO19107_PLANAS_V3_0,Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0,LADM_COL_V3_0;\n\n  DOMAIN\n\n    AV_DisponibilidadAguaTipo = (\n      /** Se consideran aquellas que poseen sistemas de riego bien sea por gravedad o por sistemas mecánicos, o afiliadas a distritos de riego de manera que disponen de agua en forma permanente durante todo el año.\n       */\n      !!@ ili2db.dispName = "Zonas con aguas abundantes"\n      Zonas_Con_Aguas_Abundantes,\n      /** Son aquellas zonas que poseen fuentes de aguas en forma permanente, bien sean corrientes o estancadas, pero que debido a limitaciones de pendiente se dificulta su utilización para fines de riego o aprovechamiento ganadero.\n       */\n      !!@ ili2db.dispName = "Zonas con aguas suficientes"\n      Zonas_Con_Aguas_Suficientes,\n      /** Son aquellas zonas con fuentes de aguas permanentes o semipermanentes pero con limitaciones de aprovechamiento a causa de la pendiente de terreno o a causa de la calidad de los suelos que limitan su uso agrícola o ganadero.\n       */\n      !!@ ili2db.dispName = "Zonas con aguas escasas"\n      Zonas_Con_Aguas_Escasas,\n      /** Donde solo hay posibilidades de agua en el invierno ó zonas de pendientes mayores al 50%, en las cuales el aprovechamiento se hace imposible.\n       */\n      !!@ ili2db.dispName = "Zonas sin agua"\n      Zonas_Sin_Aguas\n    );\n\n    AV_InfluenciaVialRuralTipo = (\n      /** Son aquellas zonas que están comunicadas por vías pavimentadas de primer orden tipo 1\n       */\n      !!@ ili2db.dispName = "Buenas 1 - Pavimentada, dos o más vías"\n      Buenas_1,\n      /** Son aquellas zonas que están comunicadas por vía destapadas tipo 2\n       */\n      !!@ ili2db.dispName = "Buenas 2 - Sin pavimentar, dos o más vías"\n      Buenas_2,\n      /** Aquellas que presentan vías de tipo 3 y 4. De regular desarrollo agropecuario; por lo general son zonas de ganadería extensiva o de agricultura de subsistencia. Las pendientes van de inclinadas a fuertemente inclinadas. Más alejadas de los centros Urbanos. Pavimentadas, vía angosta.\n       */\n      !!@ ili2db.dispName = "Regulares 3 - Pavimentadas, vía angosta"\n      Regulares_3,\n      /** Aquellas que presentan vías de tipo 3 y 4. De regular desarrollo agropecuario; por lo general son zonas de ganadería extensiva o de agricultura de subsistencia. Las pendientes van de inclinadas a fuertemente inclinadas. Más alejadas de los centros Urbanos. Sin pavimentar, vía angosta.\n       */\n      !!@ ili2db.dispName = "Regulares 4 - Sin pavimentar, vía angosta"\n      Regulares_4,\n      /** Presentan en su mayoría vías de tipo 5 en adelante; zonas dedicadas a la agricultura y ganadería extensiva; zonas de pendiente fuertemente inclinadas y relieve quebrado o escarpado. Si se presentan zonas con pendientes menores estas, por lo general, están erosionadas. Las vías malas se presentan, con mayor frecuencia en zonas muy alejadas de los centros urbanos.\n       * Transitables en tiempo seco\n       */\n      !!@ ili2db.dispName = "Malas 5 - Transitable en tiempo seco"\n      Malas_5,\n      /** Presentan en su mayoría vías de tipo 5 en adelante; zonas dedicadas a la agricultura y ganadería extensiva; zonas de pendiente fuertemente inclinadas y relieve quebrado o escarpado. Si se presentan zonas con pendientes menores estas, por lo general, están erosionadas. Las vías malas se presentan, con mayor frecuencia en zonas muy alejadas de los centros urbanos.\n       * Carreteable solo para vehículos\n       */\n      !!@ ili2db.dispName = "Malas 6 - Carreteable sólo para vehículos medianos"\n      Malas_6,\n      /** Presentan en su mayoría vías de tipo 5 en adelante; zonas dedicadas a la agricultura y ganadería extensiva; zonas de pendiente fuertemente inclinadas y relieve quebrado o escarpado. Si se presentan zonas con pendientes menores estas, por lo general, están erosionadas. Las vías malas se presentan, con mayor frecuencia en zonas muy alejadas de los centros urbanos.\n       * Camino real o de herradura.\n       */\n      !!@ ili2db.dispName = "Malas 7 - Camino real o de herradura"\n      Malas_7,\n      /** Carecen de vías de comunicación importantes y solo se presentan caminos para el tránsito de personas o animales de carga. Sendero\n       */\n      !!@ ili2db.dispName = "Sin vías 8 - Sendero"\n      Sin_Vias_8,\n      /** Carecen de vías de comunicación importantes y solo se presentan caminos para el tránsito de personas o animales de carga. Sin vías.\n       */\n      !!@ ili2db.dispName = "Sin vías 9 - Sin vías"\n      Sin_Vias_9\n    );\n\n    AV_InfluenciaVialUrbanaTipo = (\n      /** Aquella zona en la cual las vías vehiculares han sido revestidas de asfalto o pavimento.\n       */\n      !!@ ili2db.dispName = "Pavimentadas"\n      Pavimentadas,\n      /** Zona donde las vías realizadas no han sido revestidas por ningún material resistente al uso y la intemperie.\n       */\n      !!@ ili2db.dispName = "Sin pavimentar"\n      Sin_Pavimentar,\n      /** Zona donde las vías realizadas no han sido revestidas por ningún material resistente al uso y la intemperie.\n       */\n      !!@ ili2db.dispName = "Peatonales"\n      Peatonales,\n      /** Aquellas zonas donde no se ha realizado el trazado de vías.\n       */\n      !!@ ili2db.dispName = "Sin vías"\n      Sin_Vias\n    );\n\n    AV_ServiciosPublicosTipo = (\n      /** Corresponde a las áreas dentro del perímetro urbano (cabecera y corregimientos) donde no existen servicios públicos básicos.\n       */\n      !!@ ili2db.dispName = "Sin servicios"\n      Sin_Servicios,\n      /** Aquella que carece de por lo menos uno de los servicios básicos. La existencia de otro tipo de servicios no mejora la condición en cuanto a servicios básicos.\n       */\n      !!@ ili2db.dispName = "Servicios básicos incompletos"\n      Servicios_Basicos_incompletos,\n      /** Se califica en aquellos sectores que cuentan con la prestación de los tres servicios básicos (acueducto, energía y alcantarillado), que cuente con la infraestructura para garantizar la prestación del servicio.\n       */\n      !!@ ili2db.dispName = "Servicios básicos completos"\n      Servicios_Basicos_Completos,\n      /** Sectores que además de contar con acueducto, energía y alcantarillado, poseen la prestación de uno, o más servicios adicionales tales como: teléfono, gas, alumbrado público, alcantarillado de aguas lluvias, etc.\n       */\n      !!@ ili2db.dispName = "Servicios básicos y complementarios"\n      Servicios_Basicos_Y_Complementarios\n    );\n\n    AV_TipificacionConstruccionTipo = (\n      /** Las viviendas que pertenecen a este grupo están construidas sin planeación alguna y generalmente con materiales de desecho tanto en las paredes como en los techos, construido o acondicionado para alojamiento, aunque no reúna las condiciones sanitarias indispensables. Generalmente carecen de algún servicio público básico y/o están ubicadas en zonas marginales no urbanizadas ni urbanizables, siendo de invasión y con escasez de vías de comunicación y transporte urbano.\n       */\n      !!@ ili2db.dispName = "Residencial 1 – (Bajo-Bajo)"\n      Residencial_1_Bajo_Bajo,\n      /** Las viviendas que pertenecen a este grupo están construidas con o sin planeación y generalmente con materiales como madera, prefabricado, ladrillo o bloque, cubiertas en zinc o teja de barro y con acabados sencillos, pueden disponer de algunos servicios públicos básicos, están situados por lo general en la periferia y disponen de algunas vías públicas sin pavimentar y escasos medios de transporte.\n       */\n      !!@ ili2db.dispName = "Residencial 2 – (Bajo)"\n      Residencial_2_Bajo,\n      /** Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones técnicamente planeadas, con fachadas calificadas como regular, con muros de ladrillo o bloque, cubiertas de placa de concreto o teja en asbesto cemento. Generalmente cuentan con servicios públicos básicos, poseen vías de comunicación pavimentadas y medio de transporte urbano.\n       */\n      !!@ ili2db.dispName = "Residencial 3 – (Medio-Bajo)"\n      Residencial_3_Medio_Bajo,\n      /** Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones técnicamente planeadas con fachada calificada de regular a buena, estructura en concreto, muros de ladrillo o bloque revocados, estucados y pintados, cubiertas de placa de concreto o teja en asbesto cemento; baños y cocinas calificados como medianos enchapados.\n       */\n      !!@ ili2db.dispName = "Residencial 4 – (Medio)"\n      Residencial_4_Medio,\n      /** Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones totalmente terminadas y técnicamente planeadas con fachada calificada como buena así como sus acabados, estructura en concreto. Generalmente cuentan con muros de ladrillo o bloque, cubiertas de placa de concreto o con materiales de buena calidad; baños y cocinas calificados como buenos y tamaño entre mediano y grande.\n       * Cuentan con todos los servicios públicos básicos y complementarios, con grandes zonas verdes, sociales y de recreación, parqueaderos y buenas vías de acceso.\n       */\n      !!@ ili2db.dispName = "Residencial 5 – (Medio-Alto)"\n      Residencial_5_Medio_Alto,\n      /** Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones con grandes áreas, amplios jardines o apartamentos lujosos, paredes de bloque o ladrillo, cubiertas de placa de concreto o con materiales de excelente calidad y cuentan con los servicios públicos básicos y complementarios.\n       * Estas viviendas están ubicadas en sectores exclusivos y disfrutan de amplias zonas verdes, sociales y de recreación, parqueaderos y excelentes vías de acceso.\n       */\n      !!@ ili2db.dispName = "Residencial 6 – (Alto)"\n      Residencial_6_Alto,\n      /** Corresponde a la venta de bienes y servicios de consumo doméstico requeridos por la comunidad de residentes en barrios. Presenta dos modalidades principales de desarrollo: en áreas o espacios de edificaciones residenciales que fueron destinadas al uso comercial sin adecuaciones físicas importantes, ni del espacio mismo, ni del resto de la vivienda que se mantiene como tal; en establecimientos situados en edificaciones multifamiliares, en manzanas o en locales comerciales de las urbanizaciones.\n       */\n      !!@ ili2db.dispName = "Comercial barrial"\n      Comercial_Barrial,\n      /** Corresponde al destinado a la venta de productos y/o servicios ubicados en un sector consolidado o en proceso de consolidación.\n       */\n      !!@ ili2db.dispName = "Comercial sectorial"\n      Comercial_Sectorial\n    );\n\n    AV_TipologiaTipo = (\n      !!@ ili2db.dispName = "Residencial"\n      Residencial(\n        /** Armazón: Madera; Muro: Material de desecho, esterilla; Cubierta material desecho, telas asfálticas; Pisos tierra pisada.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 1A"\n        Tipo_1A,\n        /** Armazón: Madera; Muro: Material de bahareque, adobe, tapia; Cubierta: Zinc, teja de barro, Eternit rustico; Pisos: Cemento, madera burda\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 1B"\n        Tipo_1B,\n        /** Armazón: Madera; Muros en madera; Cubierta: Zinc, teja de barro, Eternit rustico; Cubrimiento de Muros: Pañete, papel común, ladrillo presado; Pisos: Cemento, madera burda.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 2A"\n        Tipo_2A,\n        /** Armazón: Prefabricado; Muros: Concreto prefabricado; Cubierta: Zinc, teja de barro, Eternit rustico; cubrimiento de Muros: Pañete, papel común,  ladrillo  presado;  Pisos:  Baldosa común de cemento, Tablón ladrillo.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 2B"\n        Tipo_2B,\n        /** Armazón: Ladrillo, bloque; Muro: ladrillo, Bloque; Cubierta: Eternit o teja de barro; Cubrimiento de muros: Pañete, papel común, ladrillo prensado; Piso: Baldosa común de cemento, tablón ladrillo.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 3A"\n        Tipo_3A,\n        /** Armazón: Ladrillo, bloque; Muro: ladrillo, Bloque; Cubierta: Azotea, aluminio, placa sencilla con eternit o teja de barro; Cubrimiento muros: Estuco, cerámica, papel fino; Piso: Baldosa común de cemento, tablón ladrillo.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 3B"\n        Tipo_3B,\n        /** Armazón: Concreto hasta tres pisos, Muro: Bloque, ladrillo; Cubierta: Azotea, aluminio,\n         * placa sencilla con etnernit o teja de barro; Cubrimiento muro: estuco, cerámica, papel fino; Piso: Listón machi-embredo.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 4A"\n        Tipo_4A,\n        /** Armazón: Concreto hasta tres pisos, Muro: Bloque, Ladrillo; Cubierta: Azotea, aluminio,\n         * placa sencilla con etnernit o teja de barro; Cubrimiento muro: estuco, cerámica, papel fino; Piso: Tableta, caucho, acrilico, granito, baldosa fina.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 4B"\n        Tipo_4B,\n        /** Armazón: Concreto hasta tres pisos; Muro: Bloque, Ladrillo; Cubierta: Azote, Aluminio, placa sencilla con eternit o teja de barro; Cubrimiento muro: Medra, Piedra ornamental; Piso: Tableta, caucho, acrilico, granito, baldosa fina\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 5A"\n        Tipo_5A,\n        /** Armazón: Concreto cuadro y más pisos; Muro: Bloque, Ladrillo; Cubierta: Placa impermeabilizada cubierta lujosa u ornamental; Cubrimiento muro: Mármol, lujoso, otros; Piso: Parquet, alfombra, retal de mármol ( grano pequeño).\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 5B"\n        Tipo_5B,\n        /** Armazón: Concreto hasta tres pisos; Muro: Bloque, ladrillo; Cubierta: Placa impermeabilizada cubierta lujosa u ornamental; Cubrimientos muros: Mármol, lujosos otros; Piso: Parquet, alfombra, Retal de mármol ( grano pequeño).\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 6A"\n        Tipo_6A,\n        /** Armazón: Concreto cuatro o más pisos; Muro: Bloque, ladrillo; Cubierta: Placa impermeabilizada cubierta lujosa u ornamental; Cubrimientos muros: Mármol, lujosos otros; Piso: Retal de mármol, mármol, otros.\n         */\n        !!@ ili2db.dispName = "(Residencial) Tipo 6B"\n        Tipo_6B\n      ),\n      !!@ ili2db.dispName = "Comercial"\n      Comercial(\n        /** Armazón: Madera, prefabricado\n         * Muros: adobe, bahareque, tapia\n         * Cubierta: Zinc, material de desecho, telas asfálticas\n         * Fachada: Pobre\n         * Cubrimiento de Muros: Sin cubrimiento\n         * Pisos: tierra, cemento o madera burda.\n         */\n        !!@ ili2db.dispName = "(Comercial) Barrial 1"\n        Barrial_1,\n        /** Armazón: Ladrillo, bloque.\n         * Muros: Ladrillo y Bloque\n         * Cubierta: Zinc, Eternit o teja de barro\n         * Fachada: pobre o sencilla.\n         * Cubrimiento de Muros: Pañete, papel común, ladrillo prensado, estuco, cerámica\n         * Pisos: cemento Baldosa común de cemento, Tablón Ladrillo\n         */\n        !!@ ili2db.dispName = "(Comercial) Barrial 2"\n        Barrial_2,\n        /** Armazón: Madera, Ladrilló, Bloque\n         * Muros: Madera, Bloque, concreto prefabricado\n         * Cubierta: Eternit o teja de barro, Entrepiso, (cubierta provisional) Prefabricado\n         * \n         * Fachada: Regular.\n         * Cubrimiento de Muros: Pañete, papel común, pañete, ladrillo prensado\n         * Pisos: Concreto, Listón machi-ambrado, baldosa común.\n         */\n        !!@ ili2db.dispName = "(Comercial) Sectorial 1"\n        Sectorial_1,\n        /** Armazón: Concreto hasta 3 pisos.\n         * Muros: Bloque, ladrillo\n         * Cubierta: Eternit, teja de barro placa concreto\n         * Fachada: Buena.\n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, cerámica, papel fino\n         * \n         * Pisos: Tableta, caucho, acrílico, granito, baldosa fina\n         */\n        !!@ ili2db.dispName = "(Comercial) Sectorial 2"\n        Sectorial_2,\n        /** Armazón: Concreto hasta 3 pisos\n         * Muros: Concreto prefabricado, bloque o ladrillo\n         * Cubierta: Azotea, aluminio, placa sencilla con eternit o teja de barro\n         * Fachada: Buena.\n         * \n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, Madera, piedra ornamental\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\n         */\n        !!@ ili2db.dispName = "(Comercial) Especializado 1"\n        Especializado_1,\n        /** Armazón: Concreto 4 o más pisos\n         * Muros: Bloque ladrillo\n         * Cubierta: Placa Impermeabilizada cubierta lujosa u ornamental\n         * Fachada: Lujosa.\n         * Cubrimiento de Muros: Mármol, piedra ornamental Estucos especiales, otros lujosos\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\n         */\n        !!@ ili2db.dispName = "(Comercial) Especializado 2"\n        Especializado_2\n      ),\n      !!@ ili2db.dispName = "Industrial"\n      Industrial(\n        /** Armazón: Madera, prefabricado\n         * Muros: adobe, bahareque, tapia\n         * Cerchas: Madera\n         * Cubierta: Material de desecho, telas asfálticas\n         * \n         * Fachada: Pobre\n         * Cubrimiento de Muros:\n         * Sin cubrimiento\n         * Pisos: tierra, cemento o madera burda.\n         */\n        !!@ ili2db.dispName = "(Industrial) Liviana 1"\n        Liviana_1,\n        /** Armazón: Prefabricado, Ladrillo, bloque.\n         * Muros: Prefabricado, Ladrillo, bloque\n         * Cubierta: Zinc, Eternit o teja de barro\n         * Fachada: pobre o sencilla.\n         * \n         * Cubrimiento de Muros: Sin, Pañete, papel común, ladrillo prensado, estuco, cerámica\n         * Pisos: Cemento Baldosa común de cemento, Tablón Ladrillo.\n         */\n        !!@ ili2db.dispName = "(Industrial) Liviana 2"\n        Liviana_2,\n        /** Armazón: Muros confinados Ladrillo o bloque\n         * Muros: Ladrillo, bloque o concreto prefabricado\n         * Cubierta: Entrepiso\n         * (cubierta provisional ) Prefabricado, teja eternit\n         * Fachada: Regular.\n         * \n         * Cubrimiento de Muros: Pañete, papel común, pañete, ladrillo prensado\n         * Pisos: Concreto, Listón machi-ambrado, baldosa común.\n         */\n        !!@ ili2db.dispName = "(Industrial) Mediana 1"\n        Mediana_1,\n        /** Armazón: Concreto hasta 3 pisos.\n         * Muros: Bloque, ladrillo\n         * Cubierta: teja eternit, termo acústica o teja de barro\n         * Fachada: Buena.\n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, cerámica, papel fino\n         * Pisos: Tableta, caucho, acrílico, granito, baldosa fina\n         */\n        !!@ ili2db.dispName = "(Industrial) Mediana 2"\n        Mediana_2,\n        /** Armazón: Concreto hasta 3 pisos\n         * Muros: Concreto prefabricado, bloque o ladrillo\n         * Cubierta: Azotea, aluminio, placa sencilla con eternit o teja de barro\n         * Fachada: Buena.\n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, Madera, piedra ornamental\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\n         */\n        !!@ ili2db.dispName = "(Industrial) Pesada 1"\n        Pesada_1,\n        /** Armazón: Concreto 4 o más pisos\n         * Muros: Bloque ladrillo\n         * Cubierta: Placa Impermeabilizada cubierta lujosa u ornamental\n         * Fachada: Lujosa.\n         * Cubrimiento de Muros: Mármol, piedra ornamental Estucos especiales, otros lujosos\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\n         */\n        !!@ ili2db.dispName = "(Industrial) Pesada 2"\n        Pesada_2\n      ),\n      !!@ ili2db.dispName = "Anexo"\n      Anexo(\n        !!@ ili2db.dispName = "Enramadas o cobertizos o caneyes"\n        Enramadas_Cobertizos_Caneyes(\n          /** Locales de venta de vehículos: Estructura concreto, cubierta cercha metálica y teja canaleta; fachada vidrio y polarizado, piso baldosín conservación general buena.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Enramadas o cobertizos o caneyes) Tipo 90"\n          Tipo_90,\n          /** Estructura metálica; cubierta de zinc, eternit o teja de barro, pisos de cemento, conservación general buena.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Enramadas o cobertizos o caneyes) Tipo 80"\n          Tipo_80,\n          /** Estructura en madera fina; cubierta de zinc, eternit o teja de barro pisos de cemento; conservación general buena a regular.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Enramadas o cobertizos o caneyes) Tipo 60"\n          Tipo_60,\n          /** Estructura en madera común; cubierta de zinc, eternit o teja de barro; pisos en tierra; conservación regular a mala.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Enramadas o cobertizos o caneyes) Tipo 40"\n          Tipo_40\n        ),\n        !!@ ili2db.dispName = "Galpones o gallineros"\n        Galpones_Gallineros(\n          /** Estructura metálica o madera fina, cubierta de zinc, eternit o teja de barro; muros a mediana altura en bloque o ladrillo; pisos de cemento; conservación general buena.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Galpones o gallineros) Tipo 80"\n          Tipo_80,\n          /** Estructura ladrillo o bloque; cubierta de zinc, eternit o teja de barro semi muros en bloque o ladrillo; pisos de cemento; conservación general buena a regular.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Galpones o gallineros) Tipo 60"\n          Tipo_60,\n          /** Estructura en ladrillo, bloque o madera sencilla; cubierta de zinc, eternit o teja de barro; con o sin muros; pisos en tierra; conservación regular a mala.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Galpones o gallineros) Tipo 40"\n          Tipo_40,\n          /** Estructura en madera; cubierta de zinc, eternit, teja de barro, paja o material de desecho; con o sin muros; pisos en tierra; conservación regular o mala.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Galpones o gallineros) Tipo 20"\n          Tipo_20\n        ),\n        !!@ ili2db.dispName = "Establos o pesebreras"\n        Establos_Pesebreras(\n          /** Estructura metálica o de concreto; cubierta de zinc, eternit a teja de barro muros en bloque o ladrillo, pisos de cemento, conservación en general buena.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Establos o pesebreras) Tipo 80"\n          Tipo_80,\n          /** Estructura en bloque, ladrillo o madera fina; cubierta de zinc, eternit o teja de barro muros en bloque o ladrillo, pisos de cemento, conservación en general buena o regular\n           */\n          !!@ ili2db.dispName = "(Anexo) (Establos o pesebreras) Tipo 60"\n          Tipo_60,\n          /** Estructura en ladrillo cubierta  de  zinc,  eternit  o  teja  de  barro  muros de ladrillo, pisos en tierra, conservación regular a mala.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Establos o pesebreras) Tipo 40"\n          Tipo_40,\n          /** Estructura en madera cubierta de  zinc,  eternit  o  teja  de  barro  muros en madera, pisos en tierra, conservación regular a mala.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Establos o pesebreras) Tipo 20"\n          Tipo_20\n        ),\n        !!@ ili2db.dispName = "Cocheras o marraneras o porquerizas"\n        Cocheras_Marraneras_Porquerizas(\n          /** Estructura concreto; cubierta de zinc, eternit o teja de barro, muros en bloque o ladrillo, pisos en cemento o baldosa, conservación general buena.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Cocheras o marraneras o porquerizas) Tipo 80"\n          Tipo_80,\n          /** Estructura en ladrillo o bloque, cubierta de zinc, eternit o teja de barro, semi muros en bloque o ladrillo, pisos en cemento o baldosa conservación general buena a regular.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Cocheras o marraneras o porquerizas) Tipo 60"\n          Tipo_60,\n          /** Estructura en ladrillo; cubierta de zinc, eternit o teja de barro; con muros o sin muros; pisos en tierra; conservación regular a mala.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Cocheras o marraneras o porquerizas) Tipo 40"\n          Tipo_40,\n          /** Estructura en madera; cubierta de zinc, eternit o teja de barro con o sin muros, pisos en tierra, conservación regular a mala.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Cocheras o marraneras o porquerizas) Tipo 20"\n          Tipo_20\n        ),\n        !!@ ili2db.dispName = "Silos"\n        Silos(\n          /** Estructura en ferroconcreto metálica\n           */\n          !!@ ili2db.dispName = "(Anexo) (Silos) Tipo 80"\n          Tipo_80,\n          /** Estructura en concreto\n           */\n          !!@ ili2db.dispName = "(Anexo) (Silos) Tipo 60"\n          Tipo_60\n        ),\n        !!@ ili2db.dispName = "Piscina"\n        Piscinas(\n          /** Piscinas olímpicas, con sistemas de purificación e iluminación; enchape en azulejo fino, trampolín a diferentes alturas. Se encuentra comúnmente en clubes y coliseos.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Piscina) Tipo 80"\n          Tipo_80,\n          /** Piscinas semi olímpicas, con sistemas de purificación; enchape en azulejo fino, comunes en clubes y centros de recreación\n           */\n          !!@ ili2db.dispName = "(Anexo) (Piscina) Tipo 60"\n          Tipo_60,\n          /** Piscinas de tamaño mediano, enchape en azulejo, sistemas de purificación rudimentaria, comunes en fincas de recreo o centros de recreación.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Piscina) Tipo 50"\n          Tipo_50,\n          /** Piscinas pequeña, cubierta en baldosín o cemento. Comunes en fincas o casas de campo\n           */\n          !!@ ili2db.dispName = "(Anexo) (Piscina) Tipo 40"\n          Tipo_40\n        ),\n        !!@ ili2db.dispName = "Tanques"\n        Tanques(\n          /** Tanques que por su capacidad y/b altura requieren estructura en ferroconcreto con revestimiento, encontrándose en buen estado de conservación.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Tanques) Tipo 80"\n          Tipo_80,\n          /** Tanques de mediana capacidad con estructura metálica con altura o profundidad no superior a 10 metros; en buen estado de conservación.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Tanques) Tipo 60"\n          Tipo_60,\n          /** Tanques pequeños con estructura en ladrillo o bloque revestido en cemento con altura no mayor a 3 metros o poca profundidad; conservación buena a regular\n           */\n          !!@ ili2db.dispName = "(Anexo) (Tanques) Tipo 40"\n          Tipo_40,\n          /** Tanques con altura menor a 3 metros o poca profundidad; estructura en ladrillo conservación regular a mala.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Tanques) Tipo 20"\n          Tipo_20\n        ),\n        !!@ ili2db.dispName = "Beneficiaderos"\n        Beneficiaderos(\n          /** Estructura en ladrillo o bloque; cubierta en zinc, teja de barro o eternit rustico; pisos en cemento, con tanques lavadores y serpentina o canal de carreteo y silo o patio quindiano incorporado estado de conservación bueno a regular.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Beneficiaderos) Tipo 80"\n          Tipo_80,\n          /** Estructura en madera; muros en ladrillos o bloque; cubierta en zinc, teja de barro o eternit; existencia de tanques y/o silos; pisos en cemento estado de conservación bueno a regular.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Beneficiaderos) Tipo 60"\n          Tipo_60,\n          /** Beneficiaderos construidos en materiales económicos (bareque, tapia) pisos en tierra conservación regular a mala; se encuentran en este tipo los elementos apenas necesarios: tanques, despulpaderos, canales, etc. en condiciones rudimentarias, comunes en fincas minifundistas.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Beneficiaderos) Tipo 40"\n          Tipo_40\n        ),\n        !!@ ili2db.dispName = "Secaderos"\n        Secaderos(\n          /** Estructura metálica y cercha de madera o metálica muros medianos o totales en ladrillo marquesina de vidrio; pisos en cemento; estado de conservación buena.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Secaderos) Tipo 80"\n          Tipo_80,\n          /** Estructura en ladrillo; pisos en cemento; oreador en madera con sistema de rodamiento; buen estado de conservación.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Secaderos) Tipo 60"\n          Tipo_60,\n          /** Estructura en madera pisos en tierra oreador con especificaciones mínimas; estado de conservación regular a mala. Dentro de este tipo se consideran as condiciones de los tipos anteriores, que se encuentran en regular a mal estado de conservación\n           */\n          !!@ ili2db.dispName = "(Anexo) (Secaderos) Tipo 40"\n          Tipo_40\n        ),\n        !!@ ili2db.dispName = "Kioskos"\n        Kioscos(\n          /** Estructura en bloque o ladrillo cubierta en zinc, teja de barro o paja; estado de conservación general bueno.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Kioskos) Tipo 80"\n          Tipo_80,\n          /** Estructura metálica; todo tipo de cubiertas; piso en cemento; estado de conservación bueno a regular\n           */\n          !!@ ili2db.dispName = "(Anexo) (Kioskos) Tipo 60"\n          Tipo_60,\n          /** Estructura en madera fina; todo tipo de cubiertas; piso en cemento; estado de conservación bueno a regular.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Kioskos) Tipo 40"\n          Tipo_40,\n          /** Estructura en madera común; cubierta en zinc, paja o teja de barro piso en tierra estado de conservación regular a mala.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Kioskos) Tipo 20"\n          Tipo_20\n        ),\n        !!@ ili2db.dispName = "Albercas o bañaderas"\n        Albercas_Baniaderas(\n          /** Estructura en concreto; cubierta en zinc, eternit o teja de barro; piso en cemento; conservación buena a regular.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Albercas o bañaderas) Tipo 80"\n          Tipo_80,\n          /** Estructura en ladrillo; cubierta en zinc, eternit o teja de barro; piso  en cemento; conservación buena a regular.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Albercas o bañaderas) Tipo 60"\n          Tipo_60,\n          /** Estructura en madera; cubierta en zinc, eternit o teja de barro; piso en cemento; conservación regular a mala. Se incluyen en este tipo las condiciones dadas en los anteriores en mal estado de conservación.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Albercas o bañaderas) Tipo 40"\n          Tipo_40\n        ),\n        !!@ ili2db.dispName = "Corrales"\n        Corrales(\n          /** Estructura metálica o de madera aserrada, formado por cuatro varales, pisos en cemento y conservación buena.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Corrales) Tipo 80"\n          Tipo_80,\n          /** Estructura en madera aserrada, formado por tres varales, pisos en cemento y conservación general buena.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Corrales) Tipo 60"\n          Tipo_60,\n          /** Estructura en madera aserrada, formado por tres varales, pisos en tierra y conservación general regular a mala.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Corrales) Tipo 40"\n          Tipo_40,\n          /** Estructura en madera burda, pisos en tierra y conservación general regular a mala\n           */\n          !!@ ili2db.dispName = "(Anexo) (Corrales) Tipo 20"\n          Tipo_20\n        ),\n        !!@ ili2db.dispName = "Pozos"\n        Pozos(\n          /** Pozo de profundidad aproximada a 40 m, revestido en concreto, con tubería, anillado 100% , diámetro pozo de 2m\n           */\n          !!@ ili2db.dispName = "(Anexo) (Pozos) Tipo 80"\n          Tipo_80,\n          /** Pozo de profundidad aproximada 20 m, revestido en concreto, con tubería, anillado 100 % , diámetro pozo < 2m\n           */\n          !!@ ili2db.dispName = "(Anexo) (Pozos) Tipo 60"\n          Tipo_60,\n          /** Pozo profundidad < a 10m, sin revestimiento ni anillar, diámetro pozo de 2m\n           */\n          !!@ ili2db.dispName = "(Anexo) (Pozos) Tipo 40"\n          Tipo_40\n        ),\n        /** Estructura en concreto y tanque en concreto, fibrocemento o metálico con recubrimiento interior en resinas de poliéster reforzadas con fibra de vidrio, partes metálicas en acero inoxidable o galvanizadas buen estado de conservación\n         */\n        !!@ ili2db.dispName = "(Anexo) (Torres de enfriamiento)"\n        Torres_Enfriamiento,\n        !!@ ili2db.dispName = "Muelles"\n        Muelles(\n          /** Muelle, estructura en concreto, piso en madera deck para exteriores\n           */\n          !!@ ili2db.dispName = "(Anexo) (Muelles) Tipo 80"\n          Tipo_80,\n          /** Muelle, estructura y piso en concreto\n           */\n          !!@ ili2db.dispName = "(Anexo) (Muelles) Tipo 60"\n          Tipo_60,\n          /** Muelle, estructura y, piso en madera.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Muelles) Tipo 40"\n          Tipo_40\n        ),\n        !!@ ili2db.dispName = "Canchas de tenis"\n        Canchas_Tenis(\n          /** En polvo de ladrillo\n           */\n          !!@ ili2db.dispName = "(Anexo) (Canchas de tenis) Tipo 20"\n          Tipo_20,\n          /** Cemento y/o asfalto.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Canchas de tenis) Tipo 10"\n          Tipo_10\n        ),\n        !!@ ili2db.dispName = "Toboganes"\n        Toboganes(\n          /** Altura entre 9 y 15 Mts., longitud de canal entre 75 y 120 Mts. Fibra de vidrio. Estructura de concreto o metálica. Incluye piscina de Llegada. Sistema de bombeo, purificación.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Toboganes) Tipo 80"\n          Tipo_80,\n          /** Altura entre 3 y 9 Mts., longitud 25 a 75 Mts. Estructura y soportes en concreto o metálica. Incluye piscina de acceso y sistema de bombeo y purificación.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Toboganes) Tipo 60"\n          Tipo_60,\n          /** Altura de 6 a 9 Mts. Únicamente deslizadero de velocidad de longitud de 20 a 40 Mts. Equipo de bombeo y purificación. Estructura metálica o concreto; piscina de acceso.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Toboganes) Tipo 50"\n          Tipo_50,\n          /** Altura de 3 a 5 Mts. Únicamente deslizadero; longitud de 10 a 20 Mts. No tienen planta de tratamiento ni de bombeo.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Toboganes) Tipo 40"\n          Tipo_40\n        ),\n        !!@ ili2db.dispName = "Marquesinas"\n        Marquesinas(\n          /** Estructura metálica; cubierta cristalita o vidrio; piso en baldosa fina.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Marquesinas) Tipo 80"\n          Tipo_80,\n          /** Estructura metálica; cubierta en cristalita o vidrio; piso en baldosa común.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Marquesinas) Tipo 60"\n          Tipo_60,\n          /** Estructura metálica; cubierta de eternit y piso en cemento.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Marquesinas) Tipo 40"\n          Tipo_40,\n          /** Estructura en madera; cubierta de zinc o eternit; Piso en baldosín o cemento.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Marquesinas) Tipo 20"\n          Tipo_20\n        ),\n        !!@ ili2db.dispName = "Estadios o coliseos"\n        Estadios_Coliseos(\n          /** Estadio, estructura en concreto reforzado, graderías, con o sin cubierta parcial, capacidad mayor a 8.000 personas\n           */\n          !!@ ili2db.dispName = "(Anexo) (Estadios o coliseos) Tipo 80"\n          Tipo_80,\n          /** Coliseo, incluye cerramiento en malla, cancha multifuncional, con camerino y gradería, cubierta en teja termo acústica y gradería\n           */\n          !!@ ili2db.dispName = "(Anexo) (Estadios o coliseos) Tipo 60"\n          Tipo_60,\n          /** Coliseo, incluye cerramiento en malla, o en bloque pañetado cancha multifuncional, cubierta en teja termo acústica\n           */\n          !!@ ili2db.dispName = "(Anexo) (Estadios o coliseos) Tipo 40"\n          Tipo_40\n        ),\n        !!@ ili2db.dispName = "Plaza de toros"\n        Plazas_de_Toros(\n          /** Plaza de toros con estructura en concreto y madera capacidad de más de 10000 espectadores\n           */\n          !!@ ili2db.dispName = "(Anexo) (Plaza de toros) Tipo 80"\n          Tipo_80,\n          /** Plaza de toros para corralejas, estructura en madera capacidad menor a 4000 estructura en concreto y madera capacidad\n           */\n          !!@ ili2db.dispName = "(Anexo) (Plaza de toros) Tipo 20"\n          Tipo_20\n        ),\n        !!@ ili2db.dispName = "Vía férrea"\n        Via_Ferrea(\n          /** Via férrea de trocha  normal o estándar (4 pies, 8 1/2 pulgadas o 1435 metros) con capacidad de transporte mayor a 50 toneladas, conformada por una capa de balasto, sobre la cual se disponen traviesas de madera que soportan los rieles, entiéndase como trocha a la distancia mínima entre los dos rieles.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Vía férrea) Tipo 80"\n          Tipo_80,\n          /** Via férrea de trocha angosta o yardica de 0.915 metros con capacidad menor a 50 toneladas, conformada por una capa de balasto, sobre la cual se disponen traviesas de madera que soportan los rieles, entiéndase como trocha a la distancia mínima entre los dos rieles.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Vía férrea) Tipo 60"\n          Tipo_60\n        ),\n        !!@ ili2db.dispName = "Carreteras"\n        Carreteras(\n          /** Carretera pavimentada. Compuesta de una subbase granular, base en suelo cemento y carpeta asfáltica, entiéndase por sub-base granular como la capa de material granular situada entre la base del firme y la explanada.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Carreteras) Tipo 60"\n          Tipo_60,\n          /** Carretera sin pavimento. Compuesta de una sub-base granular, entiéndase por su-base granular como la capa de material granular situada entre la base del firme y la explanada.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Carreteras) Tipo 40"\n          Tipo_40\n        ),\n        !!@ ili2db.dispName = "Cimientos estructura muros placabase"\n        Cimientos_Estructura_Muros_Placabase(\n          /** Cimientos y estructura soportes verticales (columnas) y horizontales (vigas) destinados a sostener la totalidad o parte de la futura construcción o edificación, acompañados de muros y placas base. Esta tipología se caracteriza por presentar de manera simultánea los 4 elementos (Cimientos, Estructura, Muro o Pared y Losa de Contra piso)\n           */\n          !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 80"\n          Tipo_80,\n          /** Cimentación y estructura con soportes verticales (columnas) y horizontales (vigas) destinados a sostener la totalidad o parte de la futura construcción o edificación, acompañados de muros o placas base. Esta tipología se caracteriza por presentar de manera simultánea 3 elementos (Cimientos, Estructura, y alguno de estos dos elementos Muro Pared o Losa en Contra piso)\n           */\n          !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 60"\n          Tipo_60,\n          /** Cimentación sin estructura destinada a sostener la totalidad o parte de una futura construcción o edificación, pueden estar acompañados de muros o placas base. Esta tipología se caracteriza por presentar de manera simultánea 2 elementos (Cimientos y alguno de estos dos elemetnos Muro - Pared o Losa de Contra piso)\n           */\n          !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 40"\n          Tipo_40,\n          /** Cimentación sin estructura, destinada a sostener la totalidad o parte de una futura construcción o edificación. Esta tipología se caracteriza por presentar un solo elemento, la cimentación.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 20"\n          Tipo_20\n        ),\n        !!@ ili2db.dispName = "Lagunas de oxidación"\n        Lagunas_de_Oxidacion(\n          /** Lagunas de oxidación que en su construcción requieren excavaciones en la estructura de la laguna, con o sin protección del área de la laguna con geotextil o geomembrana, construcción de diques, protección de los taludes con geotextil o geomembrana y enrocado de taludes.\n           */\n          !!@ ili2db.dispName = "(Anexo) (Lagunas de oxidación) Tipo 20"\n          Tipo_20\n        )\n      ),\n      !!@ ili2db.dispName = "Otro"\n      Otro\n    );\n\n    AV_TopografiaZonaTipo = (\n      /** Facilita suministrar servicios públicos, realizar obras de urbanismo o construir una edificación.\n       */\n      !!@ ili2db.dispName = "Plano"\n      Plano,\n      /** Las construcciones ubicadas dentro de esta zona han tenido una mayor dificultad para ser construidas.\n       */\n      !!@ ili2db.dispName = "Inclinado"\n      Inclinado,\n      /** Se presenta máxima dificultad para el suministro de servicios públicos, edificar, etc. generando altos costos.\n       */\n      !!@ ili2db.dispName = "Empinado"\n      Empinado\n    );\n\n    AV_UsoSueloRuralTipo = (\n      /** Comprende la agrupación de edificaciones de tipo habitacional, industrial, comercial e institucional que no estén consideradas dentro del plan de ordenamiento territorial como parte de la zona urbana ej. Caseríos, zonas industriales, universidades.\n       */\n      !!@ ili2db.dispName = "Edificios"\n      Edificios,\n      /** Comprende construcciones de otro tipo diferente a edificios por su tamaño o actividad ej, represas, aeropuertos, centrales hidroeléctricas, estadios, plazas de toros, bases militares.\n       */\n      !!@ ili2db.dispName = "Otras construcciones"\n      Otras_Construcciones,\n      /** Son áreas naturales definidas y delimitadas oficialmente poco transformadas por la explotación u ocupación humana que, en razón a la belleza de sus paisajes, la representatividad de sus ecosistemas o la singularidad de su flora, de su fauna o de sus formaciones geomorfológicas, poseen unos valores ecológicos, estéticos, educativos y científicos cuya conservación merece una atención preferente.\n       */\n      !!@ ili2db.dispName = "Parques naturales"\n      Parques_Naturales,\n      /** Aquellos cultivos tales como café, palma africana, palma africana, palma de coco, caucho, cítricos, arboles maderables, aguacate, guayabo, mango, manzano, pera, durazno, uva, noli, fique, cacao y cualquier otro cultivo que exija un periodo superior a tres años entre su siembre y su cosecha, o cuyo periodo de producción se prolongue por mas de cinco años.\n       */\n      !!@ ili2db.dispName = "Cultivos de carácter permanente"\n      Cultivos_De_Caracter_Permanente,\n      /** Aquellas tierras que para su producción cuentan con aplicación de agua, que de suyo falta para el desarrollo del cultivo, mediante la utilización de un sistema de irrigación.\n       */\n      !!@ ili2db.dispName = "Tierras de labor irrigadas"\n      Tierras_De_Labor_Irrigadas,\n      /** Aquellas tierras que carecen de un sistema de irrigación y que para su producción dependen exclusivamente del agua lluvia ciada sobre ellas.\n       */\n      !!@ ili2db.dispName = "Tierras de labor no irrigadas"\n      Tierras_De_Labor_No_Irrigadas,\n      /** Aquellas tierras en donde predominen las plantaciones espontaneas de arbustos que obstaculizan la utilización económica del suelo.\n       */\n      !!@ ili2db.dispName = "Tierras con maleza"\n      Tierras_Con_Maleza,\n      /** Aquellas áreas que por sus condiciones topográficas, climatológicas y que en general por las características físicas o químicas de sus suelos no puedan ser explotadas.\n       */\n      !!@ ili2db.dispName = "Tierras improductivas"\n      Tierras_Improductivas,\n      /** Conjuntos de herbáceos forrajeros producidos espontáneamente por el suelo.\n       */\n      !!@ ili2db.dispName = "Pastos naturales"\n      Pastos_Naturales,\n      /** Conjunto de cultivos herbáceos forrajeros no producidos espontáneamente.\n       */\n      !!@ ili2db.dispName = "Pastos artificiales"\n      Pastos_Artificales,\n      /** Pastos naturales sometidos a prácticas técnicas de uso y manejo\n       */\n      !!@ ili2db.dispName = "Pastos naturales mejorados"\n      Pastos_Naturales_Mejorados,\n      /** Conjunto de plantaciones naturales o de cultivos de arboles de igual o distinta naturaleza que están en explotación o pueden ser explotados.\n       */\n      !!@ ili2db.dispName = "Bosques"\n      Bosques,\n      /** Terrenos extensos, incultos y abundantemente poblados con vegetación arbórea y nativa.\n       */\n      !!@ ili2db.dispName = "Selvas vírgenes"\n      Selvas_Virgenes,\n      /** Comprende aquellas área cubiertas de agua con carácter permanente que puede ser de origen natural o artificial.\n       */\n      !!@ ili2db.dispName = "Cuerpos de agua"\n      Cuerpos_De_Agua,\n      /** Comprende aquellas edificaciones que por sus características especiales por actividad son diferentes a las anteriores ej. Condominios, parcelaciones, parques recreacionales.\n       */\n      !!@ ili2db.dispName = "Condiciones especiales"\n      Condiciones_Especiales,\n      /** Al clasificar usos mixtos, se agrupan máximo 2 tipos de uso que son de difícil separación por la escala de mapeo, considérelos como, una unidad miscelánea pero destaque el uso dominante designándolo con un número fraccionario en que el numerador sea el elemento dominante\n       */\n      !!@ ili2db.dispName = "Mixto"\n      Mixto\n    );\n\n    AV_UsoSueloUrbanoTipo = (\n      /** Es aquel espacio geográfico dedicado a la vivienda, de tipo unifamiliar o multifamiliar.\n       */\n      !!@ ili2db.dispName = "Residencial"\n      Residencial,\n      /** Es aquel espacio geográfico dedicado a la venta de mercancías (almacenes, centros comerciales, aeropuerto, etc.) y de servicios (oficinas, hoteles, restaurantes, bancos, consultorios, etc.). Se incluyen corredores comerciales en barrios residenciales.\n       */\n      !!@ ili2db.dispName = "Comercial"\n      Comercial,\n      /** Es aquel espacio geográfico dedicado a la transformación de materia prima en mercancías y a la reparación de maquinaria y equipos, con las características propias de una industria (Altura mayor de 2.50 mts, columnas, vigas perimetrales, cerchas, existencia puente grúas, Luces mayores de 6 mts). Incluye zonas de almacenamiento y zonas francas portuarias y aeroportuarias.\n       */\n      !!@ ili2db.dispName = "Industrial"\n      Industrial,\n      /** Es aquel espacio geográfico dedicado a la administración y prestación de servicios del estado (hospitales, colegios, alcaldía, canchas deportivas, etc.) y que no se encuentra clasificado en otros usos.\n       */\n      !!@ ili2db.dispName = "Institucional"\n      Institucional,\n      /** Es aquel espacio geográfico no construido que puede contar o no con algún tipo de obra de urbanismo. Dentro de esta clasificación se incluirán los cuerpos de agua, los cuales se consideran como lotes no urbanizables.\n       */\n      !!@ ili2db.dispName = "Lote"\n      Lote\n    );\n\n    AV_UsoUConsTipo = (\n      !!@ ili2db.dispName = "Residencial"\n      Residencial(\n        /** Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos sometido en régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Residencial) Apartamentos 4 y más pisos en PH"\n        Apartamentos_4_y_mas_pisos_en_PH,\n        /** Es una vivienda que comprende una o más habitaciones, en un edificio de 4 o 5 pisos.\n         */\n        !!@ ili2db.dispName = "(Residencial) Apartamentos en Edificio de 4 y 5 Pisos (Cartagena)"\n        Apartamentos_En_Edificio_4_y_5_Pisos_Cartagena,\n        /** Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos\n         */\n        !!@ ili2db.dispName = "(Residencial) Apartamentos mas de 4 Pisos"\n        Apartamentos_Mas_De_4_Pisos,\n        /** Dormitorios de las fuerzas armadas y militares\n         */\n        !!@ ili2db.dispName = "(Residencial) Barracas"\n        Barracas,\n        /** Típica casa con mampostería de piedra, pizarra y madera. Ha sido rehabilitada respetando escrupulosamente sus características exteriores y decorada con un interior tradicional\n         */\n        !!@ ili2db.dispName = "(Residencial) Casa Elbas"\n        Casa_Elbas,\n        /** Edificación destinada al almacenamiento o resguardo de enceres, generalmente ubicados en los sótanos y semisótanos de los edificios, junto a los parqueaderos. Las áreas de estos depósitos generalmente no supera los 25 metros cuadrados.\n         */\n        !!@ ili2db.dispName = "(Residencial) Depósitos o lockers"\n        Depositos_Lockers,\n        /** Es el lugar cubierto, destinado al estacionamiento privado de vehículos.\n         */\n        !!@ ili2db.dispName = "(Residencial) Garajes Cubiertos"\n        Garajes_Cubiertos,\n        /** Es el lugar cubierto, destinado al estacionamiento privado o comunal en viviendas sometidas a régimen de propiedad  horizontal.\n         */\n        !!@ ili2db.dispName = "(Residencial) Garajes en PH"\n        Garajes_En_PH,\n        /** Los salones comunales son dependencias que se construyen dentro de los edificios y conjuntos que sobrepasan un área determinada de construcción, y se clasifican de acuerdo a las normas urbanísticas como equipamiento comunal privado.\n         */\n        !!@ ili2db.dispName = "(Residencial) Salón comunal"\n        Salon_Comunal,\n        /** Bien inmueble cubierto o descubierto ubicado en el último piso de algunos edificios utilizado para extender y secar la ropa y que está sometido a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Residencial) Secadero de ropa"\n        Secadero_Ropa,\n        /** Son las viviendas construidas durante el tiempo de la colonia española, se caracterizan por tener varias habitaciones, con ventanales que dan a uno o dos patios generalmente ubicados en el centro de la vivienda. Los principales materiales de la época era la tapia, bahareque, ladrillo, paja y teja.\n         */\n        !!@ ili2db.dispName = "(Residencial) Vivienda Colonial"\n        Vivienda_Colonial,\n        /** Es una casa de tres niveles cuya función arquitectónica y ambiental principal, es dar albergue en forma adecuada a una familia.\n         */\n        !!@ ili2db.dispName = "(Residencial) Vivienda hasta 3 pisos"\n        Vivienda_Hasta_3_Pisos,\n        /** Corresponde a edificaciones residenciales desarrolladas sobre un lote de terreno que comprende más de tres unidades prediales independientes, generalmente en edificios de varios pisos. Este tipo de vivienda prevé? áreas de servicios comunales cuya propiedad y utilización privada se definen en reglamentos de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Residencial) Vivienda hasta 3 pisos en PH"\n        Vivienda_Hasta_3_Pisos_En_PH,\n        /** Es una vivienda acondicionada para la realización de actividades recreativas libres y el descanso.\n         */\n        !!@ ili2db.dispName = "(Residencial) Vivienda Recreacional"\n        Vivienda_Recreacional,\n        /** Es una casa cuya función arquitectónica y ambiental principal, es brindar descanso y recreación. Este tipo de vivienda  prevé? áreas de servicios comunales cuya propiedad y utilización privada se definen en reglamentos de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Residencial) Vivienda Recreacional en PH"\n        Vivienda_Recreacional_En_PH\n      ),\n      !!@ ili2db.dispName = "Comercial"\n      Comercial(\n        /** Es el espacio construido para la ejecución la recepción, almacenamiento y movimientos de materiales, materias primas y productos semielaborados, hasta el punto de consumo por un cliente externo o interno\n         */\n        !!@ ili2db.dispName = "(Comercial) Bodegas Comerciales - Grandes Almacenes"\n        Bodegas_Comerciales_Grandes_Almacenes,\n        /** Es el espacio construido para la ejecución la recepción, almacenamiento y movimientos de materiales, materias primas y productos semielaborados, hasta el punto de consumo por un cliente externo o interno sometido a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Comercial) Bodegas Comerciales en PH"\n        Bodegas_Comerciales_en_PH,\n        /** es una construcción que consta de uno o varios edificios, por lo general de gran tamaño, que albergan servicios, locales y oficinas comerciales aglutinados en un espacio determinado concentrando mayor cantidad de clientes potenciales dentro del recinto.\n         */\n        !!@ ili2db.dispName = "(Comercial) Centros Comerciales"\n        Centros_Comerciales,\n        /** Es una construcción que consta de uno o varios edificios, por lo general de gran tamaño, que albergan servicios, locales y oficinas comerciales aglutinados en un espacio determinado concentrando mayor cantidad de clientes potenciales dentro del recinto, sometido a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Comercial) Centros Comerciales en PH"\n        Centros_Comerciales_en_PH,\n        /** Es la edificación o  Establecimiento que brinda servicios recreativos y tiene capacidad para ciertos juegos de azar\n         */\n        !!@ ili2db.dispName = "(Comercial) Clubes - Casinos"\n        Clubes_Casinos,\n        /** Se denomina a la construcción en la cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes\n         */\n        !!@ ili2db.dispName = "(Comercial) Comercio"\n        Comercio,\n        /** Se denomina a la construcción con características arquitectónicas coloniales,  en el cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes\n         */\n        !!@ ili2db.dispName = "(Comercial) Comercio Colonial"\n        Comercio_Colonial,\n        /** Se denomina a la construcción en la cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes sometida a régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Comercial) Comercio en PH"\n        Comercio_en_PH,\n        /** Establecimiento que ocupa un edificio total o parcialmente con uso exclusivo de sus servicios (entradas, ascensores, escaleras, etc.) y que ofrece alojamiento y posee características arquitectónicas coloniales.\n         */\n        !!@ ili2db.dispName = "(Comercial) Hotel Colonial"\n        Hotel_Colonial,\n        /** Establecimiento que ocupa un edificio total o parcialmente con uso exclusivo de sus servicios (entradas, ascensores, escaleras, etc.) y que ofrece alojamiento\n         */\n        !!@ ili2db.dispName = "(Comercial) Hoteles"\n        Hoteles,\n        /** Establecimiento que ocupa un edificio total o parcialmente que ofrece alojamiento\n         */\n        !!@ ili2db.dispName = "(Comercial) Hoteles en PH"\n        Hoteles_en_PH,\n        /** Espacio construido en el que se  realiza un trabajo profesional de gestión, administración o atención médica\n         */\n        !!@ ili2db.dispName = "(Comercial) Oficinas - Consultorios"\n        Oficinas_Consultorios,\n        /** Espacio construido con características arquitectónicas coloniales en el que se  realiza un trabajo profesional de gestión, administración o atención médica\n         */\n        !!@ ili2db.dispName = "(Comercial) Oficinas - Consultorios Coloniales"\n        Oficinas_Consultorios_Coloniales,\n        /** espacio construido en el que se  realiza un trabajo profesional de gestión, administración o atención médica, sometida a régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Comercial) Oficinas Consultorios en PH"\n        Oficinas_Consultorios_en_PH,\n        /** Construcciones dedicadas al esparcimiento y a la diversión, generalmente son predios con grandes espacios, ejemplo parque el salitre.\n         */\n        !!@ ili2db.dispName = "(Comercial) Parque de diversiones"\n        Parque_Diversiones,\n        /** Es el espacio que con ánimo de lucro se destina a guardar o arrendar espacios para depositar vehículos dentro de una edificación construida para tal fin, o dentro de un predio habilitado con el mismo objeto.\n         */\n        !!@ ili2db.dispName = "(Comercial) Parqueaderos"\n        Parqueaderos,\n        /** Es el espacio o se destina a guardar o arrendar espacios para depositar vehículos dentro de una edificación construida privado o comunal bajo régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Comercial) Parqueaderos en PH"\n        Parqueaderos_en_PH,\n        /** Vivienda que proporciona alojamiento y hospedaje temporal\n         */\n        !!@ ili2db.dispName = "(Comercial) Pensiones y Residencias"\n        Pensiones_y_Residencias,\n        /** Edificaciones tipo bodega destinadas a la prestacion de un servicio público, como es la oferta de productos básicos, principalmente de origen agropecuario y consumo doméstico\n         */\n        !!@ ili2db.dispName = "(Comercial) Plaza de mercado"\n        Plaza_Mercado,\n        /** Establecimiento con características arquitectónicas coloniales en el que se preparan y sirven comidas.\n         */\n        !!@ ili2db.dispName = "(Comercial) Restaurante Colonial"\n        Restaurante_Colonial,\n        /** Establecimiento en el que se preparan y sirven comidas.\n         */\n        !!@ ili2db.dispName = "(Comercial) Restaurantes"\n        Restaurantes,\n        /** Establecimiento en el que se preparan y sirven comidas sometido a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Comercial) Restaurantes en PH"\n        Restaurantes_en_PH,\n        /** Edificación destinada a la proyección de películas cinematográfica o la presentación de obras artísticas actorales o musicales.\n         */\n        !!@ ili2db.dispName = "(Comercial) Teatro - Cinemas"\n        Teatro_Cinemas,\n        /** Establecimiento destinado a la proyección de películas cinematográficas sometida o la presentación de obras artísticas actores o musicales en un predio sometido en régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Comercial) Teatro - Cinemas en PH"\n        Teatro_Cinemas_en_PH\n      ),\n      !!@ ili2db.dispName = "Industrial"\n      Industrial(\n        /** Infraestructura de bombeo.\n         */\n        !!@ ili2db.dispName = "(Industrial) Bodega Casa Bomba"\n        Bodega_Casa_Bomba,\n        /** Infraestructura de bombeo de bodegas sometidas a régimen de propiedad horizontal.\n         */\n        !!@ ili2db.dispName = "(Industrial) Bodegas Casa Bomba en PH"\n        Bodegas_Casa_Bomba_en_PH,\n        /** Conjunto de instalaciones dedicadas a esta actividad de transformar las materias primas en productos elaborados\n         */\n        !!@ ili2db.dispName = "(Industrial) Industrias"\n        Industrias,\n        /** Conjunto de instalaciones sometidas a régimen de propiedad horizontal dedicadas a la actividad de transformar las materias primas en productos elaborados\n         */\n        !!@ ili2db.dispName = "(Industrial) Industrias en PH"\n        Industrias_en_PH,\n        /** Es el espacio construido en el que se realiza un trabajo, manual en su origen, bien de tipo artesanal o fabril.\n         */\n        !!@ ili2db.dispName = "(Industrial) Talleres"\n        Talleres\n      ),\n      !!@ ili2db.dispName = "Institucional"\n      Institucional(\n        /** Es un salón de un edificio que se destina a actividades de enseñanza, y es la unidad básica de todo recinto destinado a la educación.\n         */\n        !!@ ili2db.dispName = "(Institucional) Aula de clases"\n        Aulas_de_Clases,\n        /** Edificación donde podemos encontrar libros o cualquier otro soporte de un texto, como publicaciones, revistas, documentos, catálogo entre otros.\n         */\n        !!@ ili2db.dispName = "(Institucional) Biblioteca"\n        Biblioteca,\n        /** Son instalaciones en las que se encarcela a los prisioneros, se encuentran bajo la autoridad del estado.\n         */\n        !!@ ili2db.dispName = "(Institucional) Cárceles"\n        Carceles,\n        /** Lugar sin altar (diferente a iglesias y capillas) que congrega a un determinado número de personas para actividades de culto asociadas con manifestaciones religiosas.\n         */\n        !!@ ili2db.dispName = "(Institucional) Casas de culto"\n        Casas_de_Culto,\n        /** Establecimiento construido y destinado a proporcionar todo tipo de asistencia médica, incluidas operaciones quirúrgicas y estancia durante la recuperación o tratamiento, y en el que también se practican la investigación y la enseñanza médica\n         */\n        !!@ ili2db.dispName = "(Institucional) Clinicas, hospitales, centros médicos"\n        Clinicas_Hospitales_Centros_Medicos,\n        /** Institución edificada destinada a la enseñanza primaria, secundaria y universitaria\n         */\n        !!@ ili2db.dispName = "(Institucional) Colegios y universidades"\n        Colegio_y_Universidades,\n        /** Teatro o edificio destinado a espectáculos con capacidad para un gran número de personas.\n         */\n        !!@ ili2db.dispName = "(Institucional) Coliseos"\n        Coliseos,\n        /** Institución edificada construcción con características arquitectónicas coloniales destinada a la enseñanza primaria\n         */\n        !!@ ili2db.dispName = "(Institucional) Entidad educativa colonial colegio colonial"\n        Entidad_Educativa_Colonial_Colegio_Colonial,\n        /** Un estadio es una construcción cerrada con graderías para los espectadores, destinado a competiciones deportivas. Puede ser al aire libre o cubierto.\n         */\n        !!@ ili2db.dispName = "(Institucional) Estadios"\n        Estadios,\n        /** Lugar construido  fuerte, cercado de murallas, baluartes, fosos y otras fortificaciones.\n         */\n        !!@ ili2db.dispName = "(Anexo) Fuertes y Castillos"\n        Fuertes_y_Castillos,\n        /** Edificación en la que se reúnen y consagran a los fieles que le rinden culto a un ser superior\n         */\n        !!@ ili2db.dispName = "(Institucional) Iglesia"\n        Iglesia,\n        /** Edificación en la que se reúnen y consagran a los fieles que le rinden culto a un ser superior sometido a régimen de propiedad horizontal\n         */\n        !!@ ili2db.dispName = "(Institucional) Iglesia en PH"\n        Iglesia_en_PH,\n        /** Construcciones adaptadas o utilizadas por los organismos de seguridad de una nación para acuartelar a las tropas y sus equipos. Estas son organizadas de una forma tal que les facilite cumplir con la rutina diaria de los cuerpos militares, desde dormitorios, patios de ejercicios, estacionamientos para los vehículos, parques, comedores, oficinas y son fortificadas a fin de presentar resistencia al momento de un posible ataque externo.\n         */\n        !!@ ili2db.dispName = "(Institucional) Instalaciones militares"\n        Instalaciones_Militares,\n        /** Construcción con características de una vivienda que se encarga de brindar educación y asistencia integral a los niños\n         */\n        !!@ ili2db.dispName = "(Institucional) Jardín infantil en casa"\n        Jardin_Infantil_en_Casa,\n        /** Es un terreno que está destinado a árboles, jardines y prados donde se depositan los restos mortales o cadáveres.\n         */\n        !!@ ili2db.dispName = "(Institucional) Parque Cementerio"\n        Parque_Cementerio,\n        /** Centro cultural donde se realizan presentaciones astronómicas al público en general.\n         */\n        !!@ ili2db.dispName = "(Institucional) Planetario"\n        Planetario,\n        /** Son recintos cerrados, generalmente circulares y descubiertos, donde se celebran las corridas de toros.\n         */\n        !!@ ili2db.dispName = "(Institucional) Plaza de toros"\n        Plaza_de_Toros,\n        /** Edificio donde se atiende a la población en un primer nivel asistencial sanitario.\n         */\n        !!@ ili2db.dispName = "(Institucional) Puestos de salud"\n        Puestos_de_Salud,\n        /** Construcciones, oficiales o privadas, destinadas a salvaguardar obras de arte, reliquias o antigüedades de carácter histórico, religioso o científico, que representan un periodo, una época de la humanidad o del país.\n         */\n        !!@ ili2db.dispName = "(Institucional) Museos"\n        Museos,\n        /** Edificación donde habitan congregaciones religiosas de distintas órdenes menticantes en el itinerario de formación o consagración religiosa.\n         */\n        !!@ ili2db.dispName = "(Institucional) Seminarios, conventos"\n        Seminarios_Conventos,\n        /** Edificio o sala destinados a la representación de obras de teatro o de otro tipo de espectáculos, que dispone de un escenario y gradas o asientos para el público, se caracterizan por sus condiciones arquitectónicas\n         */\n        !!@ ili2db.dispName = "(Institucional) Teatro"\n        Teatro,\n        /** Escenario deportivo destinado a la práctica de distintas disciplinas deportivas.\n         */\n        !!@ ili2db.dispName = "(Institucional) Unidad deportiva"\n        Unidad_Deportiva,\n        /** Instalación deportiva donde se desarrollan carreras ciclistas o de patinaje.\n         */\n        !!@ ili2db.dispName = "(Institucional) Velódromo, patinódromo"\n        Velodromo_Patinodromo\n      ),\n      !!@ ili2db.dispName = "Anexo"\n      Anexo(\n        /** Depósito de agua construido a nivel del terreno con el propósito de almacenar agua, o en el caso de las bañadera con el fin de hacer limpieza al ganado, estas construcciones son cubiertas para guardar de la intemperie.\n         */\n        !!@ ili2db.dispName = "(Anexo) Albercas - Banaderas"\n        Albercas_Banaderas,\n        /** Nombre dado en zonas cafeteras a aquellas construcciones donde realizan el beneficio del café. Consiste en áreas cubiertas dentro de las cuales se encuentran los elementos destinados a la labor de seleccionar, lavar y despulpar el grano y su posterior empaque\n         */\n        !!@ ili2db.dispName = "(Anexo) Beneficiaderos"\n        Beneficiaderos,\n        /** Construcción para el desarrollo de proyectos acuícolas del cultivo de camarones.\n         */\n        !!@ ili2db.dispName = "(Anexo) Camaroneras"\n        Camaroneras,\n        /** Superficie de terreno adecuada sobre un placa para la practica de deportes como fútbol de salón, voleibol, balocento u alguna otra disciplina que haga uso de la cancha, todo ello a pequeña escala. Se excluyen las canchas de tenis, los estadios, coliseo u otras edificaciones de gran tamaño.\n         */\n        !!@ ili2db.dispName = "(Anexo) Canchas"\n        Canchas,\n        /** Superficie  terreno rectangular cruzada al medio por una red baja.\n         */\n        !!@ ili2db.dispName = "(Anexo) Canchas de Tenis"\n        Canchas_de_Tenis,\n        /** Es una vía de transporte de dominio y uso público, proyectada y construida fundamentalmente para la circulación de vehículos automóviles\n         */\n        !!@ ili2db.dispName = "(Anexo) Carretera"\n        Carretera,\n        /** Cada una de las superficies de un edificio que disponen de una cara al interior y de otra al exterior.\n         */\n        !!@ ili2db.dispName = "(Anexo) Cerramiento"\n        Cerramiento,\n        /** Construcción anexa conformada por unos cimientos, muros y placa base\n         */\n        !!@ ili2db.dispName = "(Anexo) Cimientos, Estructura, Muros y Placa Base"\n        Cimientos_Estructura_Muros_y_Placa_Base,\n        /** Construcciòn destinada a la cría y albergue de cerdos. Se utiliza cualesquiera de los tres nombres enunciados según la región donde se ubique; los elementos que la conforman son: estructura, muros y pisos.\n         */\n        !!@ ili2db.dispName = "(Anexo) Cocheras - Marraneras - Porquerizas"\n        Cocheras_Marraneras_Porquerizas,\n        /** Tenso estructuras, arquitectura textil, o membranas arquitectónicas, son los nombres con los que se le conoce a los tipos de estructura que emplean materiales que trabajan bajo tensión, sean membranas textiles, láminas, mallas de cables, etc.\n         */\n        !!@ ili2db.dispName = "(Anexo) Construccion en membrana arquitectónica"\n        Construccion_en_Membrana_Arquitectonica,\n        /** Un contenedor es un recipiente de carga para el transporte marítimo o fluvial, transporte terrestre y transporte multimodal adecuado para la vivienda o el comercio o servicios.\n         */\n        !!@ ili2db.dispName = "(Anexo) Contenedor"\n        Contenedor,\n        /** Sitio cerrado y descubierto que se utiliza par la cría y albergue de ganado generalmente vacuno. consta de los elementos estructura  y pisos.\n         */\n        !!@ ili2db.dispName = "(Anexo) Corrales"\n        Corrales,\n        /** Lugar cubierto donde se encierra ganado o caballos y/o se realizan actividades propias de su explotación, constituidos por estructura, cubierta, muros y pisos.\n         */\n        !!@ ili2db.dispName = "(Anexo) Establos - Pesebreras - Caballerizas"\n        Establos_Pesebreras_Caballerizas,\n        /** Son obras arquitectónicas  que se construyen con el objeto de elevar el nivel del agua de la fuente de riego a los sitios donde se desea utilizar.\n         */\n        !!@ ili2db.dispName = "(Anexo) Estacion de Bombeo"\n        Estacion_Bombeo,\n        /** Instalación que permite el tránsito de personas y la conexión con sistemas de transporte como buses, metro, tren, tranvía, terminales y estaciones, destinadas para la movilidad de las personas.\n         */\n        !!@ ili2db.dispName = "(Anexo) Estación de sistema de transporte"\n        Estacion_Sistema_Transporte,\n        /** Unidad construida con destino a la cría y/o protección de aves principalmente para explotación avícola.  Conformada por estructura cubierta pisos y muros que son parcialmente elaborados en ladrillo y el resto descubierto o con algún material provisional (plásticos, alambres, etc.).\n         */\n        !!@ ili2db.dispName = "(Anexo) Galpones - Gallineros"\n        Galpones_Gallineros,\n        /** Espacio destinado para el almacenamiento y disposición de aeronaves.\n         */\n        !!@ ili2db.dispName = "(Anexo) Hangar"\n        Hangar,\n        /** Construcción consistente en una cubierta apoyada en columnas de materiales diferentes, elaborados con el fin de guarecer de la intemperie.\n         */\n        !!@ ili2db.dispName = "(Anexo) Kioscos"\n        Kioscos,\n        /** Son depósitos construidos mediante la excavación y compactación de la tierra que almacenan agua de cualquier calidad por un periodo determinado\n         */\n        !!@ ili2db.dispName = "(Anexo) Lagunas de Oxidación"\n        Lagunas_de_Oxidacion,\n        /** Cobertizo dentro de una edificación de mayor extensión o patio cubierto, clasificados según su estructura, pisos y el material de la cubierta.\n         */\n        !!@ ili2db.dispName = "(Anexo) Marquesinas - Patios Cubiertos"\n        Marquesinas_Patios_Cubiertos,\n        /** Deberán diferenciarse de acuerdo a su estructura, longitud, capacidad, usos turísticos o de carga\n         */\n        !!@ ili2db.dispName = "(Anexo) Muelles"\n        Muelles,\n        /** Se denomina muralla a un muro cerrado destinado a la protección y defensa de determinado sitio.\n         */\n        !!@ ili2db.dispName = "(Anexo) Murallas"\n        Murallas,\n        /** Las pérgolas son estructuras compuestas por columnas y una armazón superior, cubiertas con mucho follaje o toldo especial que protegen de la lluvia y el sol, también usadas como elemento decorativo en un espacio de las viviendas.\n         */\n        !!@ ili2db.dispName = "(Anexo) Pérgolas"\n        Pergolas,\n        /** Estanque artificial con destino al deporte o a la recreación.  Se diferencia por sus acabados y especificaciones técnicas para su mantenimiento y operación; sus dimensiones deben darse en unidades de área (m2).\n         */\n        !!@ ili2db.dispName = "(Anexo) Piscinas"\n        Piscinas,\n        /** Edificación sin cubierta con que se identifican las pistas de los aeropuertos construidas en asfalto o concreto, incluye la zona o calle de redaje y calles de salida rápida.\n         */\n        !!@ ili2db.dispName = "(Anexo) Pista aeropuerto"\n        Pista_Aeropuerto,\n        /** Perforaciones profundas  manuales para extraer agua subterránea.  Medida en metros de profundidad.\n         */\n        !!@ ili2db.dispName = "(Anexo) Pozos"\n        Pozos,\n        /** Consiste en un sitio cubierto elaborado con el fin de resguardar de la intemperie; el nombre de enramadas, cobertizos o caney se utiliza según la forma de la cubierta y la región donde se ubique.\n         */\n        !!@ ili2db.dispName = "(Anexo) Ramadas - Cobertizos - Caneyes"\n        Ramadas_Cobertizos_Caneyes,\n        /** Construcciones elaboradas con el objeto de secar en condiciones naturales el café principalmente, aunque es común su uso en otros productos.  Consta de estructura y pisos para su calificación\n         */\n        !!@ ili2db.dispName = "(Anexo) Secaderos"\n        Secaderos,\n        /** Construcción de grandes dimensiones que sirve para almacén o depósito, se exceptúan los silos cafeteros\n         */\n        !!@ ili2db.dispName = "(Anexo) Silos"\n        Silos,\n        /** Depósitos subterráneos o de altura, construidos en zonas con deficiencias en abastecimiento para el consumo de los habitantes o para el uso agrícola.  El elemento a calificar es la estructura relacionada con la capacidad de almacenamiento medida en metros cúbicos.\n         *  \n         * Se excluyen de este tipo de construcción los tanques de almacenamiento domiciliario\n         */\n        !!@ ili2db.dispName = "(Anexo) Tanques"\n        Tanques,\n        /** Deslizadores construidos alrededor de piscinas, medidos en metros lineales.  Se clasifican según su altura y materiales de construcción\n         */\n        !!@ ili2db.dispName = "(Anexo) Toboganes"\n        Toboganes,\n        /** Edificio en forma de torre, en cuya cima se sitúa una sala de control, desde la que se dirige y controla el tráfico de un puerto, de un aeropuerto o de un circuito de carreras.\n         */\n        !!@ ili2db.dispName = "(Anexo) Torre de control"\n        Torre_de_Control,\n        /** Son estructuras diseñadas para disminuir la temperatura del agua y otros medios.\n         */\n        !!@ ili2db.dispName = "(Anexo) Torres de Enfriamiento"\n        Torres_de_Enfriamiento,\n        /** Se le asigna a las unidades prediales no edificadas o por construir\n         */\n        !!@ ili2db.dispName = "(Anexo) Unidad predial por construir"\n        Unidad_Predial_por_Construir,\n        /** Parte de la infraestructura ferroviaria que une dos puntos determinados del territorio\n         */\n        !!@ ili2db.dispName = "(Anexo) Vía Férrea"\n        Via_Ferrea\n      )\n    );\n\n  /** Este Topic agrupa a las clases específicas del avalúo, así como sus atributos.\n   */\n  TOPIC Avaluos =\n    OID AS INTERLIS.UUIDOID;\n    DEPENDS ON Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.Levantamiento_Catastral;\n\n    /** Clase los valores por M2 de construcción según el uso y puntaje de calificación de construcción.\n     */\n    !!@ ili2db.dispName = "(Avalúos) Tabla Calificación de la Construcción"\n    CLASS AV_TablaCalificacionConstruccion =\n      /** Valor por metros cuadrado de construcción clasificando por uso y puntaje de las unidades de construcción.\n       */\n      !!@ ili2db.dispName = "Valor M2 de construcción"\n      Valor_M2_Construccion : LADM_COL_V3_0.LADM_Nucleo.Peso;\n      /** Es la actividad que se desarrolla en una unidad de construcción.\n       */\n      !!@ ili2db.dispName = "Uso"\n      Uso : Submodelo_Avaluos_V1_0.AV_UsoUConsTipo;\n      /** Puntaje de las edificaciones de acuerdo a sus características constructivas.\n       */\n      !!@ ili2db.dispName = "Puntuación"\n      Puntuacion : TEXT*20;\n    END AV_TablaCalificacionConstruccion;\n\n    /** Clase que relaciona las tipologias de las construcciones con su respectivo valor por M2 de construcción.\n     */\n    !!@ ili2db.dispName = "(Avalúos) Tipología de la construcción"\n    CLASS AV_TipologiaConstruccion =\n      /** Se refiere a la zonificación del municipio de acuerdo con las clasificaciones de los inmuebles según su\n       * actividad residencial, comercial e industrial.\n       */\n      !!@ ili2db.dispName = "Tipo de topología"\n      Tipo_Tipologia : Submodelo_Avaluos_V1_0.AV_TipologiaTipo;\n      /** Valor unitario en pesos del tipo de tipología constructiva.\n       */\n      !!@ ili2db.dispName = "Valor unitario"\n      Valor_Unitario : LADM_COL_V3_0.LADM_Nucleo.Peso;\n      UNIQUE Tipo_Tipologia; \n    END AV_TipologiaConstruccion;\n\n    /** Clase que contiene las variables que componen las Zonas Homogeneas Fisicas rurales. Las ZHF Son espacios geográficos con características similares en cuanto a vías, topografía, servicios públicos, uso actual del suelo, norma de uso del suelo, tipificación de las construcciones y/o edificaciones, áreas homogéneas de tierra, disponibilidad de aguas superficiales permanentes u otras variables que permitan diferenciar estas áreas de las adyacentes.\n     */\n    !!@ ili2db.dispName = "(Avalúos) Zona homogénea física rural"\n    CLASS AV_ZonaHomogeneaFisicaRural =\n      /** Código único del registro de la instancia de ZonaHomegeneaFisca.\n       */\n      !!@ ili2db.dispName = "Código"\n      Codigo : MANDATORY TEXT*20;\n      /** Identificador de la zona homogénea física rural.\n       */\n      !!@ ili2db.dispName = "Código zona física"\n      Codigo_Zona_Fisica : MANDATORY TEXT*20;\n      /** Espacios de la superficie terrestre que presentan características o cualidades similares en cuanto a las condiciones de clima, relieve, material litológico superficial o depósitos superficiales y de las características internas de los suelos, condiciones que expresan la capacidad productiva de las tierras; ello se indica mediante un valor numérico denominado Valor Potencial (VP).\n       */\n      !!@ ili2db.dispName = "Área homogénea tierra"\n      Area_Homogenea_Tierra : 0.00 .. 99999999999999990000000.00;\n      /** En el estudio de esta variable se analiza la existencia de fuentes de aguas superficiales permanentes y su clasificación, con el fin de zonificar de acuerdo con la posibilidad de aprovechamiento para el uso actual que se da al suelo.\n       */\n      !!@ ili2db.dispName = "Disponibilidad agua"\n      Disponibilidad_Agua : Submodelo_Avaluos_V1_0.AV_DisponibilidadAguaTipo;\n      /** Se refiere a la existencia y calidad de las vías, analizada a nivel de zona. A esta condición se asocia la existencia de otras obras de ingeniería, la instalación de redes de servicios públicos, etc.\n       */\n      !!@ ili2db.dispName = "Influencia vial"\n      Influencia_Vial : Submodelo_Avaluos_V1_0.AV_InfluenciaVialRuralTipo;\n      /** Actividad que se desarrolla en un determinado espacio geográfico en el momento de la elaboración del estudio de zonas homogéneas físicas.\n       */\n      !!@ ili2db.dispName = "Uso actual del suelo"\n      Uso_Actual_Suelo : Submodelo_Avaluos_V1_0.AV_UsoSueloRuralTipo;\n      /** Indicación legal sobre la actividad que se puede desarrollar en un determinado espacio geográfico con lo planificado y reglamentado por la respectiva autoridad de la unidad orgánica catastral.\n       */\n      !!@ ili2db.dispName = "Norma uso del suelo"\n      Norma_Uso_Suelo : TEXT*250;\n      /** Vigencia del estudio de zonas homogeneas fisicas rurales.\n       */\n      !!@ ili2db.dispName = "Vigencia"\n      Vigencia : INTERLIS.XMLDate;\n      /** Definición de la geometría espacial georreferenciada de la zona homogénea física, delimitada mediante un polígono que contiene sus linderos y la superficie ocupada.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : MANDATORY ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\n    END AV_ZonaHomogeneaFisicaRural;\n\n    /** Clase que contiene las variables que componen las Zonas Homogeneas Fisicas urbanas. Las ZHF Son espacios geográficos con características similares en cuanto a vías, topografía, servicios públicos, uso actual del suelo, norma de uso del suelo, tipificación de las construcciones y/o edificaciones, áreas homogéneas de tierra, disponibilidad de aguas superficiales permanentes u otras variables que permitan diferenciar estas áreas de las adyacentes.\n     */\n    !!@ ili2db.dispName = "(Avalúos) Zona homogénea fisíca urbana"\n    CLASS AV_ZonaHomogeneaFisicaUrbana =\n      /** Código único del registro de la instancia de ZonaHomegeneaFisca.\n       */\n      !!@ ili2db.dispName = "Código"\n      Codigo : MANDATORY TEXT*20;\n      /** Identificador de la zona homogénea física urbana.\n       */\n      !!@ ili2db.dispName = "Código zona física"\n      Codigo_Zona_Fisica : MANDATORY TEXT*20;\n      /** Características naturales relacionadas con el relieve que permitan o dificulten el desarrollo de las construcciones, dentro de esta variable deben considerarse factores tales como zonas anegadizas o inundables, las discontinuidades físicas tales como taludes, caños y ríos, altura por encima de la cota de servicios, áreas potenciales de derrumbe, por inclinación o presencia de drenajes superficiales.\n       */\n      !!@ ili2db.dispName = "Topografía"\n      Topografia : Submodelo_Avaluos_V1_0.AV_TopografiaZonaTipo;\n      /** Se refiere a la existencia y calidad de las vías, analizada a nivel de zona. A esta condición se asocia la existencia de otras obras de ingeniería, la instalación de redes de servicios públicos, etc.\n       */\n      !!@ ili2db.dispName = "Influencia vial"\n      Influencia_Vial : Submodelo_Avaluos_V1_0.AV_InfluenciaVialUrbanaTipo;\n      /** Se prestan con la finalidad específica de satisfacer las necesidades esenciales de las personas. Para efectos de la presente metodología se consideran servicios públicos básicos: Acueducto, Alcantarillado y Energía Eléctrica.\n       */\n      !!@ ili2db.dispName = "Servicio público"\n      Servicio_Publico : Submodelo_Avaluos_V1_0.AV_ServiciosPublicosTipo;\n      /** Actividad que se desarrolla en un determinado espacio geográfico en el momento de la elaboración del estudio de zonas homogéneas físicas.\n       */\n      !!@ ili2db.dispName = "Uso actual del suelo"\n      Uso_Actual_Suelo : Submodelo_Avaluos_V1_0.AV_UsoSueloUrbanoTipo;\n      /** Indicación legal sobre la actividad que se puede desarrollar en un determinado espacio geográfico con lo planificado y reglamentado por la respectiva autoridad de la unidad orgánica catastral.\n       */\n      !!@ ili2db.dispName = "Norma uso del suelo"\n      Norma_Uso_Suelo : TEXT*250;\n      /** Clasificación de las construcciones de acuerdo a ciertas características observables y cuantificables que reflejan las condiciones socioeconómicas (ingresos y cultura) de los habitantes de las viviendas.\n       */\n      !!@ ili2db.dispName = "Tipificación de la construcción"\n      Tipificacion_Construccion : Submodelo_Avaluos_V1_0.AV_TipificacionConstruccionTipo;\n      /** Vigencia del estudio de zonas homogeneas fisicas urbanas.\n       */\n      !!@ ili2db.dispName = "Vigencia"\n      Vigencia : INTERLIS.XMLDate;\n      /** Definición de la geometría espacial georreferenciada de la zona homogénea física, delimitada mediante un polígono que contiene sus linderos y la superficie ocupada.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : MANDATORY ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\n    END AV_ZonaHomogeneaFisicaUrbana;\n\n    /** Clase que contiene las variables que componen las Zonas Homogeneas Geoconómicas rurales. Las ZHG son los espacios geográficos determinados a partir de Zonas Homogéneas Físicas con valores unitarios similares en cuanto a su precio, según las condiciones del mercado inmobiliario.\n     */\n    !!@ ili2db.dispName = "(Avalúos) Zona homogénea geoeconómica urbana"\n    CLASS AV_ZonaHomogeneaGeoeconomicaUrbana =\n      /** Código único del registro de la instancia de la zona geoeconómica.\n       */\n      !!@ ili2db.dispName = "Código"\n      Codigo : MANDATORY TEXT*20;\n      /** Identificador de la zona homogénea geoeconómica urbana.\n       */\n      !!@ ili2db.dispName = "Código zona geoeconómica"\n      Codigo_Zona_Geoeconomica : MANDATORY TEXT*20;\n      /** Valor económico de la zona homogénea que representa la instancia de la clase.\n       */\n      !!@ ili2db.dispName = "Valor del metro cuadrado"\n      Valor_Metro : MANDATORY LADM_COL_V3_0.LADM_Nucleo.Peso;\n      /** Códigos de las zonas homogeneas fisicas urbanas que componen la zona homogénea geoeconómica urbana.\n       */\n      !!@ ili2db.dispName = "Subzona física"\n      Subzona_Fisica : TEXT;\n      /** Vigencia del estudio de zonas homogéneas geoeconómicas urbanas.\n       */\n      !!@ ili2db.dispName = "Vigencia"\n      Vigencia : INTERLIS.XMLDate;\n      /** Definición de la geometría espacial georreferenciada de la zona homogénea geoeconómica, delimitada mediante un polígono que contiene sus linderos y la superficie ocupada.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : MANDATORY ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\n    END AV_ZonaHomogeneaGeoeconomicaUrbana;\n\n    /** Esta clase permite gestionar las zonas con características económicas y de localización geográfica similares, definidas para caracterizar el avalúo.\n     */\n    !!@ ili2db.dispName = "(Avalúos) Zona homogénea geoeconómica rural"\n    CLASS AV_ZonaHomogeneaGeoeconomicaRural =\n      /** Código único del registro de la instancia de la zona geoeconómica.\n       */\n      !!@ ili2db.dispName = "Código"\n      Codigo : MANDATORY TEXT*20;\n      /** Identificador de la zona homogénea geoeconómica rural.\n       */\n      !!@ ili2db.dispName = "Código zona geoeconómica"\n      Codigo_Zona_Geoeconomica : MANDATORY TEXT*20;\n      /** Valor económico de la zona homogénea que representa la instancia de la clase.\n       */\n      !!@ ili2db.dispName = "Valor por hectárea"\n      Valor_Hectarea : MANDATORY LADM_COL_V3_0.LADM_Nucleo.Peso;\n      /** Códigos de las zonas homogeneas fisicas rurales que componen la zona homogénea geoeconómica rural.\n       */\n      !!@ ili2db.dispName = "Subzona física"\n      Subzona_Fisica : TEXT;\n      /** Vigencia del estudio de zonas homogéneas geoeconómicas rurales.\n       */\n      !!@ ili2db.dispName = "Vigencia"\n      Vigencia : INTERLIS.XMLDate;\n      /** Definición de la geometría espacial georreferenciada de la zona homogénea geoeconómica, delimitada mediante un polígono que contiene sus linderos y la superficie ocupada.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : MANDATORY ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\n    END AV_ZonaHomogeneaGeoeconomicaRural;\n\n  END Avaluos;\n\nEND Submodelo_Avaluos_V1_0.\n	2020-07-22 10:37:35.576
ISO19107_PLANAS_V3_0.ili	2.3	ISO19107_PLANAS_V3_0	INTERLIS 2.3;\r\n\r\nTYPE MODEL ISO19107_PLANAS_V3_0 (es)\r\nAT "http://www.swisslm.ch/models"\r\nVERSION "2016-03-07"  =\r\n\r\n  DOMAIN\r\n\r\n    GM_Point2D = COORD 3980000.000 .. 5700000.000 [INTERLIS.m], 1080000.000 .. 3100000.000 [INTERLIS.m] ,ROTATION 2 -> 1;\r\n\r\n    GM_Curve2D = POLYLINE WITH (ARCS,STRAIGHTS) VERTEX GM_Point2D WITHOUT OVERLAPS>0.001;\r\n\r\n    GM_Surface2D = SURFACE WITH (ARCS,STRAIGHTS) VERTEX GM_Point2D WITHOUT OVERLAPS>0.001;\r\n\r\n    GM_Point3D = COORD 3980000.000 .. 5700000.000 [INTERLIS.m], 1080000.000 .. 3100000.000 [INTERLIS.m], -5000.000 .. 6000.000 [INTERLIS.m] ,ROTATION 2 -> 1;\r\n\r\n    GM_Curve3D = POLYLINE WITH (ARCS,STRAIGHTS) VERTEX GM_Point3D WITHOUT OVERLAPS>0.001;\r\n\r\n    GM_Surface3D = SURFACE WITH (ARCS,STRAIGHTS) VERTEX GM_Point3D WITHOUT OVERLAPS>0.001;\r\n\r\n  STRUCTURE GM_Geometry2DListValue =\r\n  END GM_Geometry2DListValue;\r\n\r\n  STRUCTURE GM_Curve2DListValue =\r\n    value : MANDATORY GM_Curve2D;\r\n  END GM_Curve2DListValue;\r\n\r\n  STRUCTURE GM_Surface2DListValue =\r\n    value : MANDATORY GM_Surface2D;\r\n  END GM_Surface2DListValue;\r\n\r\n  !!@ ili2db.mapping = "MultiLine"\r\nSTRUCTURE GM_MultiCurve2D =\r\n    geometry : LIST {1..*} OF ISO19107_PLANAS_V3_0.GM_Curve2DListValue;\r\n  END GM_MultiCurve2D;\r\n\r\n  !!@ ili2db.mapping = "MultiSurface"\r\nSTRUCTURE GM_MultiSurface2D =\r\n    geometry : LIST {1..*} OF ISO19107_PLANAS_V3_0.GM_Surface2DListValue;\r\n  END GM_MultiSurface2D;\r\n\r\n  STRUCTURE GM_Curve3DListValue =\r\n    value : MANDATORY GM_Curve3D;\r\n  END GM_Curve3DListValue;\r\n\r\n  STRUCTURE GM_Surface3DListValue =\r\n    value : MANDATORY GM_Surface3D;\r\n  END GM_Surface3DListValue;\r\n\r\n  !!@ ili2db.mapping = "MultiLine"\r\nSTRUCTURE GM_MultiCurve3D =\r\n    geometry : LIST {1..*} OF ISO19107_PLANAS_V3_0.GM_Curve3DListValue;\r\n  END GM_MultiCurve3D;\r\n\r\n  !!@ ili2db.mapping = "MultiSurface"\r\nSTRUCTURE GM_MultiSurface3D =\r\n    geometry : LIST {1..*} OF ISO19107_PLANAS_V3_0.GM_Surface3DListValue;\r\n  END GM_MultiSurface3D;\r\n\r\nEND ISO19107_PLANAS_V3_0.\r\n	2020-07-22 10:37:35.576
Submodelo_Insumos_V1_0.ili	2.3	Submodelo_Insumos_Gestor_Catastral_V1_0{ LADM_COL_V3_0 ISO19107_PLANAS_V3_0} Submodelo_Insumos_SNR_V1_0{ LADM_COL_V3_0} Submodelo_Integracion_Insumos_V1_0{ Submodelo_Insumos_Gestor_Catastral_V1_0 Submodelo_Insumos_SNR_V1_0}	INTERLIS 2.3;\r\n\r\nMODEL Submodelo_Insumos_Gestor_Catastral_V1_0 (es)\r\nAT "mailto:PC4@localhost"\r\nVERSION "2019-08-01"  =\r\n  IMPORTS ISO19107_PLANAS_V3_0,LADM_COL_V3_0;\r\n\r\n  DOMAIN\r\n\r\n    GC_CondicionPredioTipo = (\r\n      /** Predio no sometido al régimen de propiedad horizontal.\r\n       */\r\n      !!@ ili2db.dispName = "No propiedad horizontal"\r\n      NPH,\r\n      /** Predio sometido al régimen de propiedad horizontal mediante escritura pública registrada\r\n       */\r\n      !!@ ili2db.dispName = "Propiedad horizontal"\r\n      PH(\r\n        /** Predio matriz del régimen de propiedad horizontal sobre el cual se segregan todas las unidades prediales.\r\n         */\r\n        !!@ ili2db.dispName = "(PH) Matriz"\r\n        Matriz,\r\n        /** Apartamento, garaje, depósito o cualquier otro tipo de unidad predial dentro del PH que se encuentra debidamente inscrito en el registro de instrumentos públicos\r\n         */\r\n        !!@ ili2db.dispName = "(PH) Unidad predial"\r\n        Unidad_Predial\r\n      ),\r\n      /** Predio sometido al régimen de propiedad horizontal mediante escritura pública registrada en cuyo reglamento define para cada unidad predial un área privada de terreno.\r\n       */\r\n      !!@ ili2db.dispName = "Condiminio"\r\n      Condominio(\r\n        /** Predio matriz del condominio sobre el cual se segregan todas las unidades prediales.\r\n         */\r\n        !!@ ili2db.dispName = "(Condominio) Matriz"\r\n        Matriz,\r\n        /** Unidad predial dentro del condominio matriz.\r\n         */\r\n        !!@ ili2db.dispName = "(Condominio) Unidad predial"\r\n        Unidad_Predial\r\n      ),\r\n      /** Es la construcción o edificación instalada por una persona natural o jurídica sobre un predio que no le pertenece.\r\n       */\r\n      !!@ ili2db.dispName = "Mejora"\r\n      Mejora(\r\n        /** Mejora sobre un predio sometido a régimen de propiedad horizontal\r\n         */\r\n        !!@ ili2db.dispName = "(Mejora) Propiedad horizontal"\r\n        PH,\r\n        /** Mejora sobre un predio no sometido a régimen de propiedad horizontal.\r\n         */\r\n        !!@ ili2db.dispName = "(Mejora) No propiedad horizontal"\r\n        NPH\r\n      ),\r\n      /** Predios sobre los cuales las áreas de terreno y construcciones son dedicadas a la cremación, inhumación o enterramiento de personas fallecidas.\r\n       */\r\n      !!@ ili2db.dispName = "Parque cementerio"\r\n      Parque_Cementerio(\r\n        /** Predios sobre los cuales las áreas de terreno y construcciones son dedicadas a la cremación, inhumación o enterramiento de personas fallecidas.\r\n         */\r\n        !!@ ili2db.dispName = "(Parque cementerio) Matriz"\r\n        Matriz,\r\n        /** Área o sección de terreno con función de tumba, esta debe encontrarse inscrita en el registro de instrumentos públicos.\r\n         */\r\n        !!@ ili2db.dispName = "(Parque cementerio) Unidad predial"\r\n        Unidad_Predial\r\n      ),\r\n      /** Espacio (terreno y construcción) diseñado y destinado para el tránsito de vehículos, personas, entre otros.\r\n       */\r\n      !!@ ili2db.dispName = "Vía"\r\n      Via,\r\n      /** Inmuebles que siendo de dominio de la Nación, o una entidad territorial o de particulares, están destinados al uso de los habitantes.\r\n       */\r\n      !!@ ili2db.dispName = "Bien de uso público"\r\n      Bien_Uso_Publico\r\n    );\r\n\r\n    GC_SistemaProcedenciaDatosTipo = (\r\n      /** Datos extraídos del Sistema Nacional Catastral del IGAC.\r\n       */\r\n      !!@ ili2db.dispName = "Sistema Nacional Catastral"\r\n      SNC,\r\n      /** Datos extraídos del Sistema COBOL del IGAC.\r\n       */\r\n      !!@ ili2db.dispName = "Cobol"\r\n      Cobol\r\n    );\r\n\r\n    GC_UnidadConstruccionTipo = (\r\n      /** Se refiere aquellas construcciones de uso residencial, comercial e industrial.\r\n       */\r\n      !!@ ili2db.dispName = "Convencional"\r\n      Convencional,\r\n      /** Se refiere aquellas construcciones considereadas anexos de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "No convencional"\r\n      No_Convencional\r\n    );\r\n\r\n  TOPIC Datos_Gestor_Catastral =\r\n\r\n    /** Dato geografico aportado por el Gestor Catastral respecto de los barrios de una entidad territorial.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Barrio"\r\n    CLASS GC_Barrio =\r\n      /** Código de identificación del barrio.\r\n       */\r\n      !!@ ili2db.dispName = "Código"\r\n      Codigo : TEXT*13;\r\n      /** Nombre del barrio.\r\n       */\r\n      !!@ ili2db.dispName = "Nombre"\r\n      Nombre : TEXT*100;\r\n      /** Código del sector donde se encuentra localizado el barrio.\r\n       */\r\n      !!@ ili2db.dispName = "Código sector"\r\n      Codigo_Sector : TEXT*9;\r\n      /** Tipo de geometría y su representación georrefenciada que definen los límites y el área ocupada por el barrio.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface2D;\r\n    END GC_Barrio;\r\n\r\n    /** Relaciona la calificación de las unidades de construcción de los datos de insumos del Gestor Catastral.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Calificación unidad de construcción"\r\n    CLASS GC_CalificacionUnidadConstruccion =\r\n      /** Indica el componente de la calificación de la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Componente"\r\n      Componente : TEXT*255;\r\n      /** Indica el elemento de calificación de la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Elemento de calificación"\r\n      Elemento_Calificacion : TEXT*255;\r\n      /** Indica el detalle de calificación del elemento de calificación de la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Detalle de calificación"\r\n      Detalle_Calificacion : TEXT*255;\r\n      /** Puntaje asociado al detalle del elemento de calificación.\r\n       */\r\n      !!@ ili2db.dispName = "Puntos"\r\n      Puntos : 0 .. 100;\r\n    END GC_CalificacionUnidadConstruccion;\r\n\r\n    /** Construcciones que no cuentan con información alfanumérica en la base de datos catastral.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Comisiones Construcción"\r\n    CLASS GC_ComisionesConstruccion =\r\n      /** Numero Predial del Construcciones que no cuentan con información alfanumérica en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Número predial"\r\n      Numero_Predial : MANDATORY TEXT*30;\r\n      /** Construcciones que no cuentan con información alfanumérica en la base catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\r\n    END GC_ComisionesConstruccion;\r\n\r\n    /** Terrenos que no cuentan con información alfanumérica en la base de datos catastral.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Comisiones Terreno"\r\n    CLASS GC_ComisionesTerreno =\r\n      /** Numero Predial del terreno que no cuentan con información\r\n       * alfanumérica en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Número predial"\r\n      Numero_Predial : MANDATORY TEXT*30;\r\n      /** Terrenos que no cuentan con información alfanumérica en la base catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface2D;\r\n    END GC_ComisionesTerreno;\r\n\r\n    /** Unidades de construcción que no cuentan con información alfanumérica en la base de datos catastral.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Comisiones Unidad Construcción"\r\n    CLASS GC_ComisionesUnidadConstruccion =\r\n      /** Numero Predial del terreno que no cuentan con información alfanumérica en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Número predial"\r\n      Numero_Predial : MANDATORY TEXT*30;\r\n      /** Unidades de construcción que no cuentan con información alfanumérica en la base catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\r\n    END GC_ComisionesUnidadConstruccion;\r\n\r\n    /** Datos de las construcciones inscritas en las bases de datos catastrales en una entidad territorial.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Construcción"\r\n    CLASS GC_Construccion =\r\n      /** Identificado de la unidad de construcción, su codificación puede ser por letras del abecedario.\r\n       */\r\n      !!@ ili2db.dispName = "Identificador"\r\n      Identificador : TEXT*30;\r\n      /** Etiqueta de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Etiqueta"\r\n      Etiqueta : TEXT*50;\r\n      /** Indica si la construcción es de tipo convencional o no convencional.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de construcción"\r\n      Tipo_Construccion : Submodelo_Insumos_Gestor_Catastral_V1_0.GC_UnidadConstruccionTipo;\r\n      /** Indica el tipo de dominio de la unidad de construcción: común y privado.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de dominio"\r\n      Tipo_Dominio : TEXT*20;\r\n      /** Número total de pisos de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Número de pisos"\r\n      Numero_Pisos : 0 .. 200;\r\n      /** Número total de sótanos de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Número de sótanos"\r\n      Numero_Sotanos : 0 .. 99;\r\n      /** Número total de mezanines de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Número de mezanines"\r\n      Numero_Mezanines : 0 .. 99;\r\n      /** Número total de semisótanos de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Número de semisótanos"\r\n      Numero_Semisotanos : 0 .. 99;\r\n      /** Código catastral de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Código de edificación"\r\n      Codigo_Edificacion : 0 .. 10000000000000000000;\r\n      /** Código de terreno donde se encuentra ubicada la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Código de terreno"\r\n      Codigo_Terreno : TEXT*30;\r\n      /** Área total construida.\r\n       */\r\n      !!@ ili2db.dispName = "Área construida"\r\n      Area_Construida : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Polígono de la construcción existente en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\r\n    END GC_Construccion;\r\n\r\n    /** Clase que contiene los datos principales del predio matriz sometido al regimen de propiedad horizontal inscrito en las bases de datos catastrales.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Datos Propiedad Horizontal Condominio"\r\n    CLASS GC_DatosPHCondominio =\r\n      /** Área total privada del terreno del PH o Condominio Matriz.\r\n       */\r\n      !!@ ili2db.dispName = "Área total de terreno privada"\r\n      Area_Total_Terreno_Privada : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Área total de terreno común del PH o Condominio Matriz.\r\n       */\r\n      !!@ ili2db.dispName = "Área total de terreno común"\r\n      Area_Total_Terreno_Comun : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Área total construida privada del PH o Condominio Matriz.\r\n       */\r\n      !!@ ili2db.dispName = "Área total construida privada"\r\n      Area_Total_Construida_Privada : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Área total construida común del PH o Condominio Matriz.\r\n       */\r\n      !!@ ili2db.dispName = "Área total construida común"\r\n      Area_Total_Construida_Comun : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Total de unidades privadas en el PH o Condominio.\r\n       */\r\n      !!@ ili2db.dispName = "Total de unidades privadas"\r\n      Total_Unidades_Privadas : 0 .. 99999999;\r\n      /** Total de unidades prediales en el sótano del PH o Condominio.\r\n       */\r\n      !!@ ili2db.dispName = "Total de unidades de sótano"\r\n      Total_Unidades_Sotano : 0 .. 99999999;\r\n      /** Avalúo catastral total de la propiedad horizontal o condominio.\r\n       */\r\n      !!@ ili2db.dispName = "Valor total avaúo catastral"\r\n      Valor_Total_Avaluo_Catastral : LADM_COL_V3_0.LADM_Nucleo.Peso;\r\n    END GC_DatosPHCondominio;\r\n\r\n    /** Relaciona la información de las torres asociadas al PH o Condominio de los datos insumos del Gestor Catastral\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Datos torre PH"\r\n    CLASS GC_DatosTorrePH =\r\n      /** Número de torre en el PH o Condominio.\r\n       */\r\n      !!@ ili2db.dispName = "Torre"\r\n      Torre : 0 .. 1500;\r\n      /** Total de pisos de la torre.\r\n       */\r\n      !!@ ili2db.dispName = "Total de pisos torre"\r\n      Total_Pisos_Torre : 0 .. 100;\r\n      /** Total de unidades privadas en la torre.\r\n       */\r\n      !!@ ili2db.dispName = "Total de unidades privadas"\r\n      Total_Unidades_Privadas : 0 .. 99999999;\r\n      /** Total de sótanos en la torre.\r\n       */\r\n      !!@ ili2db.dispName = "Total de sótanos"\r\n      Total_Sotanos : 0 .. 99;\r\n      /** Total de unidades prediales en el sótano de la torre.\r\n       */\r\n      !!@ ili2db.dispName = "Total de unidades sótano"\r\n      Total_Unidades_Sotano : 0 .. 99999999;\r\n    END GC_DatosTorrePH;\r\n\r\n    !!@ ili2db.dispName = "(GC) Dirección"\r\n    STRUCTURE GC_Direccion =\r\n      /** Registros de la direcciones del predio.\r\n       */\r\n      !!@ ili2db.dispName = "Valor"\r\n      Valor : TEXT*255;\r\n      /** Indica si el registro de la dirección corresponde a la principal.\r\n       */\r\n      !!@ ili2db.dispName = "Principal"\r\n      Principal : BOOLEAN;\r\n      /** Línea de donde se encuentra la placa de nomenclatura del predio.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría de referencia"\r\n      Geometria_Referencia : ISO19107_PLANAS_V3_0.GM_Curve3D;\r\n    END GC_Direccion;\r\n\r\n    /** Estructura que contiene el estado del predio en la base de datos catastral.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) EstadoPredio"\r\n    STRUCTURE GC_EstadoPredio =\r\n      /** Indica el estado del predio en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Estado alerta"\r\n      Estado_Alerta : TEXT*30;\r\n      /** Entidad emisora del estado de alerta del predio.\r\n       */\r\n      !!@ ili2db.dispName = "Entidad emisora de la alerta"\r\n      Entidad_Emisora_Alerta : TEXT*255;\r\n      /** Fecha de la alerta en el sistema de gestión catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Fecha de alerta"\r\n      Fecha_Alerta : INTERLIS.XMLDate;\r\n    END GC_EstadoPredio;\r\n\r\n    /** Dato geografico aportado por el Gestor Catastral respecto de las manzanas de una entidad territorial.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Manzana"\r\n    CLASS GC_Manzana =\r\n      /** Código catastral de 17 dígitos de la manzana.\r\n       */\r\n      !!@ ili2db.dispName = "Código"\r\n      Codigo : TEXT*17;\r\n      /** Código catastral anterior de la manzana.\r\n       */\r\n      !!@ ili2db.dispName = "Código anterior"\r\n      Codigo_Anterior : TEXT*255;\r\n      /** Código catastral de 13 dígitos del barrio donde se encuentra la manzana.\r\n       */\r\n      !!@ ili2db.dispName = "Código de barrio"\r\n      Codigo_Barrio : TEXT*13;\r\n      /** Polígonos de la manzanas catastrales.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface2D;\r\n    END GC_Manzana;\r\n\r\n    /** Dato geografico aportado por el Gestor Catastral respecto del perimetro urbano de una entidad territorial.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Perímetro"\r\n    CLASS GC_Perimetro =\r\n      /** Código de 2 dígitos del Departamento según clasificación de Divipola.\r\n       */\r\n      !!@ ili2db.dispName = "Código del departamento"\r\n      Codigo_Departamento : TEXT*2;\r\n      /** Código de 5 dígitos que une los 2 dígitos del Departamento y los 3 dígitos del municipio según la clasificación de Divipola.\r\n       */\r\n      !!@ ili2db.dispName = "Código del municipio"\r\n      Codigo_Municipio : TEXT*5;\r\n      /** Tipo de avalúo catastral del perímetro urbano.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de avalúo"\r\n      Tipo_Avaluo : TEXT*30;\r\n      /** Nombre geográfico del perímetro municipal, por ejemplo el nombre del municipio.\r\n       */\r\n      !!@ ili2db.dispName = "Nombre geográfico"\r\n      Nombre_Geografico : TEXT*50;\r\n      /** Código del nombre geográfico.\r\n       */\r\n      !!@ ili2db.dispName = "Código nombre"\r\n      Codigo_Nombre : TEXT*255;\r\n      /** Polígono del perímetro urbano.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface2D;\r\n    END GC_Perimetro;\r\n\r\n    /** Datos de los propietarios inscritos en las bases de datos catastrales que tienen relación con un predio.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Propietario"\r\n    CLASS GC_Propietario =\r\n      /** Tipo de documento del propietario registrado en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de documento"\r\n      Tipo_Documento : TEXT*100;\r\n      /** Número de documento del propietario registrado en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Número de documento"\r\n      Numero_Documento : TEXT*50;\r\n      /** Dígito de verificación de las personas jurídicas.\r\n       */\r\n      !!@ ili2db.dispName = "Dígito de verificación"\r\n      Digito_Verificacion : TEXT*1;\r\n      /** Primer nombre del propietario en catastro.\r\n       */\r\n      !!@ ili2db.dispName = "Primer nombre"\r\n      Primer_Nombre : TEXT*255;\r\n      /** Segundo nombre del propietario en catastro.\r\n       */\r\n      !!@ ili2db.dispName = "Segundo nombre"\r\n      Segundo_Nombre : TEXT*255;\r\n      /** Primer apellido del propietario en catastro.\r\n       */\r\n      !!@ ili2db.dispName = "Primer apellido"\r\n      Primer_Apellido : TEXT*255;\r\n      /** Segundo apellido del propietario en catastro.\r\n       */\r\n      !!@ ili2db.dispName = "Segundo apellido"\r\n      Segundo_Apellido : TEXT*255;\r\n      /** Razon social de las personas jurídicas inscritas como propietarios en catastro.\r\n       */\r\n      !!@ ili2db.dispName = "Razón social"\r\n      Razon_Social : TEXT*255;\r\n    END GC_Propietario;\r\n\r\n    /** Dato geografico aportado por el Gestor Catastral respecto de los sectores catastrales rurales de una entidad territorial.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Sector Rural"\r\n    CLASS GC_SectorRural =\r\n      /** Código catastral de 9 dígitos del sector catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Código"\r\n      Codigo : TEXT*9;\r\n      /** Polígono de los sectores catastrales existentes en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface2D;\r\n    END GC_SectorRural;\r\n\r\n    /** Dato geografico aportado por el Gestor Catastral respecto de los sectores catastrales urbanos de una entidad territorial.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Sector Urbano"\r\n    CLASS GC_SectorUrbano =\r\n      /** Código catastral de 9 dígitos del sector catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Código"\r\n      Codigo : TEXT*9;\r\n      /** Polígono de los sectores catastrales existentes en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface2D;\r\n    END GC_SectorUrbano;\r\n\r\n    /** Datos de los terrenos inscritos en las bases de datos catastrales en una entidad territorial.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Terreno"\r\n    CLASS GC_Terreno =\r\n      /** Área de terreno alfanumérica registrada en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Área terreno alfanumérica"\r\n      Area_Terreno_Alfanumerica : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Área de terreno digital registrada en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Área terreno digital"\r\n      Area_Terreno_Digital : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Código de la manzana o vereda donde se localiza el terreno.\r\n       */\r\n      !!@ ili2db.dispName = "Código de manzana vereda"\r\n      Manzana_Vereda_Codigo : TEXT*17;\r\n      /** Número de subterráneos en el terreno.\r\n       */\r\n      !!@ ili2db.dispName = "Número de subterráneos"\r\n      Numero_Subterraneos : 0 .. 999999999999999;\r\n      /** Polígono de la unidad de construcción existente en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface2D;\r\n    END GC_Terreno;\r\n\r\n    /** Datos de las unidades de construcción inscritas en las bases de datos catastrales en una entidad territorial.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Unidad Construcción"\r\n    CLASS GC_UnidadConstruccion =\r\n      /** Identificado de la unidad de construcción, su codificación puede ser por letras del abecedario.\r\n       */\r\n      !!@ ili2db.dispName = "Identificador"\r\n      Identificador : TEXT*2;\r\n      /** Etiqueta de la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Etiqueta"\r\n      Etiqueta : TEXT*50;\r\n      /** Indica el tipo de dominio de la unidad de construcción: común y privado.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de dominio"\r\n      Tipo_Dominio : TEXT*20;\r\n      /** Indica si la construcción es de tipo convencional o no convencional.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de construcción"\r\n      Tipo_Construccion : Submodelo_Insumos_Gestor_Catastral_V1_0.GC_UnidadConstruccionTipo;\r\n      /** Indica numéricamente la ubicación del predio de acuerdo al tipo de planta.\r\n       */\r\n      !!@ ili2db.dispName = "Planta"\r\n      Planta : TEXT*10;\r\n      /** Número total de  habitaciones en la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Total de habitaciones"\r\n      Total_Habitaciones : 0 .. 999999;\r\n      /** Número total de baños en la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Total de baños"\r\n      Total_Banios : 0 .. 999999;\r\n      /** Número total de locales en la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Total de locales"\r\n      Total_Locales : 0 .. 999999;\r\n      /** Número total de pisos en la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Total de pisos"\r\n      Total_Pisos : 0 .. 150;\r\n      /** Actividad que se desarrolla en una unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Uso"\r\n      Uso : TEXT*255;\r\n      /** Año de construcción de la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Año de construcción"\r\n      Anio_Construccion : 1512 .. 2500;\r\n      /** Puntaje total de la calificación de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Puntaje"\r\n      Puntaje : 0 .. 200;\r\n      /** Área total construida en la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Área construida"\r\n      Area_Construida : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Área total privada de la unidad de construcción para los predios en régimen de propiedad horizontal.\r\n       */\r\n      !!@ ili2db.dispName = "Área privada"\r\n      Area_Privada : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Código catastral del terreno donde se encuentra localizada la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Código terreno"\r\n      Codigo_Terreno : TEXT*30;\r\n      /** Polígono de la unidad de construcción existente en la base de datos catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\r\n    END GC_UnidadConstruccion;\r\n\r\n    /** Dato geografico aportado por el Gestor Catastral respecto de las veredades de una entidad territorial.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Vereda"\r\n    CLASS GC_Vereda =\r\n      /** Código catastral de 17 dígitos de la vereda.\r\n       */\r\n      !!@ ili2db.dispName = "Código"\r\n      Codigo : TEXT*17;\r\n      /** Código catastral de 13 dígitos de la vereda.\r\n       */\r\n      !!@ ili2db.dispName = "Código anterior"\r\n      Codigo_Anterior : TEXT*13;\r\n      /** Nombre de la vereda.\r\n       */\r\n      !!@ ili2db.dispName = "Nombre"\r\n      Nombre : TEXT*100;\r\n      /** Código catastral de 9 dígitos del código de sector donde se encuentra la vereda.\r\n       */\r\n      !!@ ili2db.dispName = "Código del sector"\r\n      Codigo_Sector : TEXT*9;\r\n      /** Geometría en 2D de la vereda.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface2D;\r\n    END GC_Vereda;\r\n\r\n    /** Información existente en las bases de datos catastrales respecto de los predios en una entidad territorial.\r\n     */\r\n    !!@ ili2db.dispName = "(GC) Predio Catastro"\r\n    CLASS GC_PredioCatastro =\r\n      /** Indica si el predio se encuentra en catastro fiscal o Ley 14.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de catastro"\r\n      Tipo_Catastro : TEXT*255;\r\n      /** Código numérico de 30 dígitos que permita localizarlo inequívocamente en los respectivos documentos catastrales, según el modelo determinado por el Instituto Geográfico Agustín Codazzi.\r\n       */\r\n      !!@ ili2db.dispName = "Número predial"\r\n      Numero_Predial : TEXT*30;\r\n      /** Código numérico de 20 dígitos que permita localizarlo inequívocamente en los respectivos documentos catastrales, según el modelo determinado por el Instituto Geográfico Agustín Codazzi.\r\n       */\r\n      !!@ ili2db.dispName = "Número predial anterior"\r\n      Numero_Predial_Anterior : TEXT*20;\r\n      /** Es un código único para identificar los inmuebles tanto en los sistemas de información catastral como registral. El NUPRE no implicará supresión de la numeración catastral ni registral asociada a la cédula catastral ni a la matrícula inmobiliaria actual.\r\n       */\r\n      !!@ ili2db.dispName = "Número único predial"\r\n      NUPRE : TEXT*11;\r\n      /** Circulo registral al que se encuentra inscrito el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Círculo registral"\r\n      Circulo_Registral : TEXT*4;\r\n      /** Identificador único asignado por las oficinas de registro de instrumentos públicos.\r\n       */\r\n      !!@ ili2db.dispName = "Matrícula inmobiliaria catastro"\r\n      Matricula_Inmobiliaria_Catastro : TEXT*80;\r\n      /** Direcciones del predio inscritas en catastro.\r\n       */\r\n      !!@ ili2db.dispName = "Direcciones"\r\n      Direcciones : BAG {0..*} OF Submodelo_Insumos_Gestor_Catastral_V1_0.Datos_Gestor_Catastral.GC_Direccion;\r\n      /** Tipo de predio inscrito en catastro: Nacional, Departamental, Municipal, Particular, Baldío, Ejido, Resguardo Indígena, Tierra de comunidades negras y Reservas Naturales.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de predio"\r\n      Tipo_Predio : TEXT*100;\r\n      /** Caracterización temática del predio.\r\n       */\r\n      !!@ ili2db.dispName = "Condición del predio"\r\n      Condicion_Predio : Submodelo_Insumos_Gestor_Catastral_V1_0.GC_CondicionPredioTipo;\r\n      /** Es la clasificación para fines estadísticos que se da a cada inmueble en su conjunto–terreno, construcciones o edificaciones-, en el momento de la identificación predial de conformidad con la actividad predominante que en él se desarrolle.\r\n       */\r\n      !!@ ili2db.dispName = "Destinación económica"\r\n      Destinacion_Economica : TEXT*150;\r\n      /** Estado del predio en la base de datos catastral según los actos administrativos o judiciales que versan sobre el mismo.\r\n       */\r\n      !!@ ili2db.dispName = "Estado del predio"\r\n      Estado_Predio : BAG {0..*} OF Submodelo_Insumos_Gestor_Catastral_V1_0.Datos_Gestor_Catastral.GC_EstadoPredio;\r\n      /** Indica el sistema de gestión catastral de donde proceden los datos, en el caso del IGAC puede ser COBOL o SNC.\r\n       */\r\n      !!@ ili2db.dispName = "Sistema procedencia de los datos"\r\n      Sistema_Procedencia_Datos : Submodelo_Insumos_Gestor_Catastral_V1_0.GC_SistemaProcedenciaDatosTipo;\r\n      /** Fecha de la vigencia de los datos.\r\n       */\r\n      !!@ ili2db.dispName = "Fecha de los datos"\r\n      Fecha_Datos : MANDATORY INTERLIS.XMLDate;\r\n    END GC_PredioCatastro;\r\n\r\n    ASSOCIATION gc_construccion_unidad =\r\n      gc_unidad_construccion -- {0..*} GC_UnidadConstruccion;\r\n      gc_construccion -- {1} GC_Construccion;\r\n    END gc_construccion_unidad;\r\n\r\n    ASSOCIATION gc_datosphcondominio_datostorreph =\r\n      gc_datostorreph -- {0..*} GC_DatosTorrePH;\r\n      gc_datosphcondominio -- {0..1} GC_DatosPHCondominio;\r\n    END gc_datosphcondominio_datostorreph;\r\n\r\n    ASSOCIATION gc_unidadconstruccion_calificacionunidadconstruccion =\r\n      gc_unidadconstruccion -- {0..1} GC_UnidadConstruccion;\r\n      gc_calificacionunidadconstruccion -- {0..*} GC_CalificacionUnidadConstruccion;\r\n    END gc_unidadconstruccion_calificacionunidadconstruccion;\r\n\r\n    ASSOCIATION gc_construccion_predio =\r\n      gc_predio -- {1} GC_PredioCatastro;\r\n      gc_construccion -- {0..*} GC_Construccion;\r\n    END gc_construccion_predio;\r\n\r\n    /** Clase que relaciona las unidades prediales a los predios matrices bajo el regimen de propiedad horizontal inscritos en las bases de datos catastrales.\r\n     */\r\n    ASSOCIATION gc_copropiedad =\r\n      gc_matriz -<> {0..1} GC_PredioCatastro;\r\n      gc_unidad -- {0..*} GC_PredioCatastro;\r\n      Coeficiente_Copropiedad : 0.0000000 .. 100.0000000;\r\n    END gc_copropiedad;\r\n\r\n    ASSOCIATION gc_ph_predio =\r\n      gc_predio -- {1} GC_PredioCatastro;\r\n      gc_datos_ph -- {0..1} GC_DatosPHCondominio;\r\n    END gc_ph_predio;\r\n\r\n    ASSOCIATION gc_propietario_predio =\r\n      gc_predio_catastro -- {1} GC_PredioCatastro;\r\n      gc_propietario -- {0..*} GC_Propietario;\r\n    END gc_propietario_predio;\r\n\r\n    ASSOCIATION gc_terreno_predio =\r\n      gc_predio -- {1} GC_PredioCatastro;\r\n      gc_terreno -- {0..*} GC_Terreno;\r\n    END gc_terreno_predio;\r\n\r\n  END Datos_Gestor_Catastral;\r\n\r\nEND Submodelo_Insumos_Gestor_Catastral_V1_0.\r\n\r\nMODEL Submodelo_Insumos_SNR_V1_0 (es)\r\nAT "http://www.proadmintierra.info/"\r\nVERSION "V2.3"  // 2019-07-31 // =\r\n  IMPORTS LADM_COL_V3_0;\r\n\r\n  DOMAIN\r\n\r\n    SNR_CalidadDerechoTipo = (\r\n      /** El dominio que se llama también propiedad es el derecho real en una cosa corporal, para gozar y disponer de ella arbitrariamente, no siendo contra ley o contra derecho ajeno. (Art. 669 CC):\r\n       * \r\n       * 0100\r\n       * 0101\r\n       * 0102\r\n       * 0103\r\n       * 0106\r\n       * 0107\r\n       * 0108\r\n       * 0109\r\n       * 0110\r\n       * 0111\r\n       * 0112\r\n       * 0113\r\n       * 0114\r\n       * 0115\r\n       * 0116\r\n       * 0117\r\n       * 0118\r\n       * 0119\r\n       * 0120\r\n       * 0121\r\n       * 0122\r\n       * 0124\r\n       * 0125\r\n       * 0126\r\n       * 0127\r\n       * 0128\r\n       * 0129\r\n       * 0130\r\n       * 0131\r\n       * 0132\r\n       * 0133\r\n       * 0135\r\n       * 0137\r\n       * 0138\r\n       * 0139\r\n       * 0140\r\n       * 0141\r\n       * 0142\r\n       * 0143\r\n       * 0144\r\n       * 0145\r\n       * 0146\r\n       * 0147\r\n       * 0148\r\n       * 0150\r\n       * 0151\r\n       * 0152\r\n       * 0153\r\n       * 0154\r\n       * 0155\r\n       * 0156\r\n       * 0157\r\n       * 0158\r\n       * 0159\r\n       * 0160\r\n       * 0161\r\n       * 0163\r\n       * 0164\r\n       * 0165\r\n       * 0166\r\n       * 0167\r\n       * 0168\r\n       * 0169\r\n       * 0171\r\n       * 0172\r\n       * 0173\r\n       * 0175\r\n       * 0177\r\n       * 0178\r\n       * 0179\r\n       * 0180\r\n       * 0181\r\n       * 0182\r\n       * 0183\r\n       * 0184\r\n       * 0185\r\n       * 0186\r\n       * 0187\r\n       * 0188\r\n       * 0189\r\n       * 0190\r\n       * 0191\r\n       * 0192\r\n       * 0193\r\n       * 0194\r\n       * 0195\r\n       * 0196\r\n       * 0197\r\n       * 0198\r\n       * 0199\r\n       * 01003\r\n       * 01004\r\n       * 01005\r\n       * 01006\r\n       * 01007\r\n       * 01008\r\n       * 01009\r\n       * 01010\r\n       * 01012\r\n       * 01013\r\n       * 01014\r\n       * 0301\r\n       * 0307\r\n       * 0321\r\n       * 0332\r\n       * 0348\r\n       * 0356\r\n       * 0374\r\n       * 0375\r\n       * 0376\r\n       * 0377\r\n       * 0906\r\n       * 0907\r\n       * 0910\r\n       * 0911\r\n       * 0912\r\n       * 0913\r\n       * 0915\r\n       * 0917\r\n       * 0918\r\n       * 0919\r\n       * 0920\r\n       * 0924\r\n       * 0935\r\n       * 0959\r\n       * 0962\r\n       * 0963\r\n       */\r\n      !!@ ili2db.dispName = "Dominio"\r\n      Dominio,\r\n      /** Es la inscripción en la Oficina de Registro de Instrumentos Públicos, de todo acto de transferencia de un derecho incompleto que se hace a favor de una persona, por parte de quien carece del derecho de dominio sobre determinado inmueble: \r\n       * \r\n       * 0600\r\n       * 0601\r\n       * 0602\r\n       * 0604\r\n       * 0605\r\n       * 0606\r\n       * 0607\r\n       * 0608\r\n       * 0609\r\n       * 0610\r\n       * 0611\r\n       * 0613\r\n       * 0614\r\n       * 0615\r\n       * 0616\r\n       * 0617\r\n       * 0618\r\n       * 0619\r\n       * 0620\r\n       * 0621\r\n       * 0622\r\n       * 0136\r\n       * 0508\r\n       * 0927\r\n       */\r\n      !!@ ili2db.dispName = "Falsa tradición"\r\n      Falsa_Tradicion,\r\n      /** La propiedad separada del goce de la cosa se llama mera o nuda propiedad (art 669 CC):\r\n       * \r\n       * Códigos:\r\n       * \r\n       * 0302\r\n       * 0308\r\n       * 0322\r\n       * 0349\r\n       * 0379\r\n       */\r\n      !!@ ili2db.dispName = "Nuda propiedad"\r\n      Nuda_Propiedad,\r\n      /** Es la propiedad de toda una comunidad sea indígena o negra. Adjudicacion Baldios En Propiedad Colectiva A Comunidades Negras, Adjudicacion Baldios Resguardos Indigenas, Constitución Resguardo Indigena,\r\n       * Ampliación De Resguardo Indígena\r\n       * \r\n       * Códigos:\r\n       * \r\n       * 0104\r\n       * 0105\r\n       * 01001\r\n       * 01002\r\n       */\r\n      !!@ ili2db.dispName = "Derecho de propiedad colectiva"\r\n      Derecho_Propiedad_Colectiva,\r\n      /** El derecho de usufructo es un derecho real que consiste en la facultad de gozar de una cosa con cargo de conservar su forma y sustancia, y de restituir a su dueño, si la cosa no es fungible; o con cargo de volver igual cantidad y calidad del mismo género, o de pagar su valor si la cosa es fungible. (art. 823 CC):\r\n       * \r\n       * 0310\r\n       * 0314\r\n       * 0323\r\n       * 0333\r\n       * 0378\r\n       * 0380\r\n       * 0382\r\n       * 0383\r\n       */\r\n      !!@ ili2db.dispName = "Usufructo"\r\n      Usufructo\r\n    );\r\n\r\n    SNR_ClasePredioRegistroTipo = (\r\n      /** Constituyen esta categoría los terrenos no aptos para el uso urbano, por razones de oportunidad, o por su destinación a usos agrícolas, ganaderos, forestales, de explotación de recursos naturales y actividades análogas. (Artículo 33, Ley 388 de 1997)\r\n       */\r\n      !!@ ili2db.dispName = "Rural"\r\n      Rural,\r\n      /** Constituyen el suelo urbano, las áreas del territorio distrital o municipal destinadas a usos urbanos por el plan de ordenamiento, que cuenten con infraestructura vial y redes primarias de energía, acueducto y alcantarillado, posibilitándose su urbanización y edificación, según sea el caso. Podrán pertenecer a esta categoría aquellas zonas con procesos de urbanización incompletos, comprendidos en áreas consolidadas con edificación, que se definan como áreas de mejoramiento integral en los planes de ordenamiento territorial.\r\n       * \r\n       * Las áreas que conforman el suelo urbano serán delimitadas por perímetros y podrán incluir los centros poblados de los corregimientos. En ningún caso el perímetro urbano podrá ser mayor que el denominado perímetro de servicios públicos o sanitario. (Artículo 31, Ley 388 de 1997)\r\n       */\r\n      !!@ ili2db.dispName = "Urbano"\r\n      Urbano,\r\n      !!@ ili2db.dispName = "Sin información"\r\n      Sin_Informacion\r\n    );\r\n\r\n    SNR_DocumentoTitularTipo = (\r\n      /** Es un documento emitido por la Registraduría Nacional del Estado Civil para permitir la identificación personal de los ciudadanos.\r\n       */\r\n      !!@ ili2db.dispName = "Cédula de ciudadanía"\r\n      Cedula_Ciudadania,\r\n      /** Es el documento que cumple los fines de identificación de los extranjeros en el territorio nacional y su utilización deberá estar acorde con la visa otorgada al extranjero.\r\n       */\r\n      !!@ ili2db.dispName = "Cédula de extranjería"\r\n      Cedula_Extranjeria,\r\n      /** El Número de Identificación Tributaria (NIT) es un código privado, secreto e intransferible que solamente debe conocer el contribuyente.\r\n       */\r\n      !!@ ili2db.dispName = "NIT"\r\n      NIT,\r\n      /** Es el documento oficial que hace las veces de identificación para los menores de edad entre los 7 y los 18 años.\r\n       */\r\n      !!@ ili2db.dispName = "Tarjeta de identidad"\r\n      Tarjeta_Identidad,\r\n      /** Registro donde se hacen constar por autoridades competentes los nacimientos, matrimonios, defunciones y demás hechos relativos al estado civil de las personas. En el modelo se tendrá en cuenta el número de registro como identificación personal de las personas de 0 a 7 años.\r\n       */\r\n      !!@ ili2db.dispName = "Registro civil"\r\n      Registro_Civil,\r\n      /** El Número Único de Identificación Personal, es el número que permite identificar a los colombianos durante toda su vida.\r\n       */\r\n      !!@ ili2db.dispName = "NUIP"\r\n      NUIP,\r\n      /** Es un consecutivo asignado automáticamente en registro en lugar del número de la identificación de la persona que hace el trámite, se usa especialmente en trámites de construcción cuando el proyecto está a nombre de una Fiducia el cual tiene el mismo número del banco.\r\n       */\r\n      !!@ ili2db.dispName = "Secuencial SNR"\r\n      Secuencial_SNR\r\n    );\r\n\r\n    SNR_FuenteTipo = (\r\n      /** Un acto administrativo es toda manifestación o declaración emanada de la administración pública en el ejercicio de potestades administrativas, mediante el que impone su voluntad sobre los derechos, libertades o intereses de otros sujetos públicos o privados y que queda bajo el del comienzo.\r\n       */\r\n      !!@ ili2db.dispName = "Acto administrativo"\r\n      Acto_Administrativo,\r\n      /** Una escritura pública es un documento público en el que se realiza ante un notario público un determinado hecho o un derecho autorizado por dicho fedatario público, que firma con el otorgante u otorgantes,mostrando sobre la capacidad jurídica del contenido y de la fecha en que se realizó\r\n       */\r\n      !!@ ili2db.dispName = "Escritura pública"\r\n      Escritura_Publica,\r\n      /** La sentencia es la resolución judicial definitiva dictada por un juez o tribunal que pone fin a la litis o caso sometido a su conocimiento y cierra definitivamente su actuación en el mismo\r\n       */\r\n      !!@ ili2db.dispName = "Sentencia judicial"\r\n      Sentencia_Judicial,\r\n      /** Documento que contiene un compromiso entre dos o más personas que lo firman.\r\n       */\r\n      !!@ ili2db.dispName = "Documento privado"\r\n      Documento_Privado,\r\n      /** Cuando no se haya documento soporte pero puede ser una declaración verbal.\r\n       */\r\n      !!@ ili2db.dispName = "Sin documento"\r\n      Sin_Documento\r\n    );\r\n\r\n    SNR_PersonaTitularTipo = (\r\n      /** Se refiere a la persona humana.\r\n       */\r\n      !!@ ili2db.dispName = "Persona natural"\r\n      Persona_Natural,\r\n      /** Se llama persona jurídica, una persona ficticia, capaz de ejercer derechos y contraer obligaciones civiles, y de ser representada judicial y extrajudicialmente. Las personas jurídicas son de dos especies: corporaciones y fundaciones de beneficencia pública.\r\n       */\r\n      !!@ ili2db.dispName = "Persona jurídica"\r\n      Persona_Juridica\r\n    );\r\n\r\n  TOPIC Datos_SNR =\r\n\r\n    /** Datos del derecho inscrito en la SNR.\r\n     */\r\n    !!@ ili2db.dispName = "(SNR) Derecho"\r\n    CLASS SNR_Derecho =\r\n      /** Calidad de derecho en registro\r\n       */\r\n      !!@ ili2db.dispName = "Calidad derecho registro"\r\n      Calidad_Derecho_Registro : MANDATORY Submodelo_Insumos_SNR_V1_0.SNR_CalidadDerechoTipo;\r\n      /** es el número asignado en el registro a cada acto sujeto a registro.\r\n       */\r\n      !!@ ili2db.dispName = "Código naturaleza jurídica"\r\n      Codigo_Naturaleza_Juridica : TEXT*5;\r\n    END SNR_Derecho;\r\n\r\n    !!@ ili2db.dispName = "(SNR) Estructura Matrícula Matriz"\r\n    STRUCTURE SNR_EstructuraMatriculaMatriz =\r\n      /** Es el nùmero que se ha asignado a la Oficina de Registro de Instrumentos públicos correspondiente.\r\n       */\r\n      !!@ ili2db.dispName = "Código ORIP"\r\n      Codigo_ORIP : TEXT*20;\r\n      /** Es el consecutivo que se asigna a cada predio jurídico abierto en la ORIP.\r\n       */\r\n      !!@ ili2db.dispName = "Matrícula inmobiliaria"\r\n      Matricula_Inmobiliaria : TEXT*20;\r\n    END SNR_EstructuraMatriculaMatriz;\r\n\r\n    /** Datos del documento que soporta la descripción de cabida y linderos.\r\n     */\r\n    !!@ ili2db.dispName = "(SNR) Fuente Cabida Linderos"\r\n    CLASS SNR_FuenteCabidaLinderos =\r\n      /** Tipo de documento que soporta la relación de tenencia entre el interesado con el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de documento"\r\n      Tipo_Documento : Submodelo_Insumos_SNR_V1_0.SNR_FuenteTipo;\r\n      /** Identificador del documento, ejemplo: numero de la resolución\r\n       */\r\n      !!@ ili2db.dispName = "Número de documento"\r\n      Numero_Documento : TEXT*255;\r\n      !!@ ili2db.dispName = "Fecha de documento"\r\n      Fecha_Documento : INTERLIS.XMLDate;\r\n      /** Es tipo de oficina que emite el documento (notaria, juzgado)\r\n       */\r\n      !!@ ili2db.dispName = "Ente emisor"\r\n      Ente_Emisor : TEXT*255;\r\n      /** Es la ciudad donde se encuentra ubicada la oficina que expide el documento.\r\n       */\r\n      !!@ ili2db.dispName = "Ciudad emisora"\r\n      Ciudad_Emisora : TEXT*255;\r\n      /** Identificador del archivo fuente controlado por una clase externa.\r\n       */\r\n      !!@ ili2db.dispName = "Archivo"\r\n      Archivo : LADM_COL_V3_0.LADM_Nucleo.ExtArchivo;\r\n    END SNR_FuenteCabidaLinderos;\r\n\r\n    /** Datos del documento que soporta el derecho.\r\n     */\r\n    !!@ ili2db.dispName = "(SNR) Fuente Derecho"\r\n    CLASS SNR_FuenteDerecho =\r\n      /** Tipo de documento que soporta la relación de tenencia entre el interesado con el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de documento"\r\n      Tipo_Documento : Submodelo_Insumos_SNR_V1_0.SNR_FuenteTipo;\r\n      /** Identificador del documento, ejemplo: numero de la resolución\r\n       */\r\n      !!@ ili2db.dispName = "Número de documento"\r\n      Numero_Documento : TEXT*255;\r\n      !!@ ili2db.dispName = "Fecha del documento"\r\n      Fecha_Documento : INTERLIS.XMLDate;\r\n      /** Es tipo de oficina que emite el documento (notaria, juzgado)\r\n       */\r\n      !!@ ili2db.dispName = "Ente emisor"\r\n      Ente_Emisor : MTEXT*255;\r\n      /** Es la ciudad donde se encuentra ubicada la oficina que expide el documento.\r\n       */\r\n      !!@ ili2db.dispName = "Ciudad emisora"\r\n      Ciudad_Emisora : TEXT*255;\r\n    END SNR_FuenteDerecho;\r\n\r\n    /** Datos de titulares de derecho inscritos en la SNR.\r\n     */\r\n    !!@ ili2db.dispName = "(SNR) Titular"\r\n    CLASS SNR_Titular =\r\n      /** Tipo de persona\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de persona"\r\n      Tipo_Persona : Submodelo_Insumos_SNR_V1_0.SNR_PersonaTitularTipo;\r\n      /** Tipo de documento del que se trata.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de documento"\r\n      Tipo_Documento : Submodelo_Insumos_SNR_V1_0.SNR_DocumentoTitularTipo;\r\n      /** Documento de identidad del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Número de documento"\r\n      Numero_Documento : MANDATORY TEXT*50;\r\n      /** Nombres de la persona física.\r\n       */\r\n      !!@ ili2db.dispName = "Nombres"\r\n      Nombres : TEXT*500;\r\n      /** Primer apellido de la persona física.\r\n       */\r\n      !!@ ili2db.dispName = "Primer apellido"\r\n      Primer_Apellido : TEXT*255;\r\n      /** Segundo apellido de la persona física.\r\n       */\r\n      !!@ ili2db.dispName = "Segundo apellido"\r\n      Segundo_Apellido : TEXT*255;\r\n      /** Nombre con el que está inscrita la persona jurídica\r\n       */\r\n      !!@ ili2db.dispName = "Razón social"\r\n      Razon_Social : MTEXT*255;\r\n    END SNR_Titular;\r\n\r\n    /** Datos del predio entregados por la SNR.\r\n     */\r\n    !!@ ili2db.dispName = "(SNR) Predio Registro"\r\n    CLASS SNR_PredioRegistro =\r\n      /** Es el nùmero que se ha asignado a la Oficina de Registro de Instrumentos públicos correspondiente.\r\n       */\r\n      !!@ ili2db.dispName = "Código ORIP"\r\n      Codigo_ORIP : TEXT*3;\r\n      /** Es el consecutivo que se asigna a cada predio jurídico abierto en la ORIP.\r\n       */\r\n      !!@ ili2db.dispName = "Matrícula inmobiliaria"\r\n      Matricula_Inmobiliaria : TEXT*80;\r\n      /** Nuevo código númerico de treinta (30) dígitos, que se le asigna a cada predio y busca localizarlo inequívocamente en los documentos catastrales, según el modelo determinado por el Instituto Geográfico Agustin Codazzi, registrado en SNR.\r\n       */\r\n      !!@ ili2db.dispName = "Número predial nuevo en FMI"\r\n      Numero_Predial_Nuevo_en_FMI : TEXT*100;\r\n      /** Anterior código númerico de veinte (20) digitos, que se le asigna a cada predio y busca localizarlo inequívocamente en los documentos catastrales, según el modelo determinado por el Instituto Geográfico Agustin Codazzi, registrado en SNR.\r\n       */\r\n      !!@ ili2db.dispName = "Número predial anterior en FMI"\r\n      Numero_Predial_Anterior_en_FMI : TEXT*100;\r\n      /** Conjunto de símbolos alfanuméricos, los cuales designan vías y predios de la ciudad.\r\n       */\r\n      !!@ ili2db.dispName = "Nomenclatura según registro"\r\n      Nomenclatura_Registro : TEXT*255;\r\n      /** El texto de cabida y linderosque está consignado en el registro público de la propiedad sobre el cual se ejercen los derechos.\r\n       */\r\n      !!@ ili2db.dispName = "Cabida y linderos"\r\n      Cabida_Linderos : MTEXT;\r\n      /** Corresponde al dato de tipo de predio incorporado en las bases de datos registrales\r\n       */\r\n      !!@ ili2db.dispName = "Clase del suelo según registro"\r\n      Clase_Suelo_Registro : Submodelo_Insumos_SNR_V1_0.SNR_ClasePredioRegistroTipo;\r\n      /** Es la matrícula por la cual se dio apertura al predio objeto de estudio (la madre).\r\n       */\r\n      !!@ ili2db.dispName = "Matrícula inmobiliaria matriz"\r\n      Matricula_Inmobiliaria_Matriz : BAG {0..*} OF Submodelo_Insumos_SNR_V1_0.Datos_SNR.SNR_EstructuraMatriculaMatriz;\r\n      /** Fecha de la generación de datos.\r\n       */\r\n      !!@ ili2db.dispName = "Fecha de datos"\r\n      Fecha_Datos : MANDATORY INTERLIS.XMLDate;\r\n    END SNR_PredioRegistro;\r\n\r\n    ASSOCIATION snr_derecho_fuente_derecho =\r\n      snr_derecho -- {1..*} SNR_Derecho;\r\n      snr_fuente_derecho -- {1} SNR_FuenteDerecho;\r\n    END snr_derecho_fuente_derecho;\r\n\r\n    /** Datos del titular del derecho con relación al porcentaje de participación en el derecho\r\n     */\r\n    ASSOCIATION snr_titular_derecho =\r\n      snr_titular -- {1..*} SNR_Titular;\r\n      snr_derecho -- {1..*} SNR_Derecho;\r\n      Porcentaje_Participacion : TEXT*100;\r\n    END snr_titular_derecho;\r\n\r\n    ASSOCIATION snr_derecho_predio =\r\n      snr_predio_registro -- {1} SNR_PredioRegistro;\r\n      snr_derecho -- {1..*} SNR_Derecho;\r\n    END snr_derecho_predio;\r\n\r\n    ASSOCIATION snr_predio_registro_fuente_cabidalinderos =\r\n      snr_predio_registro -- {0..*} SNR_PredioRegistro;\r\n      snr_fuente_cabidalinderos -- {0..1} SNR_FuenteCabidaLinderos;\r\n    END snr_predio_registro_fuente_cabidalinderos;\r\n\r\n  END Datos_SNR;\r\n\r\nEND Submodelo_Insumos_SNR_V1_0.\r\n\r\nMODEL Submodelo_Integracion_Insumos_V1_0 (es)\r\nAT "mailto:PC4@localhost"\r\nVERSION "2019-09-06"  =\r\n  IMPORTS Submodelo_Insumos_Gestor_Catastral_V1_0,Submodelo_Insumos_SNR_V1_0;\r\n\r\n  DOMAIN\r\n\r\n    INI_EmparejamientoTipo = (\r\n      /** FMI SNR - Matricula Inmobiliaria IGAC ; Número Predial IGAC - Número predial SNR ; Número predial Anterior IGAC - Número predial Anterior SNR\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 1"\r\n      Tipo_1,\r\n      /** FMI SNR - Matricula Inmobiliaria IGAC ; Número Predial IGAC - Número predial SNR\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 2"\r\n      Tipo_2,\r\n      /** FMI SNR - Matricula Inmobiliaria IGAC ; Número predial Anterior IGAC - Número predial Anterior SNR\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 3"\r\n      Tipo_3,\r\n      /** FMI SNR - Matricula Inmobiliaria IGAC ; Número Predial IGAC - Número predial Anterior SNR\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 4"\r\n      Tipo_4,\r\n      /** FMI SNR - Matricula Inmobiliaria IGAC ; Número predial Anterior IGAC - Número predial SNR\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 5"\r\n      Tipo_5,\r\n      /** Número Predial IGAC - Número predial SNR ; Número predial Anterior IGAC - Número predial Anterior SNR\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 6"\r\n      Tipo_6,\r\n      /** Número Predial IGAC - Número predial SNR\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 7"\r\n      Tipo_7,\r\n      /** Número predial Anterior IGAC - Número predial Anterior SNR\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 8"\r\n      Tipo_8,\r\n      /** Número Predial IGAC - Número predial Anterior SNR\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 9"\r\n      Tipo_9,\r\n      /** Número predial Anterior IGAC - Número predial SNR\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 10"\r\n      Tipo_10,\r\n      /** FMI SNR - Matricula Inmobiliaria IGAC\r\n       */\r\n      !!@ ili2db.dispName = "Tipo 11"\r\n      Tipo_11\r\n    );\r\n\r\n  TOPIC Datos_Integracion_Insumos =\r\n    DEPENDS ON Submodelo_Insumos_SNR_V1_0.Datos_SNR,Submodelo_Insumos_Gestor_Catastral_V1_0.Datos_Gestor_Catastral;\r\n\r\n    /** Clase que relaciona los predios en los modelos de insumos para el Gestor Catastral y la SNR.\r\n     */\r\n    !!@ ili2db.dispName = "(Integración Insumos) Predio Insumos"\r\n    CLASS INI_PredioInsumos =\r\n      /** Tipo de emparejamiento de insumos Catastro-Registro\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de emparejamiento"\r\n      Tipo_Emparejamiento : Submodelo_Integracion_Insumos_V1_0.INI_EmparejamientoTipo;\r\n      /** Observaciones de la relación.\r\n       */\r\n      !!@ ili2db.dispName = "Observaciones"\r\n      Observaciones : TEXT;\r\n    END INI_PredioInsumos;\r\n\r\n    ASSOCIATION ini_predio_integracion_gc =\r\n      gc_predio_catastro (EXTERNAL) -- {0..1} Submodelo_Insumos_Gestor_Catastral_V1_0.Datos_Gestor_Catastral.GC_PredioCatastro;\r\n      ini_predio_insumos -- {0..*} INI_PredioInsumos;\r\n    END ini_predio_integracion_gc;\r\n\r\n    ASSOCIATION ini_predio_integracion_snr =\r\n      snr_predio_juridico (EXTERNAL) -- {0..1} Submodelo_Insumos_SNR_V1_0.Datos_SNR.SNR_PredioRegistro;\r\n      ini_predio -- {0..*} INI_PredioInsumos;\r\n    END ini_predio_integracion_snr;\r\n\r\n  END Datos_Integracion_Insumos;\r\n\r\nEND Submodelo_Integracion_Insumos_V1_0.\r\n	2020-07-22 10:37:35.576
